INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bf075-e50f-11e4-8bc4-d4a2af868f3e', 66, 'Ennis, Co. Clare', '27', '2012-03-14 19:02:32+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 3, '10am to 12pm every Saturday during school term', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Ennis","geonameId":"2964405"}', 'St. Flannans College IT Centre, Ennis', '52.83407687266317,-8.983179879188583', '<ul><li>A laptop if you have one.</li><li>A USB stick if you plan to use the school&#39;s computers.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Please drop us an email to be put on waiting list for next intake of new kids.&nbsp;</li></ul>', 'enniscoderdojo@gmail.com', 'http://www.coderdojoennis.com/', 'coderdojoennis', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'M', 'Munster', '03', 'An Clár', '', '', '', '', '2964405', 'Ennis');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093befec-e50f-11e4-8bc4-d4a2af868f3e', 64, 'Ennistymon', '39', '2012-03-14 15:14:16+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 2, '7:00 - 9:00 pm every Friday', NULL, NULL, NULL, NULL, NULL, 'Ennistymon Enterprise Centre, Ennistymon, Co. Clare', '', '<p ><strong><u><span>What is <span class=SpellE>CoderDojo</span>?</span></u></strong><span><br> <span class=SpellE>CoderDojo</span> is a movement of free coding clubs for young people. At a <span class=SpellE>CoderDojo</span>, young people learn how to code,develop websites, apps, programs, games and more. Dojos are set up, run by and taught at by volunteers</span><o:p></o:p></p> <p class=MsoNormal><strong><u><span>Cost</span></u></strong><span><br> <span class=SpellE>Cost</span> is absolutely free!<o:p></o:p></span></p> <p class=MsoNormal><b><u><span>Laptops<o:p></o:p></span></u></b></p> <p class=MsoNormal><span>We do have some Laptops available but we are now running <span class=GramE>out ! The kids that have access to them could they please bring them along.</span></p> <p class=MsoNormal><b><u><span>Topics covered<o:p></o:p></span></u></b></p> <p class=MsoNormal><span> The sessions will focus on a choice of: its pretty varied but we start from Scratch ! Creating your own games with Scratch, Lego Mindstorm (Robotics), Website development with HTML and JavaScript, Game Studio (more advanced game creation), Mobile Apps, Microsoft Small Basic, Flash Games, Python, Raspberry PI and Arduino (Sensors) </span></p> <p class=MsoNormal><b><u><span>VERY IMPORTANT:<o:p></o:p></span></u></b></p> <p class=MsoNormal><span> A parent/guardian must stay with all children 12 years old or younger for the entire duration of the session. As well as keeping an eye on their children and equipment, parents/guardians will also be able to learn along with them. </span></p> <p class=MsoNormal><b><u><span>Contact:<o:p></o:p></span></u></b></p> <p class=MsoNormal><span> Contact: Mike Linnane (087) 2393077 or Eddie Crowe (085) 7279768 for more info. </span></p>', 'coderdojoennistymon@gmail.com', 'null', 'CDojoEnnistymon', 'null', 'null', 'null', 0, 'null', '-infinity', 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
