INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c2dba-e50f-11e4-8bc4-d4a2af868f3e', 119, 'West Cork', '278', '2012-04-23 15:21:50+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 0, 'Visit individual Dojo pages.', NULL, NULL, NULL, NULL, NULL, 'Visit individual Dojo pages.', '', 'Dojos in West Cork: <ul> <li>Bandon (Booking Required), Tuesdays (starting 26th June), 6-8pm, Town Hall, <a href="http://zen.coderdojo.com/dojo/144">click for details</a></li> <li>Rosscarbery, Mondays, 7-9pm, Celtic Ross Hotel, <a href="http://zen.coderdojo.com/dojo/123">click for details</a></li> <li>Clonakilty (Booking Required), Fridays, 6.30-8.30pm, Quality Hotel, <a href="http://zen.coderdojo.com/dojo/125">click for details</a></li> <li>Kinsale, Fridays, 7-9pm, Kinsale Community School, <a href="http://zen.coderdojo.com/dojo/54">click for details</a></li> </ul> <p>Please check with the individual Dojos to confirm schedule. Some may be taking a break over the summer holidays.</p> <p>We''ve had enquiries about Dojos in Bantry and Beara, but haven''t heard of any plans to get started yet.</p> <p><b>All of the dojos need more mentors!</b> <a href="http://coderdojo.com/help-us/mentor-or-teach/">Click here to see more about being a mentor.</a> Contact your nearest Dojo and get involved.</p> If you are in West Cork and are interested in starting up a Dojo in your area: <ul> <li><a href="http://coderdojo.com/help-us/i-want-to-start-a-coderdojo-right-now/">Click here to read about setting up a Dojo</a></li> <li> <a href="mailto:westcork@coderdojo.com">click here to email for advice and support from other Dojos in West Cork</a></li> </ul>', 'westcork@coderdojo.com', 'null', 'CoderDojoWCork', 'https://groups.google.com/d/forum/coder-dojo-west-cork', 'null', 'null', 1, '12', '2014-03-13 11:31:27+02', 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
