INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c2e3f-e50f-11e4-8bc4-d4a2af868f3e', 121, 'IDSC', '225', '2012-04-26 12:04:30+03', NULL, 'null', 0, 1, 0, 'Every Sunday 12pm-3pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"North Strand","geonameId":"6691025"}', 'IDSC, Innovation House, Eastpoint Business Park, Dublin 3', '53.35726562490988,-6.224650740623474', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'idsc@coderdojo.com', 'null', 'CoderDojoIDSC', 'https://groups.google.com/group/coderdojo-idsc/', '3441512657', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '', '', '', '', '', '', '', '', '6691025', 'North Strand');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c2d65-e50f-11e4-8bc4-d4a2af868f3e', 118, 'Cork CIT Blackrock Castle Observatory', '276', '2012-04-23 13:06:52+03', '2013-12-01 14:25:29+02', '3006', 1, 0, 2, 'Friday''s between 17:00-19:00 EXCEPT for the first Friday of every month when it will NOT take place', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Blackrock","geonameId":"2966132"}', 'CIT Blackrock Castle Observatory, Blackrock, Cork.', '51.900244103718194,-8.402462304229743', '<p><br /><strong>What You Need To Bring:</strong></p><p>&nbsp;</p><p>&nbsp;</p><ul><li>If you have one, a laptop. If not, let us know and we can have a machine for you to use</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p><br /><strong>Who can attend:</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>Due to space restrictions you must register each week. Registration opens every Sunday evening at 19:00 for the following Friday&#39;s class</li><li>We require a parent or guardian to accompany 12s and under partially to keep an eye on their equipment, partially to keep an eye on their charges and partially to learn along with them.</li><li>Parents and students can eventually become mentors (heck, the kids have come up with far more elegant solutions for some problems).</li><li>Very young kids may not get much out of it, but we regularly have 8 year olds. They would need to be able to handle medium strength English words and some mathematics to get much out of it. Its thought programming should be done in schools, or at least programmatic thinking, just after long division as its the first abstract algorithm most kids encounter. We do often have younger siblings of kids in the dojo who watch on or play on other computer devices, in preparation for future coding genius.</li></ul><p><br /><strong>Cost: Free!</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>The venue and utilities are provided to us at no charge and mentors donate their time so that we can provide this opportunity for kids at no charge.</li></ul><p><br /><strong>Topics we cover at the moment include:</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>HTML/CSS/Javascript (Web Frontend).</li><li>Other topics will be presented depending on what mentors are around on the day. If there is anything in particular that you or the kids would like to cover, let us know.</li><br /><li>Contact: <a href="mailto:info@bco.ie?Subject=CoderDojo BCO"> info@bco.ie</a><br /><br /><em>Please make sure you&#39;ve read the information above before emailing, as we think weve covered most topics that are likely to come up.</em></li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'info@bco.ie', 'http://coderdojo.bco.ie', 'blackrockcastle', 'null', '11503532375', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'M', 'Munster', '04', 'County Cork', '', '', '', '', '2966132', 'Blackrock');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c2bc6-e50f-11e4-8bc4-d4a2af868f3e', 115, 'Washington, D.C. metro area', '866', '2012-04-20 14:03:44+03', '2013-12-01 14:25:29+02', '3006', 1, 0, 2, 'Every other Sunday 3-5PM', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Montgomery County"}', '{"toponymName":"Maryland"}', '{}', '{"name":"Beantown","geonameId":"4348110"}', 'Elk''s Lodge, 5 Taft Ct, Rockville, MD 20850', '39.09579300000001,-77.13039100000003', '<p>Please visit&nbsp;<a href="http://coderdojodc.com/">CoderDojoDC.com</a>&nbsp;for the latest events!</p>', 'washingtondc.us@coderdojo.com', 'http://CoderDojoDC.com', 'CoderDojoDC', 'http://groups.google.com/group/CoderDojoDC', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'MD', 'Maryland', '', '', '', '', '', '', '4348110', 'Beantown');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c2f59-e50f-11e4-8bc4-d4a2af868f3e', 123, 'Rosscarbery', '318', '2012-05-01 09:42:39+03', '2013-10-14 08:35:45+03', '21', 2, 1, 1, 'Mondays 7-9pm', NULL, NULL, NULL, NULL, NULL, 'Celtic Ross Hotel', '', 'You should bring (if you can): <ul><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). The parent must stay with the child/children for the entire session.</strong></li></ul> To start out, we''ll be working on the following: <ul><li>Basic HTML & CSS to set up your own webpage, using <a href="http://notepad-plus-plus.org/" target="_blank">Notepad ++</a> for Windows or <a href="http://www.barebones.com/products/textwrangler/" target="_blank">Text Wrangler for Mac.</a></li> <li><a href="http://scratch.mit.edu/" target="_blank">Scratch</a>, a programme designed for children to create their own games without knowing advanced coding, a great start to learning how coding a game works.</li> <li>There is also a group of teens learning the Python programming language.</li> </ul> <p>If possible, please download these two programmes to your laptops before the session.</p> <p>Also check out <a href="http://www.coderdojowestcork.wordpress.com" target="_blank">www.coderdojowestcork.wordpress.com</a> for more information as well as downloads of the presentations from previous sessions.</p> <p>The following websites are helpful to get some additional knowledge on these areas:</p> <ul><li><a href="http://w3schools.com/" target="_blank">W3Schools</a>, easy online tutorials for HTML and CSS</li> <li><a href="http://www.codecademy.com" target="_blank">Codecademy</a> an online, interactive, way to learn to code.</li></ul> <p><b>We are very grateful to The Celtic Ross Hotel for providing a great venue. Please show your thanks by purchasing drinks and other refreshments while you are here.</b></p>', 'rosscarbery@coderdojo.com', 'null', 'CoderDojoWCork', 'https://groups.google.com/forum/?fromgroups#!forum/coder-dojo-west-cork', 'null', 'http://coderdojo.com/wp-content/uploads/2012/05/ross-coderdojo-sponsers.jpg', 0, 'null', '-infinity', 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
