INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c3216-e50f-11e4-8bc4-d4a2af868f3e', 129, 'Sardegna', '348', '2012-05-08 01:41:44+03', '2013-10-14 08:35:45+03', '21', 2, 1, 0, '', NULL, NULL, NULL, NULL, NULL, '', '', 'Grazie a tutti per le vostre emails, oggi ho trovato decine di emails da voi di coderdojo, io mi chiamo Domenico ho incominciato a promuovere coderdojo piu'' di un anno fa quando e'' cominciato ed e'' stato difficile trovare dei partecipanti, al momento mi trovo in Florida dall''altra parte del pianeta e l''entusiasmo che sento dalle vostre emails e'' incredibile , finalmente si puo'' cominciare, ora io sto organizzando con dei volontari in sardegna che sono disposti a contribuire, il coderdojo per definizione e'' un luogo dove persone da 4 a 400 anni si incontrano per imparare qualcosa, e'' rivolto ai bambini dai 4 in su ma anche a chi si sente ancora bambino nei confronti della tecnologia e vuole diventare parte attiva dell''innovazione, questo progetto necessita di uno spazio in cui i partecipanti si incontrino e condividono informazioni e interessi, il principale obiettivo dell''iniziativa e'' far avvicinare i nostri figli alla tecnologia, dare loro la possibilita'' di imparare a programmare , di cominciare subito a sviluppare il loro talento! programmare e scrivere codice e'' una attivita'' creativa come dipingere o scrivere un romanzo, e'' questo che impareranno frequentando il dojo, miglioreranno il loro inglese, perche'' si programma in inglese , i linguaggi di programmazione non sono altro che matematica tradotta in inglese, cominceremo subito con un linguaggio di programmazione che si chiama scratch in cui loro creeranno il loro primo videogame, fino ad arrivare alla completa conoscienza di quanto sia importante ai nostri giorni che qualcuno sia in grado di creare strumenti capaci di rendere la vita delle persone migliore.Sto cercando una soluzione veloce per cominciare subito e online in modo tale che i primi incontri possano essere fatti direttamente sul web da casa vostra, nel frattempo organizzero'' un luogo e dei volontari e continuero'' ad essere presente agli incontri online. Vi aggiornero'' presto riguardo l''iniziativa, per il momento vi ringrazio per il vostro interesse ed entusiasmo.', 'domenicomelis@gmail.com', 'null', 'null', 'null', 'null', 'null', 0, 'null', '-infinity', 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
