INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c438f-e50f-11e4-8bc4-d4a2af868f3e', 166, 'Amsterdam - Urban Office', '517', '2012-07-10 09:06:41+03', '2013-12-01 14:25:28+02', '3006', 1, 0, 1, 'Monthly, Sunday mornings, see www.coderdojo.nl', '{"countryName":"Netherlands","geonameId":"2750405","alpha2":"NL"}', '{"toponymName":"Gemeente Amsterdam"}', '{"toponymName":"North Holland"}', '{}', '{"name":"Weesperzijde","geonameId":"7648382"}', 'Urban Office, Tolstraat 129,  Amsterdam', '52.353094,4.906051400000024', '<p>English below</p><p><span >Een keer per maand komen we zondagochtend bij elkaar in een ruim atelier van een architect. Afhankelijk van de mentoren doen we Scratch, Raspberry Pi, 3D printing ...</span></p><p><span >Er zijn computers maar je mag ook je eigen computer meenemen.</span></p><p><span >Once a month at Sunday morning we gather at a spacious architects office. Depending on mentors available we do different stuff like Scratch, RaspberryPi and 3D printing.</span></p><p><span >Laptops available, no problem if you bring your own.</span></p>', 'info@parlarie.nl', 'https://sites.google.com/site/kidscodemakespace/', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'NL', 'NLD', NULL, NULL, 528, 'Netherlands, Kingdom of the', '07', 'North Holland', '', '', '', '', '', '', '7648382', 'Weesperzijde');
