INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e0f76-e50f-11e4-8bc4-d4a2af868f3e', 522, 'Berlin', '2575', '2013-10-31 13:41:09+02', '2013-12-01 14:25:25+02', '3006', 1, 1, 2, 'Next one: Saturday March 14, from 14:00 to 17:00', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{"toponymName":""}', '{"toponymName":"Berlin"}', '{"toponymName":"Berlin, Stadt"}', '{"name":"Gesundbrunnen","geonameId":"2920789"}', 'SoundCloud HQ, Rheinsberger Str 76/77, 10115 Berlin', '52.53698356796671,13.394929999999931', '<p>Schick eine Email an <a href="mailto:coderdojoberlin@tif.ca">coderdojoberlin@tif.ca</a> und wir setzen dich auf den Verteiler f&uuml;r Erinnerungen und Neuigkeiten.</p><p>Send an email to <a href="mailto:coderdojoberlin@tif.ca">coderdojoberlin@tif.ca</a> and we will add you to the mailing list for reminders and updates.</p><p>&nbsp;</p><p><strong>Wo / Where?</strong></p><p>SoundCloud HQ, <strong>Rheinsberger Str 76/77</strong>, 10115 Berlin.</p><p>&nbsp;</p><p>CoderDojo ist ein Club fuer Kinder und Jugendliche im Alter von 5 bis 17 Jahren, die programmieren lernen und Spass haben wollen.&nbsp;Hier findest du mehr Informationen: http://coderdojo.com/about</p><ul><li>Laptop mitbringen. Falls du keinen hast, leih dir einen oder frag uns.</li><li><strong>Einen Elternteil! Wenn du 12 Jahre alt oder juenger bist, muss ein Erwachener die ganze Zeit ueber dabei sein.</strong></li></ul><p>CoderDojo is a club for kids aged 5 to 17 to learn to code and have fun. Read more about it here: http://coderdojo.com/about<br /><br />Bring:</p><ul><li>A laptop. Borrow one from someone, or contact us if you need one</li><li><strong>A parent! If you are 12 or under, an adult must stay with you during the session.</strong></li></ul><p><strong>Mentors</strong></p><p>If you want to help children learn how to code by becoming a mentor plese see our <a target="_blank" href="http://www.meetup.com/CoderDojo-Berlin/">Mentor Meetup Group</a> where we coordinate mentorship for every dojo.</p>', 'coderdojoberlin@tif.ca', 'null', 'CoderDojoBerlin', 'https://groups.google.com/forum/#!forum/coderdojo-berlin', '15877781873', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '16', 'Berlin', '', '', '', '', '', '', '2920789', 'Gesundbrunnen');
