INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c65c1-e50f-11e4-8bc4-d4a2af868f3e', 207, 'Navan', '741', '2012-10-01 16:54:13+03', '2013-12-01 14:25:28+02', '3006', 1, 1, 2, '10:00 - 12:30 and 2:00 - 4:30 second Saturday of each month.', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Windtown","geonameId":"9866818"}', 'Unity Centre, Windtown, Navan, Co. Meath', '53.669911,-6.698629', '<a href="http://www.flickr.com/photos/coderdojonavan/8538541361/" title="ZenImage by CoderDojoNavan, on Flickr"><img src="http://farm9.staticflickr.com/8110/8538541361_e3b08ed6e5.jpg" width="491" height="180" alt="ZenImage"></a><br><br> <p> <b><font color=#21610B>CoderDojo Navan</font></font></b> is a cool, free environment where kids can learn how to program, build websites, animated characters and games with different software programs and languages.<br>All the mentors are volunteers who either teach or work in IT and our aim is to help you develop the skills you like.<br> Currently, we are teaching beginners, intermediate and advanced <b>Scratch.</b> We also teach <b>HTML/CSS, JavaScript</b> and <b>App Inventor.</b><br><br> <b><font color=#FF0000>If you are a parent with IT skills, we are always looking for mentors! Please chat with a current mentor to find out more.</font></b><br><br> <b>Some details on our sessions:</b></p> <ul> <li>We meet on second Saturday of each month.</li><br> <li>Booking ahead is essential. Tickets are available at <a href="http://coderdojonavan.eventbrite.ie"><b><font color=#0000FF>Eventbrite</font></b></a></li><br> <li>There are two sessions: Morning 10:00 to 12:30 and Afternoon 2:00 to 4:30</li><br> <li><b>Every child must have a parent or adult in charge!</b></li><br> <li>Person must stay with child during the session (helping if possible)</li><br> <li>CoderDojo Navan is supported by Unity Centre, Navan</li><br> <li>Click here to visit our website for latest information and assignment sheets in advance of the upcoming session: <a href="http://coderdojonavan.wordpress.com"><b><font color=#0000FF>CoderDojo Navan</font></b></a></li><br> <li>Check out our Facebook page: <a href="http://facebook.com/coderdojonavan"><b><font color=#0000FF>CoderDojo Navan on Facebook</font></b></a><br><br> <b><i>What you need to bring:</i></b></li> <ol> <li>Please bring a WIFI enabled laptop, fully charged if possible</li><br> <li>Please install Scratch 2.0 offline editor on your laptop - you can get it <a href="http://scratch.mit.edu/scratch2download"><b><font color="#FF0000">Here</font></b></a></li><br><li>We suggest you bring your own mouse to create graphics as the mouse pad on a laptop can be difficult to use as a drawing device. We suggest you install DrawPlus SE (Starter Edition) which is a free vector drawing and exporting package. You can get it <a href="http://www.freeserifsoftware.com"><b><font color="#FF0000">Here</font></b></a>.</li><br> <li>Also, we think it would be a good idea to bring a USB key to save your work</li><br> <li>Bring a snack and a drink for the interval</li><br> <li>If you are new to CoderDojo Navan, you can pre-register as a member by downloading our registration form <a href="http://coderdojonavan.wordpress.com/2013/01/29/registration-form-for-coderdojo-navan/"><b><font color="#FF0000">Here</font></b></a>, fill out and present it to a mentor<br> when you arrive</li><br> </ol></ul> <p><h4><font color=#21610B>Happy Coding!</font></h4></p>', 'coderdojonavan@gmail.com', 'http://coderdojonavan.wordpress.com', 'CoderDojoNavan', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', 'Leinster', '21', 'An Mhí', '', '', '', '', '9866818', 'Windtown');
