INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943c594-e50f-11e4-8bc4-d4a2af868f3e', 1048, 'Majadahonda, Madrid', '4558', '2014-10-30 16:15:04+02', '2014-11-07 16:13:07+02', '4124', 1, 1, 2, 'Every Saturday 11-13 h / Todos los sábados de 11 a 13 h', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Madrid"}', '{"toponymName":"Madrid"}', '{"toponymName":"Majadahonda"}', '{"name":"Majadahonda","geonameId":"3117667"}', 'Centro Juvenil &quot;Príncipe de Asturias&quot; C/ Dr. Calero, 37. CP: 28220. Majadahonda. Madrid', '40.47414253170484,-3.866673620237748', '<h4><strong>Informaci&oacute;n B&aacute;sica</strong></h4><ul><li>Todas las personas entre 8 y 17 a&ntilde;os con ganas aprender programar y compartir todo lo que saben son bienvenidas en CoderDojo Majadahonda.<br />&nbsp;</li><li>Si te interesa la programaci&oacute;n contamos con los/as mejores mentores a este lado la zona noroeste para ayudarte a avanzar ;)<br />&nbsp;</li><li>El equipo de mentores/as esta formado por personas con muy diferentes habilidades, experiencia y formaci&oacute;n; ellos y ellas no son profesores al uso pero s&iacute; est&aacute;n para guiarte.<br />&nbsp;</li><li>Los/as mentores son personas voluntarias que rotar&aacute;n durante el proyecto.<br />&nbsp;</li><li>Para ser un coder s&oacute;lo tienes que enviarnos un correo a mlorenzo@majadahonda.org e indicanos si quieres ser mentor/a o participante. Te facilitaremos la ficha de preinscripci&oacute;n y te contestaremos lo m&aacute;s pronto que nos sea posible.<br />&nbsp;</li><li>Es recomendable que un adulto acompa&ntilde;e durante la actividad a las personas menores de 12 a&ntilde;os.<br />&nbsp;</li><li>Es necesario traer el port&aacute;til a todas las reuniones, del resto nos encargamos desde CoderDojo Majadahonda ;)</li></ul><p>---</p><h4><strong>Basic Information:</strong></h4><ul><li>Everyone between the ages of 8 and 17, with an interest in programming and willingness to share their knowledge with others, is welcome to CoderDojo Majadahonda.<br />&nbsp;</li><li>If you have an interest in programming, we can supply you with the best possible mentors to help you progress in your knowledge ;)<br />&nbsp;</li><li>The mentoring team consists of people with very different skills, experience and training; they are not teachers but are here to guide and support you.<br />&nbsp;</li><li>The mentors are volunteers that attend at a rotating schedule throughout the duration of the project.<br />&nbsp;</li><li>To be a coder, just send an email to mlorenzo@majadahonda.org&nbsp;and let us know if you want to be a mentor or participant. We will provide the pre-registration form and get back to you as soon as we can.<br />&nbsp;</li><li>It is recommended for an adult to accompany participiants below the age of 12.<br />&nbsp;</li><li>It is necessary that you bring your own laptop to the events, but the rest will be supplied by CoderDojo Majadahonda ;)</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'mlorenzo@majadahonda.org', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'ES', 'ESP', NULL, NULL, 724, 'Spain, Kingdom of', '29', 'Madrid', '', '', '', '', '', '', '3117667', 'Majadahonda');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c69d8-e50f-11e4-8bc4-d4a2af868f3e', 215, 'Brickodeurs::Saint Gratien 95', '847', '2012-11-07 12:58:58+02', '2013-12-01 14:25:28+02', '3006', 1, 1, 1, 'Every Saturday, 10am-12am', '{"countryName":"France","geonameId":"3017382","alpha2":"FR"}', '{"toponymName":"Val d''Oise"}', '{"toponymName":"Île-de-France"}', '{"toponymName":"Arrondissement de Sarcelles"}', '{"name":"Saint-Gratien","geonameId":"2979627"}', 'FESC, place Georgette Agutte, 95210 Saint Gratien, FRANCE', '48.96137351829812,2.286513923942607', '<p>Depuis 1980, l&#39;association Forum Education Science Culture (FESC) propose des activites de decouverte des sciences et techniques : Astronomie et electronique dans les annees 80, Micro-informatique dans les annees 90, montages photos et videos dans les annees 2000.</p><div>Depuis 2008, nous avons monte un club/atelier de Robotique ludique pour participer a la First Lego League.</div><div>Aujourd&#39;hui FESC se concentre sur 4 ateliers :</div><div><ul><li>Incubateur d&#39;initiatives numeriques et creatives</li><li>Atelier Photos numeriques pour tous (mais surtout des seniors),</li><li>Atelier Videos pour tous (mais surtout des seniors),</li><li>Atelier Robotique pour les juniors, mais nous nous sommes diversifies vers la programmation de jeux videos avec SCRATCH, KODU et RPG Maker.</li></ul></div><div>Chaque semaine nous organisons des seances : le mercredi et le vendredi soir pour la photo et la video, le jeudi pour l&#39;initiation informatique, le samedi matin pour la &quot;robotique&quot;.</div><div>Notre ligne directrice est l&#39;utilisation creative des technologies en explorant, combinant et transformant les usages numeriques.</div><div>&nbsp;</div><div>Nous sommes base <a target="_blank" href="https://www.google.com/maps/ms?msid=212249516430509179786.0004942458953d081ff5e&msa=0">a Saint Gratien a 400 metres de la gare RER C</a>.</div><div>&nbsp;</div><div>La contribution que nous pouvons apporter est de vous proposer des locaux (que nous avons la chance d&#39;avoir de facon permanente).</div><div>Nous pouvons proposer des ateliers de creation de jeux video avec SCRATCH/KODU/RPG Maker. Ces ateliers peuvent etre animes par un facilteur ou par nos jeunes membres qui ont entre 12/15 ans.</div><div>Un atelier LEGO Mindstorms : construire son robot Mindstorms et le programmer avec NXT-G ou Scratch/Enchanting,</div><div>Un atelier Montage video : monter des videos prise avec son telephone portable et les publier sur Youtube animes par des &quot;seniors&quot; qui serait heureux d&#39;accueillir un nouveau public.</div><div>&nbsp;</div><div>Visitez notre site web :<a href="http://fesc.asso.fr/">http://fesc.asso.fr/</a></div><div>&nbsp;</div><div>Consultez notre agenda :<a href="http://fesc.asso.fr/Agenda-du-club-de-robotique-de">http://fesc.asso.fr/Agenda-du-club-de-robotique-de</a></div><div>&nbsp;</div><div><a href="http://facebook.fr/fesc.St.gratien">http://facebook.fr/fesc.St.gratien</a></div><div>&nbsp;</div><p>&nbsp;</p><p>&nbsp;</p><h3>For English speakers :</h3><p>&nbsp;</p><p>&nbsp;</p><div><div>Since 1980, the Association Forum Education Science Culture (FESC) provides discovery activities Science and Technology: Astronomy and electronics in the 80s, Micro-computers in the 90s, photo montages and videos in the 2000s.</div><div>Since 2008, we have started a club / workshop Robotics fun to participate in the First Lego League.</div><div>Today FESC focuses on four workshops:</div><div><ul><li>Introduction to computers for seniors,</li><li>Workshop Digital Photos for all (but especially seniors),</li><li>Videos workshop for all (but especially seniors),</li><li>Robotics workshop for juniors, but we diversified into game programming with SCRATCH videos, and Kodu RPG Maker.</li></ul></div><div>Every week we organize sessions: Wednesday and Friday evenings for photo and video on Thursday for computer literacy on Saturday morning for &quot;robotics&quot;.</div><div>Our guideline is the creative use of technology, exploring, combining and transforming digital uses.</div><div>&nbsp;</div><div>We are based in Saint Gratien 400 meters from the RER C.</div><div>&nbsp;</div><div>The contribution we can make is to provide you with local (we are lucky to have permanently).</div><div>We can offer creative workshops with video games SCRATCH / Kodu / RPG Maker. These workshops can be facilitated by myself or by our young members who are between 12/15 years.</div><div>LEGO Mindstorms workshop: build a robot and program it with Mindstorms NXT-G or Scratch / Enchanting,</div><div>Video Editing workshop: mount videos taken with your mobile phone and post them on Youtube.</div><div>&nbsp;</div><div><div>Our website :<a href="http://fesc.asso.fr/">http://fesc.asso.fr/</a></div><div>&nbsp;</div><div>Our agenda :<a href="http://fesc.asso.fr/Agenda-du-club-de-robotique-de">http://fesc.asso.fr/Agenda-du-club-de-robotique-de</a></div><p><a href="http://facebook.fr/fesc.St.gratien">http://facebook.fr/fesc.St.gratien</a></p></div></div>', 'club.storm@fesc.asso.fr', 'http://fesc.asso.fr/', 'Coderdojo_stgra', 'http://fesc.asso.fr/Idees-pour-ameliorer-le-club-STORM', 'null', 'http://fesc.asso.fr/IMG/siteon0.png', 0, 'null', NULL, 0, 'null', 'EU', 'FR', 'FRA', NULL, NULL, 250, 'France, French Republic', 'A8', 'Île-de-France', '', '', '', '', '', '', '2979627', 'Saint-Gratien');
