INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c5b48-e50f-11e4-8bc4-d4a2af868f3e', 191, 'Scottish Parliament, Edinburgh', '618', '2012-08-31 07:57:39+03', NULL, 'null', 0, 0, 2, 'Thursday 25 October 6pm-9pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Edinburgh"}', '{"toponymName":"Scotland"}', '{}', '{"name":"York Place","geonameId":"9171556"}', 'The Scottish Parliament, Edinburgh', '55.95159,-3.174237', '<ul> <li>Come along to our free coding club for young people to learn everything you need to know to become a great coder! No previous coding experience is necessary<em><br /></em></li> <li>We will reply to confirm your place.<em><br /></em></li> <li>On the day you''ll need to bring along a laptop.<em><br /></em></li> <li>Parents must attend to supervise.<em><br /></em></li> <li>Further details about CoderDojo at www.coderdojo.com.<em><br /></em></li> <li>Please email dojo@igsteele.com with any questions or if you would like to support us in any way.</li> </ul>', 'edinburghdojo@igsteele.com', 'null', 'CoderDojoEdin', 'null', '4392221252', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'SCT', 'Scotland', '', '', '', '', '', '', '9171556', 'York Place');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e20b3-e50f-11e4-8bc4-d4a2af868f3e', 559, 'Brisbane - Chermside Library', '2707', '2013-11-28 02:29:39+02', '2013-12-20 12:28:25+02', '3006', 1, 1, 0, 'Every Saturday from 28th February – 4th April, 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Chermside","geonameId":"6943582"}', 'Chermside Library, 375 Hamilton Rd, Chermside QLD 4032', '-27.3862335,153.03497140000002', '<p>&nbsp;</p><p><strong>CoderDojo Brisbane kicks off Term&nbsp;1 2015&nbsp;at Chermside Library!</strong></p><p><strong>Registration for this event includes all sessions from Saturday 28th February until Saturday 4th April (inclusive) from 12.30 - 2.30pm.&nbsp;</strong></p><p>Kids aged 7 - 17 will be exposed to programming tools such as Scratch and HTML, and can then create their own projects to work on with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop</li><li>snack or lunch</li></ul><p><em><strong>Please Note: a parent is to supervise if a participant is aged under 15 years.</strong></em></p><p><strong><strong>For more information, visit the&nbsp;<a href="http://coderdojobrisbane.com.au/get-involved/participants/">CoderDojo Brisbane website.</a></strong></strong></p>', 'info@coderdojobrisbane.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '6943582', 'Chermside');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e5b50-e50f-11e4-8bc4-d4a2af868f3e', 647, 'Edinburgh @Prewired', '0', '2014-01-30 19:41:57+02', '2014-02-05 13:27:51+02', '3006', 1, 0, 2, 'First and third Wednesday of every month, 5.30-7.30pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Edinburgh"}', '{"toponymName":"Scotland"}', '{}', '{"name":"Old Town","geonameId":"7644905"}', 'Level 4 Appleton Tower, 11 Crichton Street, Edinburgh', '55.944373,-3.1868930000000546', '<p>Most Prewired sessions are unstructured, and give you a chance to work on your own projects or learn something new with the help of our mentors. Sometimes we have a special talk or workshop so you can learn a lot about something you might not have thought about before (please check the website to see what''s coming up).</p> <p><strong>Registering</strong></p> <p>Everyone under 19 is welcome, even if you''ve never coded before. Only enthusiasm is necessary!</p> <p>Make sure you register on the eventbrite! So we know how many people are coming, and so we can get important details like your parents'' phone numbers.</p> <p><strong>Resources</strong></p> <p>Bring a laptop if you can (we have a few spares, but not many) and any cool technology you want to hack with. And if you have bugs that need fixing, bring those, we have people who can help :)</p> <p>Light refreshments provided.</p> <p><strong>Parents</strong></p> <p>Parents welcome but not necessary.</p> <p><strong>Mentors</strong></p> <p>If you''d like to come along as a mentor, please request to join prewired-helpers@googlegroups.com with some information about yourself and skills, and we''ll be in touch.</p>', 'hello@prewired.org', 'http://prewired.org', 'prewired', 'https://groups.google.com/forum/#!forum/prewired-discuss', '10049009859', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'SCT', 'Scotland', '', '', '', '', '', '', '7644905', 'Old Town');
