E', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '7281839', 'Carindale');
