INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0944688b-e50f-11e4-8bc4-d4a2af868f3e', 1285, 'Dandenong, Melbourne @ Wooranna Park Primary School', '5209', '2015-02-14 00:46:35+02', '2015-02-18 10:24:20+02', '4124', 1, 0, 0, 'Sundays 10am to 1pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Greater Dandenong"}', '{"toponymName":"Victoria"}', '{}', '{"name":"Dandenong North","geonameId":"9972522"}', '89-105 Carlton Road Dandenong North Victoria, Australia 3175', '-37.95974,145.21705399999996', '<ul><li>A laptop.</li><li>any other hardware we want to bring along</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'dandenong.au@coderdojo.com', 'null', 'null', 'https://groups.google.com/d/forum/wppscoderdojo', '33198953', 'null', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '07', 'Victoria', '', '', '', '', '', '', '9972522', 'Dandenong North');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e724c-e50f-11e4-8bc4-d4a2af868f3e', 694, 'Charlestown', '2324', '2014-02-24 16:14:16+02', '2014-02-24 16:33:58+02', '3006', 1, 1, 2, 'Saturdays, 10:00am - 12:00pm - Check EventBrite For Confirmation', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Connaught"}', '{}', '{"name":"Charlestown","geonameId":"2965518"}', 'St. Attracta''s N.S. , Charlestown, Mayo', '53.961162234029146,-8.799448561668441', '<ul><li><strong>We teach short courses, between 1 to 3 sessions. </strong>Check the booking info to see what the next session number is. If you miss the first of those sessions then we advise maybe waiting until the next course starts, you won''t have to wait long, only a couple of weeks. <em>We will run some courses twice if demand is there. So for example if you miss ''Beginners Scratch'' (3 week course) on week 1 then we suggest you wait until week 4 when the course will be run again from the beginning.</em></li><li><strong>Only those attending the Dojo need a ticket</strong> - if you''re a parent supervising your child, you don''t need to book a ticket for you, only for your child.</li><li>Book a ticket for each Dojo session you want to attend, a ticket to one session doesn''t apply to the next one. <strong>Use the EventBrite System at the bottom of this page to do so</strong>. You will only be able to book the ticket when event is published. Until then, sit tight!</li><li>You MUST bring your own laptop/macbook. Give it a full charge before coming, as power outlets may be limited. All software used will be free!<strong> Please install Chrome/Firefox/Safari </strong>browsers on Laptops as Internet Explorer does not work great. If you cannot get  hold of a laptop then let us know and we will do our best to get one for you.</li><li>Tickets to CoderDojo Charlestown are FREE, but if you would like to make a donation on the day, all money collected will go back into supplies, venue hire, lunch, etc. for the kids attending. The money will not be used to pay for organisers and mentors - these are volunteers and give of their time freely.</li><li>We can''t take anyone under 7 years old - sorry!</li><li><strong>Children 10 or under AND Children of any age with little to no experience of using a computer MUST be accompanied by an adult for the entire duration of the class.</strong></li><li>Feel free to bring along a packed lunch and a drink.</li><li>Car parking spaces are limited, but there should be plenty of onstreet parking available as the venue is in the town and only a short walk from the town centre.</li><li>This event is run by volunteers and as such please be nice, patient and if you can help with sponsorship, laptops, mentoring or any other aspect please don''t hesitate to contact us!</li><li>CoderDojo has just one rule: “Above All: Be Cool“, bullying, lying, wasting people’s time and so on is uncool.</li></ul>', 'charlestown.ie@coderdojo.com', 'http://charlestowndojo.wordpress.com/', 'CoderDojoCtown', 'https://groups.google.com/forum/?hl=en-GB#!forum/coderdojo-charlestown', '15992457872', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'C', 'Connaught', '20', 'Maigh Eo', '', '', '', '', '2965518', 'Charlestown');
