INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940a96c-e50f-11e4-8bc4-d4a2af868f3e', 892, 'kadir', '4088', '2014-08-02 08:52:25+03', NULL, 'null', 0, 0, 0, 'every day for summer', '{"geonameId":"undefined"}', '{}', '{}', '{}', NULL, 'İzmir, Menemen', '42.5,-36.19999999999999', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'kadirsener35@gmail.com', 'http://kadirsener.net', 'ShaolyKungfu', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'TR', 'TUR', NULL, NULL, 792, 'Turkey, Republic of', '', '', '', '', '', '', '', '', NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094086cb-e50f-11e4-8bc4-d4a2af868f3e', 888, 'Ham Richmond', '4041', '2014-07-29 16:58:53+03', '2014-08-18 10:54:52+03', '3006', 1, 0, 2, 'Saturday 21 March 2015 at 1.30pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Richmond upon Thames"}', '{"name":"Ham","geonameId":"6949212"}', 'Ham &amp; Petersham Youth Centre, Ham Close, Off Ashburnham Rd, Richmond TW10 7PL', '51.43814247975755,-0.31514847613527763', '<p><strong>Free event open to children aged 8 to 14 accompanied by a parent or carer. When you have chosen your preferred activity please ensure you pick the appropriate ticket type.</strong></p><p><strong>Newcomers and beginners are welcome!</strong></p><div><p><strong>Raspberry Pi Jam:&nbsp;</strong>Explore the amazing ways to assemble, connect and configure the Raspberry Pi for coding and to control simple electronic circuits. Whether you&#39;re a newcomer to the Pi or have some prior experience, there&#39;ll be lots of fun stuff to see and try out.<strong> Session uses Club Pis</strong></p><p><strong>Scratch</strong>: As well as learning to make some classic video games, over the next sessions we&rsquo;re going to explore other ways of using the powerful features of Scratch: Create amazing coloured patterns automatically and see them drawn with a wireless robot; learn how computers sort numbers and other information; and see how Scratch can control or respond to real-world sensors and other devices. <strong>Session uses club PCs.</strong></p><p><strong>Python:</strong> Over the coming sessions, develop your coding skills in this powerful grown-up scripting language (and have fun too!) by creating guessing games, interactive jokes, fantasy games, noughts &amp; crosses and lots more. You will be placed in a Python group on arrival depending on how many Python sessions you have attended in the past. This helps us make sure you get the best out of the afternoon.&nbsp; <strong>You will need to bring your own laptop. A Windows laptop will work best for getting Python up and running. However, we do have a mac expert who can help install the Python software on a mac.</strong></p><p><strong>If in doubt about which ticket type or activity to choose, feel free to email us for advice :-)</strong></p><p><strong>Terms of participation:</strong></p><p><strong>We are no longer issuing &#39;parent/carer&#39; tickets</strong> but it is still a condition of participation that a parent or carer must accompany their child/children throughout the session and take responsibility for them and for their belongings while on Ham &amp; Petersham Youth Centre premises. Being cool means no bullying, lying or wasting people&#39;s time. Please show respect for the Centre&#39;s equipment and building; and have consideration for others at all times.</p></div><p>&nbsp;</p><p>General information:</p><p>This is the local CoderDojo for kids aged 8 to 14 in Ham, Richmond, North Kingston and surrounding areas. &nbsp; We aim to run our Dojo at least monthly, so join our mailing list by emailing <a href="mailto:hamrichmond.uk@coderdojo.com">hamrichmond.uk@coderdojo.com</a> and follow us on Twitter <a href="http://mce_host/@CoderDojoHam">@CoderDojoHam</a>.</p><p>&nbsp;</p><p>&lt;!--[if gte mso 9]>&lt;xml&gt;
