INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09442665-e50f-11e4-8bc4-d4a2af868f3e', 1185, 'Redhill, Surrey @East Surrey College', '4962', '2015-01-07 12:08:41+02', '2015-01-07 14:24:47+02', '4124', 1, 0, 2, 'Wednesdays, 14:00', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Redhill","geonameId":"2639545"}', 'London Road, Redhill, Surrey RH1 2JX, United Kingdom', '51.239208,-0.16988000000003467', '<p>Primarily a coder group for 16+ students specialising in:</p><ul><li>Python</li><li>PHP</li><li>Ruby</li><li>C++</li><li>C#</li><li>BASH</li></ul><p>ESC students may attend sessions each week, there is no need to register as the dojo is private and students will be invited after expressing an interest.</p><p>As the age profile is 16+ no parental attendance is necessary.</p><p>No food or drink in the computer rooms, please use the college facilities.</p>', 'escpowercoders@gmail.com', 'https://escpowercoders.wordpress.com/power-coders/', 'null', 'https://groups.google.com/forum/#!forum/escpowercoders', 'null', 'null', 0, 'null', NULL, 1, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', '', NULL, '', NULL, '', NULL, '', NULL, '2639545', 'Redhill');
