INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943b96a-e50f-11e4-8bc4-d4a2af868f3e', 1024, 'Boulder, CO, @ Boulder Public Library', '4437', '2014-10-18 15:49:17+03', '2015-02-09 09:46:53+02', '4124', 1, 1, 1, 'Once a month, Saturdays 1:00pm-3:00pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Boulder County"}', '{"toponymName":"Colorado"}', '{}', '{"name":"Boulder","geonameId":"5574991"}', '1001 Arapahoe Ave, Boulder, CO 80302', '40.013952,-105.281769', '<ul><li>Attendees may bring a laptop, but the Library has extra computers available.</li><li>Parents are not required to attend the session.</li></ul>', 'info@coderdojobldr.com', 'http://www.coderdojoboulder.com/', 'coderdojobldr', 'https://groups.google.com/d/forum/coderdojo-boulder-events', '15518634654', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'CO', 'Colorado', '', '', '', '', '', '', '5574991', 'Boulder');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943ba89-e50f-11e4-8bc4-d4a2af868f3e', 1026, 'Trani, Puglia', '4509', '2014-10-21 08:06:11+03', '2014-10-23 13:53:24+03', '4124', 1, 0, 0, 'Sabato 16.00 - 18.00', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Barletta - Andria - Trani"}', '{"toponymName":"Apulia"}', '{"toponymName":"Trani"}', '{"name":"Trani","geonameId":"3165322"}', 'Via Giuseppe di Vittorio, 47, Trani', '41.2687906,16.41759730000001', '<p>Ciao e benvenuto al CoderDojo di Trani &quot;palestra per giovani programmatori&quot;</p><p>Attivita&#39; sessione del 22 Novembre dalle 16.00 alle 18.00:</p><ul><li>Il nostro primo videogioco</li><li>Animiamo il videgioco con il pongo! : come costruire un joypad</li></ul><p>L&#39;evento gratuito verr&agrave; organizzato in collaborazione con gli Operatori Emergenza Radio di Trani presso la loro sede.</p><p>Possono partecipare ragazzi\e di et&agrave; compresa tra i 7 e 15 anni.&nbsp;<br />La prenotazione &egrave; obbligatoria in quanto i posti sono limitati.&nbsp;<br />Dopo la prenotazione verrete ricontattati telefonicamente per confermare i dati comunicati.</p><p>Per partecipare ricordati di portare:</p><ol><li><strong>Un portatile con l&#39;alimentatore ed il mouse.</strong></li><li><strong>Scatola per scarpe, colla stick, did&ograve;(pongo), carta stagnola, forbici punte tonde, colori a spirito</strong></li><li><strong>Un adulto accompagnatore! (Importante: deve restare con te durante l&#39;evento)</strong></li></ol><p><strong>Per informazioni sui prossimi eventi:</strong></p><ul><li><a href="http://coderdojotrani.eventbrite.com/" target="_blank">http://coderdojotrani.eventbrite.com</a></li><li><a href="https://www.facebook.com/coderdojotrani">https://www.facebook.com/coderdojotrani</a></li><li><a href="mailto:trani.it@coderdojo.com?subject=Richiesta informazioni">trani.it@coderdojo.com</a></li></ul>', 'trani.it@coderdojo.com', 'http://www.coderdojotrani.it', 'CoderDojoTrani', 'null', '14441203027', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '13', 'Apulia', '', '', '', '', '', '', '3165322', 'Trani');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093df131-e50f-11e4-8bc4-d4a2af868f3e', 486, 'Dar Earca, Valentia Island', '159', '2013-10-14 08:23:43+03', '2013-12-01 14:25:25+02', '3006', 1, 1, 2, 'Every Monday 6:30pm to 8pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Chapeltown","geonameId":"3297707"}', 'Valentia Island Resource and Childcare Centre, Chapeltown, Valentia Island', '51.908007606195106,-10.334461637959294', '<strong><u>How to join Coderdojo DarEarca:</u></strong> <br/><br/> <strong>1.</strong> If it''s your first time coming along, please complete the registration form for Coderdojo DarEarca available >>> <strong><a href="https://coderdojodarearca.wufoo.com/forms/coderdojo-darearca-registration/" target="_blank">here</a></strong>. <br/><br/> <strong>2.</strong> If you''re planning to join our next session, book your place >>> <strong><a href="http://coderdojodarearca.eventbrite.ie" target="_blank">here</a></strong>. <br/><br/> <strong><u>What you need to bring:</u></strong><br/><br/> <li>A snack.</li> <li>If you have one, a laptop.</li> <li><strong>A parent! (Very important if you are under 13)</strong>.</li> <br/><br/> We accept people all the time, so if you want to start just<strong><a href="http://coderdojodarearca.eventbrite.ie" target="_blank"> book your place </a> </strong>and turn up on the day!</td>', 'darearca.ie@coderdojo.com', 'http://coderdojodarearca.com', 'CoderdojoDarEar', 'https://groups.google.com/forum/#!forum/coderdojo-darearca', 'null', 'http://s10.postimg.org/87ohcvmdl/sponsorlogo.png', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'M', 'Munster', '11', 'Ciarraí', '', '', '', '', '3297707', 'Chapeltown');
