INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e10a1-e50f-11e4-8bc4-d4a2af868f3e', 524, 'Silicon Valley - Campbell', '433', '2013-10-31 17:26:50+02', '2013-12-01 14:25:25+02', '3006', 1, 0, 2, 'Typically the first Tuesday of the month', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Santa Clara County"}', '{"toponymName":"California"}', '{}', '{"name":"Campbell","geonameId":"5333689"}', 'Orchard City Drive Campbell, CA 95008', '37.2862408,-121.94487149999998', '<p><strong>Must pre-register to attend</strong></p><p>For event announcements and information about how to request a seat make sure to&nbsp;<a href="http://coderdojosv.com/join">join our mailing list</a></p><p>To get involved as a mentor, instructor or event volunteer please&nbsp;<a href="http://coderdojosv.com/join">join our mailing list</a>&nbsp;so we may contact you about upcoming needs and opportunities.</p><p>You may also visit the&nbsp;<a href="http://coderdojosv.com">CoderDojo Silicon Valley Regional Website</a>&nbsp;for more information about our program and to see our&nbsp;<a href="http://coderdojosv.com/#calspan">event calendar</a>.</p><p>What to Bring</p><ul><li>A laptop and charger</li><li><strong>A parent! (Very important). All minors 17 and under, must have a parent/legal guardian stay for the duration of the workshop</strong></li></ul><p>NOTE: <strong>Outside food is allowed at this venue.</strong> Feel free to bring a snack/dinner for yourself or to share. &nbsp;Pizza and drinks provided by On-site.com!</p>', 'office@coderdojosv.org', 'http://www.coderdojosv.com', 'coderdojosv', 'null', 'null', 'http://upload.wikimedia.org/wikipedia/en/2/2c/OnSite_logo.png', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '5333689', 'Campbell');
