INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943ce6e-e50f-11e4-8bc4-d4a2af868f3e', 1063, 'Vienna @ UPC', '4571', '2014-11-10 11:19:48+02', '2014-11-10 16:11:43+02', '4124', 1, 1, 2, 'Die nächsten Termine sind - jeweils freitags von 15.00 bis 17.30 Uhr - am 20. März und am 10. April.', '{"countryName":"Austria","geonameId":"2782113","alpha2":"AT"}', '{"toponymName":"Vienna"}', '{"toponymName":"Vienna"}', '{"toponymName":"Gemeindebezirk Meidling"}', '{"name":"Meidling","geonameId":"2771706"}', 'UPC Austria, Wolfganggasse 58-60, 1120 Wien', '48.17859654615826,16.345590441802983', '<p>UPC l&auml;dt Kinder im Alter von 7 bis 12 Jahren, die programmieren lernen und Spass haben wollen, zum CoderDojo &quot;Vienna @ UPC&quot; ein.&nbsp;Hier findest du mehr Informationen &uuml;ber CoderDojos (Englisch): http://coderdojo.com/about.</p><p>Deine Teilnahme ist kostenlos und du ben&ouml;tigst keinerlei Vorkenntnisse!</p><p>Hier bekommst du einen ersten Eindruck: <a href="https://www.youtube.com/watch?v=3gjLIBqGGCQ">https://www.youtube.com/watch?v=3gjLIBqGGCQ</a></p><p>Du brauchst:</p><p>- einen aufgeladenen&nbsp;Laptop mit Maus und Netzkabel. Falls Du keinen hast, leih Dir einen aus oder frag uns. Auf dem Laptop soll bitte Adobe Air installiert sein.</p><p><strong>- eine erwachsene Begleitperson (Eltern, anderer Erziehungsberechtigter oder sonstige Begleitperson)! Falls du 12 Jahre alt oder j&uuml;nger bist, muss ein Erwachsener die ganze Zeit anwesend sein.</strong> <strong>Er/sie wird auch Spass beim CoderDojo haben.</strong></p><p>Nimm deine <strong>Freunde und Freundinnen&nbsp;</strong>mit!</p><p>Bitte deine <strong>Eltern</strong>, dich f&uuml;r das CoderDojo anzumelden.</p><p>- Schicken Sie bitte ein E-Mail an CoderDojo@upc.at mit Ihrem Namen und&nbsp;Ihrer Kontakttelefonnummer sowie den Namen und den Geburtsdaten der Kinder, die Sie beaufsichtigen werden. Bitte geben Sie auch den Termin an, zu dem Sie sich anmelden.</p><p>- Mit der Anmeldung stimmen Sie auch den <strong>Teilnahmebedingungen</strong> (siehe unten) zu. Sie erhalten ein Best&auml;tigungs-E.Mail.</p><p>- Die Platzzahl ist auf 30 Kinder beschr&auml;nkt, es gilt die Reihenfolge der Anmeldung.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <strong>Teilnahmebedingungen</strong></p><p>- CoderDojo &quot;Vienna @ UPC&quot; ist ein Programmierklub, bei dem spielerisches Lernen im Vordergrund steht. UPC Austria l&auml;dt Kinder im Alter von 7 bis 12 Jahren dazu ein.</p><p>- Jedes Kind muss von einem Elternteil, einer/m Erziehungsberechtigten oder einer anderen bevollm&auml;chtigten Aufsichtsperson begleitet und w&auml;hrend der Veranstaltung&nbsp;beaufsichtigt werden.</p><p>- UPC haftet nicht f&uuml;r Verm&ouml;genssch&auml;den, welche dem Teilnehmer durch die Teilnahme an der Veranstaltung entstehen, es sei denn, diese wurden durch zumindest grob fahrl&auml;ssiges Verhalten von UPC verursacht. Die Haftung von Verm&ouml;genssch&auml;den ist in jedem Fall mit &euro; 500 pro Schadensfall begrenzt.</p><p>- Insbesondere haften weder UPC noch die freiwilligen Helfer oder Helferinnen, wenn der mitgebrachte Computer auf Grund von aus dem Internet geladener oder zur Verf&uuml;gung gestellter Software abst&uuml;rzt oder anderen Schaden nimmt.</p><p>- Teilnehmende Eltern bzw. Erziehungsberechtigte stimmen zu, die Haftung f&uuml;r etwaige Sch&auml;den, die durch ihre Kinder verursacht wurden, zu &uuml;bernehmen.</p><p>-&nbsp; Von Ihnen oder Ihren Kindern im Zusammenhang mit der Teilnahme an der Veranstaltung gemachte Fotos, Filmaufnahmen und Interviews d&uuml;rfen von UPC ohne Anspruch auf Verg&uuml;tung in Medien wie z.B. Rundfunk, Fernsehen, Printmedien und Sozialen Medien verbreitet und ver&ouml;ffentlicht werden. Falls Sie damit nicht einverstanden sind, teilen Sie uns das bitte im Anmeldungs-Mail mit.</p><p>- Die Anmeldung ist verbindlich. Es bestehen keine Haftungsanspr&uuml;che f&uuml;r eine abgesagte Veranstaltung.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Ende der Teilnahmebedingungen</strong> (Version Dezember 2014)</p>', 'CoderDojo@UPC.at', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'AT', 'AUT', NULL, NULL, 40, 'Austria, Republic of', '09', 'Vienna', '', '', '', '', '', '', '2771706', 'Meidling');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943cf19-e50f-11e4-8bc4-d4a2af868f3e', 1064, 'Fregene @ Oratorio P.G. Frassati', '4627', '2014-11-10 16:14:15+02', '2014-11-11 13:46:03+02', '4124', 1, 1, 0, 'Once a month on Tuesday, from 16.30 to 18.30', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Rome"}', '{"toponymName":"Latium"}', '{"toponymName":"Fiumicino"}', '{"name":"Fregene","geonameId":"3176544"}', 'Oratorio P.G. Fragene, Via Porto Conte 1, 00054 Fregene (RM), Italy', '41.84853045669824,12.208432201327469', '<ul><li>Merenda</li><li>Un PC Portatile (windows, Mac, Linux)</li><li>Un computer portatile. Se non ce l&#39;hai fattene prestare uno.</li><li>Possibilmente un genitore, fratello. Creare insieme &egrave; pi&ugrave; divertente!</li><li>Partecipazione Gratuita e libera, nessuna registrazione richiesta.</li></ul>', 'coderdojofregene@oratoriofregene.it', 'https://fb.com/coderdojofregene', 'null', 'null', 'null', 'http://www.parrocchiafregene.it/oratorio/web/wp-content/uploads/2014/09/Senza-titolo-13.png', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '07', 'Latium', '', '', '', '', '', '', '3176544', 'Fregene');
