INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e6bb7-e50f-11e4-8bc4-d4a2af868f3e', 681, 'Dublin 1 @ NCI-ELI', '3190', '2014-02-13 10:37:37+02', '2014-02-13 13:13:08+02', '3006', 1, 0, 3, 'Every Tuesday, 5-6.30pm (see dates below)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Mountjoy","geonameId":"2962486"}', 'National College of Ireland, Mayor Street, IFSC, Dublin 1', '53.3486339,-6.2431828', '<p>This 6 week programme at the college is for students between 4th class and 1st year (10-14 years old)*. Parents are welcome to accompany and participate or observe. This programme is free of charge. Starts Tuesday 25th February 2014 and finishes Tuesday 1st April 2014. Please take note that parents/guardians are required to drop off children at the college at 5pm and arrange for them to be collected at 6.30pm.</p><p>Students are not required to bring a laptop as they will be supplied with log-in details to access computers in the college.</p><p>Registration is required, please contact via email address provided.</p><p><em>*The NCI dojo is targeted at families and schools in the four parishes surrounding the National College of Ireland - St Laurence O&#39;Toole&#39;s (Sheriff Street Parish), St Joseph&#39;s (East Wall Parish), St Mary&#39;s (City Quay Parish) and St Patrick&#39;s (Ringsend Parish).</em></p><p><strong><em>Our next Coder Dojo will take place in November 2014 (dates TBC). If you wish to reserve a place on our next dojo, please contact via email address provided. We will take note of your details and send a reminder to you in advance of the next NCI Coder Dojo.</em></strong></p>', 'coderdojonci@gmail.com', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', 'Leinster', '07', '', '', '', '', '', '2962486', 'Mountjoy');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940bf3d-e50f-11e4-8bc4-d4a2af868f3e', 918, 'To be Deleted - Brisbane - Sunnybank Hills', '4153', '2014-08-21 06:31:34+03', NULL, 'null', 0, 1, 3, 'Every Saturday from Saturday 11th October - Saturday 29th November, 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Calamvale","geonameId":"8348765"}', 'Sunnybank Hills Library, Sunnybank Hills Shoppingtown, Cnr Compton &amp; Calam Rds, Sunnybank Hills QLD 4109', '-27.61090053924059,153.0550950203766', '<p><strong>CoderDojo Brisbane kicks off Term 4 at Sunnybank Hills Library!</strong></p><p><em><strong>Registration for this event includes all sessions from Saturday 11th October until Saturday 29th November (inclusive) from 12.30 - 2.30pm.&nbsp;</strong></em></p><p>Kids aged 7 - 17 will be exposed to programming tools such as Scratch and HTML, and can then create their own projects to work on with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop</li><li>snack or lunch</li><li><em><strong>Please Note: a parent is to supervise if a participant is aged under 15 years.</strong></em></li></ul><div>&nbsp;</div><div><strong>For more information, visit the&nbsp;<a href="http://coderdojobrisbane.com.au/get-involved/participants/">CoderDojo Brisbane website.</a></strong></div><p>&nbsp;</p>', 'info@coderdojobrisbane.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', 'null', '11551710477CoderDojo Bris', 'null', 1, '4124', '2014-09-26 14:54:29+03', 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '8348765', 'Calamvale');
