INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09439e0a-e50f-11e4-8bc4-d4a2af868f3e', 995, 'Castleknock Dublin @ Castleknock Community College', '4387', '2014-09-30 12:23:54+03', '2014-09-30 13:27:14+03', '4124', 1, 1, 2, 'Every Monday night - 7.30pm to 9pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Annfield","geonameId":"3315335"}', 'Castleknock Community College', '53.3719948,-6.391057799999999', '<ul><li>A few place have come available</li><li><h6>SORRY&nbsp;ALL CLASSES ARE FULL.&nbsp;ADD YOURSELF TO THE WAIT LIST FOR CANCELLATIONS&nbsp;(SEE EVENTBRITE BELOW).</h6></li></ul><p>&nbsp;</p><ul><li>New years term&nbsp;will focus on HTML, Mobile Apps and Electronics</li><li>We are planning to restart Monday&nbsp;Jan&nbsp;19th 2015.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Age Limit is between&nbsp;10 and 18 years old.&nbsp;Please do not book a place for a child under 10. Depending on demand after the initial release we may lower the age limit to 8 years of age. If this is the case we will contact everyone and let them know.</li></ul>', 'coderdojocastleknock@gmail.com', 'http://www.coderdojocastleknock.com', 'coderdojocastle', 'null', '15177226493', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', 'Leinster', '07', '', '', '', '', '', '3315335', 'Annfield');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094413af-e50f-11e4-8bc4-d4a2af868f3e', 1172, 'São Paulo', '3909', '2014-12-28 04:12:04+02', '2014-12-30 16:52:41+02', '3199', 1, 1, 0, '', NULL, NULL, NULL, NULL, NULL, '', '', '<div><p>Venha aprender Scratch, HTML, Python, Javascript ou qualquer outra coisa que voc&ecirc; gosta. Se voc&ecirc; tem 17 anos ou menos e gostaria de alguma ajuda para aprender a desenvolver, inscreva-se e junte-se a n&oacute;s. O evento &eacute; gratuito para todos os participantes.</p><p>Temos algumas atividades j&aacute; planejadas, mas se voc&ecirc; tem algum projeto que voc&ecirc; est&aacute; trabalhando e gostaria de alguma ajuda, estamos aqui para ajud&aacute;-lo.</p><p>N&atilde;o se preocupe se voc&ecirc; nunca programou antes, junte-se a n&oacute;s e venha se divertir um pouco.<br /><strong>Crie uma anima&ccedil;&atilde;o ou construa um jogo com Scratch.</strong></p><p>Se voc&ecirc; j&aacute; programa, ent&atilde;o venha melhorar suas habilidades.&nbsp;<strong>&nbsp;<br />Construa coisas legais como jogos, sites, anima&ccedil;&otilde;es e apps.</strong>&nbsp;Conhe&ccedil;a pessoas como voc&ecirc; que est&atilde;o interessadas nos mesmos tipos de coisas.</p><p>Esperamos mais para frente termos Arduino e outras coisas legais para mexer.</p><p><strong>Voc&ecirc; vai precisar trazer um laptop.</strong>&nbsp;Se voc&ecirc; n&atilde;o tiver um ou n&atilde;o conseguir um emprestado, favor enviar um e-mail para saopaulo.bra@coderdojo.com pois temos alguns que poderemos emprestar.</p><p><strong>Se voc&ecirc; tem 12 anos ou menos voc&ecirc; vai precisar trazer um adulto respons&aacute;vel!</strong></p><p>O evento &eacute; totalmente gratuito, mas as vagas s&atilde;o limitadas. N&oacute;s pedimos que voc&ecirc; se registre aqui com pelo menos 24 horas de anteced&ecirc;ncia para que possamos planejar o encontro de forma adequada.</p><p><strong>O que voc&ecirc; precisa trazer:</strong><br />Um laptop. Pe&ccedil;a um emprestado, se for preciso.<br />Um adulto respons&aacute;vel! (Muito importante). Se voc&ecirc; tem 12 anos ou menos, um respons&aacute;vel deve ficar com voc&ecirc; durante toda a sess&atilde;o.<br />Um lanche saud&aacute;vel &eacute; recomend&aacute;vel, mas n&atilde;o &eacute; necess&aacute;rio.<br />Se voc&ecirc; j&aacute; tem um projeto que voc&ecirc; est&aacute; trabalhando, traga-o com voc&ecirc;.</p><p>Estamos sempre &agrave; procura de mentores por isso se voc&ecirc; gosta de compartilhar suas habilidades, por favor entre em contato conosco pelo email saopaulo.bra@coderdojo.com</p><p><strong>Para maiores informa&ccedil;&otilde;es, visite o site&nbsp;<a target="_blank" href="http://coderdojosp.com/">coderdojosp.com</a>.</strong></p></div><div>--------------------------------------------------------------------</div><div>&nbsp;</div><div>Come along to learn Scratch, HTML, Python, Javascript or just anything you need. If you&#39;re 17 or under and would like some help with learning to code please register to come along. It&#39;s free for all participants.</div><div><p>We will have some tasks for you to complete although if you have a project you have been working on and would like some help we are here for you.</p><div>Don&rsquo;t worry if you&rsquo;ve never programmed before, come along and have some fun.</div><p><strong>Create an animation or build a game with Scratch.<br />&nbsp;</strong><br />If you already can code then improve your skills.<br /><strong>Build cool stuff, from games to websites to animations to apps</strong>. Meet people like you who are interested in the same sort of things.</p><p>We hope to have a few Arduino&#39;s and other cool stuff to try.</p></div><div><strong>You will need to bring a laptop</strong>,&nbsp;If you don&#39;t have a laptop or can&#39;t borrow one please email saopaulo.bra@coderdojo.com as we do have a few.</div><div>&nbsp;</div><div><strong>If you are 12 or under you will need to bring an adult!</strong></div><div>&nbsp;</div><div>The event is completely free but numbers are limited and we do ask that you register here&nbsp;and get a ticket at least 24 hours before each meetup so that we can plan for the correct numbers.</div><div>&nbsp;</div><div><strong>What you need to bring:</strong></div><p>A laptop. Borrow one from someone if needs be.<br />A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.<br />A healthy snack is recommended but not required.<br />If you have a project you&#39;ve been working on bring it with you.</p><div>We are always looking for mentors so if you fancy sharing your skills please email&nbsp;saopaulo.bra@coderdojo.com</div><div><br /><strong>Please visit <a target="_blank" href="http://coderdojosp.com">coderdojosp.com</a> for more information.</strong></div><div>&nbsp;</div>', 'saopaulo.bra@coderdojo.com', 'http://coderdojosp.com', 'CoderDojoSP', 'https://groups.google.com/d/forum/coderdojosp', '15086123000', 'null', 0, 'null', '-infinity', 0, 'null', 'SA', 'BR', 'BRA', NULL, NULL, 76, 'Brazil, Federative Republic of', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943a23f-e50f-11e4-8bc4-d4a2af868f3e', 1003, 'Wayne, NJ @DPCoders', '4429', '2014-10-08 11:59:37+03', '2015-01-26 17:37:08+02', '4124', 1, 0, 0, 'Thursday, 1:40-2:30PM', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Passaic County"}', '{"toponymName":"New Jersey"}', '{}', '{"name":"Wayne","geonameId":"7259148"}', '1512 Alps Road, Wayne, NJ', '40.957914,-74.24407389999999', '<p>Although this is listed as meeting on Thursdays, it actually meets every sixth academic day.&nbsp; Whereas our first meeting is on October 9, our second meeting is scheduled for October 21, then October 29.&nbsp; Since it is a closed group, private to the students of DePaul Catholic HS, the calendaring should not matter much.</p>', 'dpcoders@dpchs.org', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 1, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'NJ', 'New Jersey', '', '', '', '', '', '', '7259148', 'Wayne');
