INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09444005-e50f-11e4-8bc4-d4a2af868f3e', 1237, 'CoderDojo MISO', '5134', '2015-02-02 11:45:12+02', NULL, 'null', 0, 0, 0, 'one Saturday a month', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Milan"}', '{"toponymName":"Lombardy"}', '{"toponymName":"Buccinasco"}', '{"name":"Corsico","geonameId":"3178004"}', 'BUCCINASCO, Milan South West', '45.4210273,9.119610700000066', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojomiso@gmail.com', 'https://coderdojomiso.wordpress.com/', 'CoderDojoMISO', 'null', 'null', 'null', 1, '4124', '2015-02-02 15:07:57+02', 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '09', 'Lombardy', '', '', '', '', '', '', '3178004', 'Corsico');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094440a7-e50f-11e4-8bc4-d4a2af868f3e', 1238, 'Geel', '5136', '2015-02-02 14:44:39+02', NULL, 'null', 0, 0, 0, 'Every month', '{"countryName":"Belgium","geonameId":"2802361","alpha2":"BE"}', '{"toponymName":"Antwerp Province"}', '{"toponymName":"Flemish"}', '{}', '{"name":"Poijel","geonameId":"2788813"}', 'Kleinhoefstraat 4, 2440 GEEL, BELGIUM', '51.1608366,4.962115499999982', '<p>CoderDojo &nbsp;organiseert evenementen, de zogenaamde &quot;Dojo&#39;s&quot;. Op die Dojo&#39;s leren jongens en meisjes programmeren, websites maken, apps en spelletjes ontwikkelen enzovoort. Ze ontmoeten gelijkgestemde deelnemers en laten elkaar zien waaraan ze gewerkt hebben. CoderDojo maakt van ontwikkelen en programmeren&nbsp;een superleuke, keigezellige en megatoffe leerervaring.</p><p>Dojo&#39;s worden op vrijwillige basis opgezet en gerund door mentors met voldoende ICT-kennis en de juiste drive om jongeren te coachen. CoderDojo legt sterk de nadruk op open source en vrije software. De beweging heeft een snel groeiend netwerk van leden en vrijwilligers wereldwijd.&nbsp;</p><p>CoderDojo heeft maar &eacute;&eacute;n regel:&nbsp;&quot;Above all: be cool!&quot;.</p><p><br /><br /><strong>Trajecten</strong></p><p>Er zijn verschillende trajecten waaraan kan deelgenomen worden. Dit kan u steeds zelf bepalen, maar zorg ervoor dat u zich heeft ingeschreven.<br /><br /><strong>1) Scratch:</strong><br />Op een visuele manier het logisch denken aanleren om te leren programmeren. Dit is ideaal voor iedereen die wilt leren programmeren.<br /><br /><em>&nbsp;Voorlopig bieden wij nog geen andere trajecten aan.</em></p><p>&nbsp;</p><p><strong>Praktisch informatie</strong></p><p>-&nbsp;Deelnemers tussen 7 en 18 jaar zijn toegelaten.&nbsp;Deelnemers jonger dan 12 worden het best begeleid door een ouder. De ouders hoeven niet de hele tijd aanwezig te zijn, maar moeten wel in de buurt blijven zodat we&nbsp;hen kunnen contacteren.</p><p>- Indien zou blijken dat de deelnemer niet aanwezig zou kunnen zijn, dan kan u dat melden via <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>, waarna&nbsp;het ticket geannuleerd zal worden.</p><p>- We vragen bij de inschrijving wel aan alle deelnemers om een e-mailadres en telefoonnummer van de ouders of voogd op te geven. Indien nodig&nbsp;zal CoderDojo&nbsp;| Geel&nbsp;rechtstreeks contact opnemen met de ouders of voogd.</p><p>- De deelnemer dient te beschikken over een draagbare computer. De coaches zullen ervoor zorgen dat alle benodigde software ge&iuml;nstalleerd zal worden. Indien dit niet het gaval is, dan zal CoderDojo | Geel een draagbare computer voorzien.</p><p>&nbsp;</p><p><strong>Vragen </strong></p><p>Contacteer ons via <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>! See you soon!<br /><br />Door inschrijving en deelname aan de CoderDojo- activiteiten, gaat u als ouder of voogd ermee akkoord dat er beeldmateriaal kan genomen worden van uw kinderen en dat dit beeldmateriaal kan gebruikt worden voor publicatie in het kader van bekendmaking/marketing van CoderDojo. Indien u hiermee niet akkoord bent, kan u dit laten weten via: <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>.</p>', 'geel@coderdojobelgium.be', 'http://www.coderdojobelgium.be', 'null', 'null', '15048121336', 'null', 1, '5136', '2015-02-02 14:46:03+02', 0, 'null', 'EU', 'BE', 'BEL', NULL, NULL, 56, 'Belgium, Kingdom of', 'VLG', 'Flemish', '', '', '', '', '', '', '2788813', 'Poijel');
