INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943c75d-e50f-11e4-8bc4-d4a2af868f3e', 1051, 'Bukavu@Dojo', '4524', '2014-11-03 18:16:26+02', '2014-11-06 10:44:32+02', '4124', 1, 1, 0, 'Le lundi et le mercredi à partir de 15h00 à 17h00, Le mardi et le jeudi à partir de 16h00 à 1800', '{"countryName":"Uganda","geonameId":"226074","alpha2":"UG"}', '{"toponymName":"Ibanda"}', '{"toponymName":"Western Region"}', '{"toponymName":"Ibanda"}', '{"name":"Kashangura","geonameId":"8617862"}', 'A l''hotel des postes, Avenue Kibombo, Ibanda, Bukavu, South Kivu', '-0.12,30.5', '<p>Bienvenu au premier Dojo en RDC!</p><p>Avec Bukavu@Dojo, les enfants &acirc;g&eacute;s de 7 - 18 ans issus des familles pauvres et riches int&eacute;ress&eacute;s &agrave; l&#39;Informatique cr&eacute;ative apprendont &agrave; cr&eacute;er des jeux vid&eacute;o, films, apps mobile, dessins anim&eacute;s, site internet, et beaucoup d&#39;autres choses int&eacute;ressantes en ligne ou hors connexion avec Scratch, HTML, Blender, Jahshaka, etc.</p><p>Nous demandons &agrave; tout candidat d&#39;amener son ordinateur portable (laptop) pour son apprentissage en attendant qu&#39;un financement soit disponible pour ce programme. Tout candidat qui n&#39;en a pas, nous l&#39;encourageons d&#39;en emprunter un. Le parent de chaque enfant est appel&eacute; &agrave; l&#39;accompagner pour vivre ce que son enfant apprend. Si vous &ecirc;tes moins de 12 ans, votre parent doit rester avec vous pendant la session.</p>', 'yesdrc@gmail.com', 'http://cg.gew.co', 'yesdrc', 'null', '14115201949', 'null', 0, 'null', NULL, 0, 'null', 'AF', 'CD', 'COD', NULL, NULL, 180, 'Congo, Democratic Republic of the', 'W', 'Western Region', '', '', '', '', '', '', '8617862', 'Kashangura');
