INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093be830-e50f-11e4-8bc4-d4a2af868f3e', 49, 'Castlebar', '51', '2012-03-09 22:05:23+02', '2013-12-01 14:25:30+02', '3006', 1, 0, 3, 'On every Saturday until April', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Rathbaun","geonameId":"10130202"}', 'St. Geralds College, Newport Road, Castlebar', '53.857516,-9.308018', '<ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay onsite during the session.</strong></li></ul>', 'Mayodojo@gmail.com', 'null', 'Coderdojomayo', 'null', 'null', 'http://scienceireland.ie/images/coderdojo_sponsors.png', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '10130202', 'Rathbaun');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093be881-e50f-11e4-8bc4-d4a2af868f3e', 50, 'Maynooth', '53', '2012-03-10 02:16:39+02', '2013-12-01 14:25:30+02', '3006', 1, 0, 2, 'Thursdays, 5pm-7pm', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Maynooth","geonameId":"2962668"}', 'Place: Computer Science Software Lab 4 at NUI Maynooth (ground floor, Callan Building, North Campus, Kilcock Road, Maynooth)', '53.382790822565,-6.602343320846558', '<p>What to bring:</p><ul><li>We have computers for everyone to use but you can bring your laptop if you wish.</li><li>A parent/guardian over 18 who can stay from 5pm until 7pm (if you are 12 or younger - very important!)</li></ul><p>We have a new Registration process in place and if you wish to attend then you must fill in the online form prior to attending. The form can be found at http://www.cs.nuim.ie/forms/coderdojosignup</p><p>Note: If you registered for the 2013 N.U.I Maynooth CoderDojo you are still required to register online if you wish to attend the 2014 N.U.I Maynooth CoderDojo</p><p><strong>Notes </strong></p><p>If coming by car, note that parking charges and restrictions at NUI Maynooth don&#39;t apply from 5pm so you can park for free in any parking space without needing a ticket or pass. We recommend you park in car park 1, which is the first car park on entering campus from the Kilcock Road. This is just across the road from the Callan Building where CoderDojo is held.</p><p>Chill cafe, adjacent to car park 1, will be open until after 7pm for participants/parents.</p>', 'coderdojo@cs.nuim.ie', 'null', 'coderdojomaynoo', 'http://groups.google.com/group/coderdojo-maynooth', 'null', 'http://www.cs.nuim.ie/sites/default/files/styles/large/public/NUIMsentenial-IE6.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '2962668', 'Maynooth');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bedf3-e50f-11e4-8bc4-d4a2af868f3e', 60, 'Drogheda on the Boyne', '70', '2012-03-13 00:58:45+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 2, '2 Saturdays a month, noon - 3pm (See Eventbrite for next available dates)', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Drogheda","geonameId":"2964661"}', 'St Oliver''s Community College, Rathmullen Road, Drogheda', '53.713726,-6.378871', '<p>&nbsp;</p><p>At CoderDojo Drogheda our aim is to encourage kids to get into computing and to be really good at it! There are lots of jobs and start up opportunities for good programmers and as far as we can see there always will be. We are initially focusing on those in second level aged 13-17 but are also accepting kids at a younger age if accompanied by a parent.</p><p>No prior programming experience is required if you are honestly interested in computing come a long and try it out!</p><p>Like all Dojos we try to make it relaxed, fun, cool and interesting. No lectures or classroom approaches here its 100% hands-on coding with the help of volunteer mentors to pass on their knowledge and keep you challenged!</p><p><strong>Time:</strong> 2 Saturday&#39;s per month between noon and 3pm.</p><h3>Booking Information</h3><p>See <a target="_blank" href="http://coderdojo-drogheda.eventbrite.com">Eventbrite (http://coderdojo-drogheda.eventbrite.com) for further details.</a></p><p><strong>Note: Booking is essential!</strong></p><h3>What you need to bring:</h3><ul><li>We accept donations from parents that allow us to provide pizza and ensure there is a social element to CoderDojo</li><li>If possible, a laptop. If not please indicate this at booking and we have some laptops available</li><li>A parent (* a must if 12 or younger very important!)</li></ul><h3>Topics:</h3><p>Currently we cover HTML/CSS (Web Frontend), Scratch, JavaScript, Databases, PHP (Web backend) and Mobile Apps. &nbsp;We have mentors who are happy to help with Java, Node.js, Unity3D and many other areas too - so just ask!</p><p><strong>Note:</strong>&nbsp;Click here for details on our sister Dojo:&nbsp;<a href="http://zen.coderdojo.com/dojo/128">CoderDojo Dundalk</a></p>', 'drogheda@coderdojo.com', 'http://www.coderdojodrogheda.com', 'coderdojodrog', 'https://groups.google.com/d/forum/coderdojo-drogheda-dundalk', 'null', 'http://www.coderdojodrogheda.com/coderdojo-drogheda/coderdojo-drogheda-supporters.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '2964661', 'Drogheda');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c70bf-e50f-11e4-8bc4-d4a2af868f3e', 230, 'Tampa Bay Area - Jan Kaminis Platt Library', '943', '2013-02-03 03:34:20+02', '2013-12-01 14:25:28+02', '3006', 1, 1, 2, 'Please check sign-up link for details', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Norma Park","geonameId":"7218860"}', 'Jan Kaminis Platt Regional Library, 3910 South Manhattan Avenue Tampa, FL 33611', '27.907396,-82.51745799999998', '<p><strong><a href="http://www.eventbrite.com/org/3802215495">Parents - click here to reserve seats for your children.</a></strong><br /><br />Please bring a laptop. Borrow one from someone if need be. Please bring a parent! (Very important). Your parent must stay with you during the session.</p>', 'tampabayarea.us@coderdojo.com', 'http://CoderDojoTampaBayArea.eventbrite.com', 'CoderDojoTPA', 'https://groups.google.com/d/forum/coderdojotpa', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', NULL, '', NULL, '', NULL, '', NULL, '7218860', 'Norma Park');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943e942-e50f-11e4-8bc4-d4a2af868f3e', 1094, 'Durham, NC. @ Healing with CAARE, Inc./CoderDojoDurham', '4733', '2014-11-29 04:26:36+02', '2014-12-10 09:57:20+02', '4124', 1, 1, 2, 'Weekly on Saturdays from 2:30-5:00 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Durham County"}', '{"toponymName":"North Carolina"}', '{}', '{"name":"Durham","geonameId":"4464368"}', '214 Broadway St., Durham, NC. 27701', '36.001214,-78.89875899999998', '<p>Please view our CoderDojoDurham&nbsp;<a href="https://coderdojodurham.wordpress.com/cdd-calendar-and-events/">calendar </a>for event listings.</p><p>Bring the following to each meeting:</p><ul><li>A beverage (water, preferably) and a packed snack/meal.</li><li>A laptop. Borrow one from someone, if necessary. &nbsp;Please contact us via e-mail at coderdojodurham@gmail.com, if you are unable to acquire your own laptop.</li><li><strong>A parent or guardian! &nbsp;This is very important. &nbsp;If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojodurham@gmail.com', 'https://coderdojodurham.wordpress.com/', 'coderdojodurham', 'https://groups.google.com/d/forum/coderdojodurham', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'NC', 'North Carolina', '', '', '', '', '', '', '4464368', 'Durham');
