INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bf153-e50f-11e4-8bc4-d4a2af868f3e', 68, 'Iowa City, Iowa', '46', '2012-03-14 21:36:57+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 1, 'Every Saturday, 2PM - 3:30PM', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Iowa City","geonameId":"4862034"}', '123 South Linn Street, Iowa City, IA 52240', '41.6592011,-91.5320946', '<h1>Before you get here</h1><ul><li>Parents are welcome and encouraged to attend</li><li><em><strong>Laptops are encouraged</strong></em></li><li><a >Session info</a></li></ul><h4>Location notes:</h4><address>Iowa City Public Library<br />123 South Linn Street<br />Iowa City, IA 52240<br />2nd floor computer lab</address>', 'coderdojoiowacity@gmail.com', 'http://coderdojoic.org', 'CoderDojoIACity', 'https://groups.google.com/forum/?hl=en#!forum/coderdojo-iowa-city', '13192642549', 'http://newsroom.icpl.org/wp-content/uploads/2009/06/Circle-Logo-Red.jpg', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', NULL, '', NULL, '', NULL, '', NULL, '4862034', 'Iowa City');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bf696-e50f-11e4-8bc4-d4a2af868f3e', 71, 'Bray', '74', '2012-03-15 11:42:50+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 2, 'Saturday 2:30pm-4:30pm', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Bray","geonameId":"2966022"}', 'Presentation College, Bray', '53.19197032889269,-6.101875305175781', '<p>CoderDojo Bray is currently on a break for Christmas/New Year.</p><p>CoderDojo Bray will return in January 2015, in Presentation College, Bray, each Saturday during the seconary school term @ 2:30pm.</p><p>We will be continuing our introduction to programming, using MIT Scratch. We will have Basic and Advanced Scratch streams, looking at multi-player and networked games in the Advanced Scratch stream.</p><p>We will continue with an introduction on mobile phone apps using AppInventor.</p><p>We will also continue HTML, CSS and web technology.</p><p>We&#39;ll be continuing our project-based activity stream, in three areas:</p><ul><li>Basic electronics and microcontrollers using Arduinos and Intel Galileos</li><li>Exploring Raspberry Pis</li><li>Robot control and programming (Arduino based)<p>&nbsp;</p><p>We will have our introduction to programming using Python stream, and start exploring programming using the Python language and pygame.</p><p>Due to very high demand, you <strong>must</strong> register ahead. The EventBrite URL will be activated nearer the date. We plan to issue 180&nbsp;tickets for this session in two groups of 90 places, for each of two &quot;cohorts&quot; of 3 weeks each.<br /><br />Note that this means there are&nbsp;<strong>two</strong>&nbsp;EventBrite events for this session which cannot be entered directly into this form. Visit <a href="http://coderdojobray.eventbrite.com">http://coderdojobray.eventbrite.com</a> to check for the individual listings.</p></li><li><p>What to bring:</p><p>We can always use more volunteers of course. So if you can help out, check out our contact details and drop us a line. Children of volunteers get preferential access to places.</p><p>Our contact details are on the right: to be kept informed about future events, add yourself to our <strong><a href="http://eepurl.com/I0ng5">mailing list</a></strong> by <strong><a href="http://eepurl.com/I0ng5">clicking on this link to fill in the registration form</a></strong>, drop us an email to get in touch, or follow us on Twitter.</p><p>CoderDojo Bray is free of charge because of the efforts of our volunteers, sponsorship from <a href="http://www.sheehanquinn.ie">HLB Sheehan Quinn</a> and provision of a venue by the <a href="http://presbray.com">Presentation College</a> Bray. CoderDojo Bray could not happen without their support, and we are extremely grateful for it.</p><p>If you would like to make a donation, provide equipment, or help out, please contact us at <a href="mailto:bray@coderdojo.com"><strong>bray@coderdojo.com</strong></a>. Any money or equipment donated will be used solely for CoderDojo.</p><ul><li><ul><li>A laptop</li><li>Paper/Pen - something to write on and with</li><li>A parent (if you&#39;re 12 or under, a parent/guardian must stay)</li><li>A snack/drink: we&#39;ll have a short break in the middle of each session. Or you can purchase a snack at our Tuck Shop at breaktime.</li></ul></li></ul></li></ul>', 'bray@coderdojo.com', 'http://coderdojobray.com', 'CoderDojoBray', 'http://groups.google.com/group/coderdojo-bray', '9995471725', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '2966022', 'Bray');
