INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c28af-e50f-11e4-8bc4-d4a2af868f3e', 109, 'Sligo', '241', '2012-04-16 13:50:27+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 3, 'Most Saturdays, 10.30am - 12 noon', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Sligo","geonameId":"2961423"}', 'Institute of Technology, Sligo', '54.2766709,-8.46162849999996', '<p><strong>CoderDojo Sligo is full at present. &nbsp;Please complete the waiting list form at&nbsp;<a href="http://bit.ly/1v9uTRI">http://bit.ly/1v9uTRI</a> and we will contact you as soon as space becomes available.</strong></p><p>&nbsp;</p><p>Registered ninjas you must bring:</p><ul><li>A snack and drink, pen and paper if you like to keep notes.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Please label all of your belongings with your name, as things are often left behind or mixed up.</li></ul><p>Due to space limitations, you <strong>must</strong> register in order to attend, contact us via email for details regarding registration.</p><p>Registered ninjas, you must <strong>book your space</strong> each week via <a href="http://www.coderdojosligoirl.eventbrite.ie"> Eventbrite. </a></p><p>Booking for each week will open Monday and will close at 3pm Friday afternoon. You cannot block book and you will need to book your space every week. We do hate to restrict numbers, but due to space and mentors available it&#39;s best for everyone.</p><p>Find us on <a href="https://www.facebook.com/CoderDojoSligo_"> Facebook </a>or Follow us on <a href="http://www.twitter.com/CoderDojoSligo">Twitter</a></p><p>We are very grateful to <a href="http://www.itsligo.ie"> IT Sligo</a> for supplying the venue.</p>', 'sligodojo@gmail.com', 'http://www.coderdojosligo.wordpress.com', 'Coderdojosligo', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '2961423', 'Sligo');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c2b30-e50f-11e4-8bc4-d4a2af868f3e', 114, 'Mahon, Cork @ McAfee, European Head Quarters', '259', '2012-04-20 08:45:43+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 1, 'Tuesdays - 6-7:30pm', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Ballinure","geonameId":"3286703"}', 'McAfee, European Head Quarters: Building 2000, City Gate, Mahon Cork.', '51.88624458514162,-8.405147743225143', '</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 13 or under, your parent must stay with you during the session.</strong></li></ul> From Tuesday September 24th 2013 we will start our Second year of Coder Dojo at McAfee and will run each week there after until we take a short Christmas Break and restart in Early January and run through to Summer 2014.', 'rburke@mcafee.com', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '3286703', 'Ballinure');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c309a-e50f-11e4-8bc4-d4a2af868f3e', 125, 'Clonakilty', '329', '2012-05-04 09:25:58+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 2, 'Fridays, 6.30-8.30pm', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Clonakilty","geonameId":"2965402"}', 'Quality Hotel, Clogheen, Clonakilty, County Cork, Ireland', '51.616377035672436,-8.895976486724862', '<p><b>Due to space limitations, you must register in order to attend.</b> Please visit <a href="http://coderdojoclonakilty.eventbrite.com" target="_blank">http://coderdojoclonakilty.eventbrite.com</a> to book. If ''Sold Out'' for this week, go on the waiting list and we may clear you to attend if space opens up. Booking for next week will open Saturday morning. You cannot block book, you will need to register each week. We do hate to restrict numbers, but due to space and mentors available it''s best for everyone.</p> <p>You must bring: <ul><li>A laptop. Borrow one from someone if needs be. (If possible install the applications noted below beforehand.)</li> <li>an extension cable, if you have a spare one <li><strong>A parent! (Very important) A parent must stay with a child/children for the session.</strong></li></ul></p> <p><b>Please label all of your belongings with your name, as things are often left behind or mixed up.</b></p> <p>We are working on the following: <ul> <li><b><a href="http://scratch.mit.edu/" target="_blank">Scratch</a></b>, a programme designed for children to create their own games without knowing advanced coding, a great start to learning how coding a game works.</li> <li>Basic HTML & CSS to set up your own webpage, using <b><a href="http://notepad-plus-plus.org/">Notepad ++</a> for Windows or <a href="http://www.barebones.com/products/textwrangler/" target="_blank">Text Wrangler for Mac</b></li> </ul></p> <p>If possible, please download the relevant programmes to your laptops before the session.</p> <p>See also <a href="http://www.coderdojowestcork.wordpress.com" target="_blank">www.coderdojowestcork.wordpress.com</a> for more information and download tutorials and presentations from previous sessions.</p> <p>The following websites are helpful to get some additional knowledge on these areas: <ul><li><a href="http://w3schools.com/" target="_blank">W3Schools</a>, easy online tutorials for HTML and CSS</li> <li><a href="http://www.codecademy.com/" target="_blank">Codecademy</a> an online, interactive, way to learn to code.</li></ul></p> <p><b>We are very grateful to The Quality Hotel Clonakilty for supplying a venue. Please show your thanks and support the hotel in buying refreshments while you are there.</b></p>', 'clonakilty@coderdojo.com', 'http://coderdojowestcork.wordpress.com/', 'CoderDojoWCork', 'https://groups.google.com/forum/?fromgroups#!forum/coder-dojo-west-cork', 'null', 'http://coderdojowestcork.files.wordpress.com/2012/05/quality-hotel-clonakilty.png', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '2965402', 'Clonakilty');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c316b-e50f-11e4-8bc4-d4a2af868f3e', 128, 'Dundalk', '346', '2012-05-07 14:57:31+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 2, 'Saturday 14th June, 12pm-3pm', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Gibstown","geonameId":"3310709"}', 'PJ Carrolls building, DkIT, Dundalk, Louth, Ireland', '53.98178406529173,-6.391961097869853', '<p><strong>General Dojo Information:</strong></p><p>At CoderDojo Dundalk, we aim to encourage computing from a young age. Not only that, we want to help them be great at it! Computing is a hot area for employment here in Ireland and we believe that it&#39;s here to stay. We want to get young people aged 7 and up involved, primary and secondary school students alike.</p><p>Absolutely no programming experience is required, so if you are interested in checking out computing, come along to a session and try it out!</p><p>Like all Dojos we try to make it relaxed, fun, cool and interesting. There are no lectures or classroom approaches involved. Instead it&#39;s 100% hands-on coding with volunteer mentors available to help, to pass on their knowledge and of course, to keep you challenged!</p><p>Time: Specified Saturdays from 12pm-3pm. See Eventbrite booking link below for further details. <strong>Booking is essential!</strong></p><p><strong>What you need to bring:</strong></p><ul><li>A packed lunch.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p><strong>Topics:</strong> We currently cover HTML, CSS (website design &amp; development), Scratch (an introductory programming language developed in MIT), Python, Java (using the Greenfoot development environment), 3D modelling (using Blender) and robotics through Lego Mindstorms (seasonal). As the Dojo develops, we intend to cover a variety of other topics, including Databases, PHP and Mobile Applications.</p><p><strong>Note:</strong> Click here for details on <a href="http://zen.coderdojo.com/dojo/60">CoderDojo Drogheda</a></p>', 'dundalk@coderdojo.com', 'http://www.coderdojodundalk.com', 'CoderDojoDlk', 'https://groups.google.com/d/forum/coderdojo-drogheda-dundalk', '11885755615', 'http://www.dkit.ie/sites/all/themes/dkit/logo.png', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '3310709', 'Gibstown');
