INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c3e1d-e50f-11e4-8bc4-d4a2af868f3e', 155, 'Greystones', '472', '2012-06-18 11:53:46+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 2, 'Saturday Afternoons from 2pm, 4pm and mid-week in local schools 7pm', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Ballynerrin","geonameId":"3315085"}', 'Greystones Lawn Tennis Club,  Mill Rd., Greystones', '53.13237073269521,-6.07021198045652', '<p>We are running since November 2012 and offer a variety of classes (Scratch, HTML, 3D modelling, Python, etc) for kids aged 7-17 across a number of venues.</p><div>&nbsp;</div><div>Currently we have almost 20 technical mentors but always looking for more! The more technical mentors we have the more kids we can take in a session.</div><div>&nbsp;</div><div>If you want to register interest - for your children to attend, or to volunteer - <strong>then sign up to our mailing list at http://coderdojogreystones.com</strong></div><div>&nbsp;</div><p>- For any other query send us an email at coderdojogreystones@gmail.com or</p><p>- Visit our Facebook page http://www.facebook.com/CoderDojoGreystones</p><p>- Visit our Website http://coderdojogreystones.com</p><p>&nbsp;</p><div><strong>We will be posting updates regularly on Facebook / Website and send occasional emails to our mailing list</strong></div>', 'coderdojogreystones@gmail.com', 'http://coderdojogreystones.com', 'CoderDojoGStone', 'https://groups.google.com/forum/?hl=en&fromgroups;#!forum/coderdojogreystones', 'null', 'https://media.licdn.com/media/p/7/000/2a2/3c7/375ea75.png', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '3315085', 'Ballynerrin');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c41f0-e50f-11e4-8bc4-d4a2af868f3e', 163, 'Euskal Herriko Dojo', '508', '2012-07-04 09:54:54+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 4, 'Seguruenik larunbatetan (10:00etatik 13:00ak arte)', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Elexalde","geonameId":"3121286"}', 'Uribe Kostan. Oraingoz leku egoki baten bila......', '43.412569,-2.929135', '<p><strong>Ekarri behar duzuna:</strong></p><ul><li>Bokata (oso garrantzitsua).</li><li>Ordenagailu eramangarria (baldin eta badaukazu).</li><li>Guraso bat (12 urte baino gutxiagoko bazara).</li></ul><p><strong>Zeintzuk parte hartu ahal dute:</strong></p><ul><li>Edonork partu ahal du.</li><li>Gazteak 12 urte ez baditu heldu baten laguntza eskatzen dugu alde batetik materiala zaintzeko eta zergatik ez! seme-alabarekin batera <em>programazioa</em> ikasteko.</li><li>Oso gazte diren umeek ez dute ehuneko ehunean etekinik aterako, baina askotan ikusi ditugu 8 urteko umeak programazio-arraizoiketa garatzen ordenagailuekin jolasten duten bitartean.</li></ul><p><strong>Doan!</strong></p><ul><li>Lekua eta zerbitzuak doan dira. Baita ere aholkulariek beraien denbora musu-truk eskaintzen dute, beraz umeentzako aukera hau dohainik da!</li></ul><p><strong>Momentuz gaiak hauxek dira:</strong></p><ul><li>HTML/CSS/Javascript (web frontend).</li><li>Gai gehiago aholkularien arabera.</li></ul>', 'otsarri@gmail.com', 'null', 'otsarri', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'ES', 'ESP', NULL, NULL, 724, 'Spain, Kingdom of', '00', NULL, '', NULL, '', NULL, '', NULL, '3121286', 'Elexalde');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0944082d-e50f-11e4-8bc4-d4a2af868f3e', 1150, 'Noida @ Makers Space', '4821', '2014-12-16 17:31:48+02', '2014-12-18 17:40:23+02', '4124', 1, 1, 2, 'Every Weekend 17:30-19:30', '{"countryName":"India","geonameId":"1269750","alpha2":"IN"}', '{"toponymName":"Gautam Buddha Nagar"}', '{"toponymName":"Uttar Pradesh"}', '{}', '{"name":"Noida","geonameId":"7279746"}', 'Amity University, Sector-125, Uttar Pradesh 201303', '28.5355161,77.39102649999995', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li><strong>MSP&#39;s,MSA&#39;s,GSA&#39;s, FSA&#39;s and Webmaker Mentors are invited to join us in helping us move forward.</strong></li></ul>', 'noida.in@coderdojo.com', 'null', 'CoderDojoNoida', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'IN', 'IND', NULL, NULL, 356, 'India, Republic of', '36', 'Uttar Pradesh', '', '', '', '', '', '', '7279746', 'Noida');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09440b66-e50f-11e4-8bc4-d4a2af868f3e', 1157, 'Mozilla Kerala  Dojo', '4891', '2014-12-19 16:15:52+02', NULL, 'null', 0, 1, 0, 'Everyday 9am-4pm', '{"countryName":"India","geonameId":"1269750","alpha2":"IN"}', '{"toponymName":"Ernākulam"}', '{"toponymName":"Kerala"}', '{}', '{"name":"Kochi","geonameId":"1273874"}', 'Kochi, kerala india', '9.9312328,76.26730410000005', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'null', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'IN', 'IND', NULL, NULL, 356, 'India, Republic of', '13', 'Kerala', '', '', '', '', '', '', '1273874', 'Kochi');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093ea867-e50f-11e4-8bc4-d4a2af868f3e', 756, 'Parma', '2378', '2014-03-27 22:04:14+02', '2014-03-28 11:06:53+02', '3006', 1, 1, 3, 'Sabato 28 Febbraio, 15:00 alle 18:00', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Parma"}', '{"toponymName":"Emilia-Romagna"}', '{"toponymName":"Salsomaggiore Terme"}', '{"name":"Salsomaggiore Terme","geonameId":"3168627"}', 'Viale Giandomenico Romagnosi, 7 43039 Salsomaggiore Terme PR Italia', '44.81311820000001,9.985554399999955', '<p><strong>Che cos&#39;&egrave; CoderDojo?</strong></p><p>I CoderDojo sono laboratori / club di programmazione gratuiti e aperti a bambini e ragazzi, dedicati, in questa occasione ai ragiazzi di fascia d&#39;et&agrave; 7-14 anni.</p><p>Gli eventi si tengono con cadenza periodica, cominceremo con uno al mese. Indicativamente fisseremo gli incontri il sabato pomeriggio, ma potremmo decidere di spostarli la mattina in base alle esigenze dei ragazzi.</p><h2><strong>Cosa si fa durante un evento?</strong></h2><p>Impareremo a utilizzare&nbsp;<a href="http://scratch.mit.edu/">Scratch</a>&nbsp;per creare i nostri primi programmi e semplici videogiochi.</p><p>Impareremeo a sviluppare una pagina web attraverso l&#39;HTML5 come inizio per un sito.</p><p>L&#39;evento dura circa 3 ore, nella prima parte uno dei mentor spiegher&agrave; a tutti il funzionamento di Scratch attraverso un esempio che i bambini riprodurranno sui propri computer, supportati dagli altri mentor. Nella seconda parte, dopo la merenda, i ragazzi saranno liberi di continuare a personalizzare il proprio gioco o crearne un altro sulla base di quello che hanno imparato.</p><h2><strong>Che cosa bisogna portare?</strong></h2><p>Un portatile per ogni bambino (windows, mac, ubuntu), possibilmente con&nbsp;<a href="http://scratch.mit.edu/download">Scratch</a>&nbsp;gi&agrave; installato</p><p>Una merenda</p><p>Un genitore/accompagnatore</p><h2><strong>Come ci si iscrive?</strong></h2><p>E&#39; possibile effettuare la registrazione tramite Eventbrite a questo indirizzo:&nbsp;<a href="https://www.eventbrite.it/e/registrazione-coderdojo-parma-salsomaggiore-terme-28-febbraio-2015-15827551633">https://www.eventbrite.it/e/registrazione-coderdojo-parma-salsomaggiore-terme-28-febbraio-2015-15827551633</a></p><p>News: <strong>Evento chiuso!</strong></p><p><strong>Centro Polivalente Casa nel Parco, Officina OnOff</strong><br />Italia</p><h2><strong>Hai bisogno di altre informazioni?</strong></h2><p>Contattaci su info@coderdojoparma.com, cercheremo di risponderti al pi&ugrave; presto!</p><h3>Above all, be cool! ;)</h3><p>&nbsp;</p>', 'info@coderdojoparma.it', 'http://www.coderdojoparma.it/', 'CoderDojoParma', 'https://groups.google.com/forum/#!forum/coderdojo-parma', '14422200189', 'http://www.coderdojoparma.it/wp-content/uploads/2013/11/logo.png', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '05', 'Emilia-Romagna', '', '', '', '', '', '', '3168627', 'Salsomaggiore Terme');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09440f69-e50f-11e4-8bc4-d4a2af868f3e', 1164, 'Markham', '4907', '2014-12-22 16:39:32+02', '2015-01-02 11:01:40+02', '3006', 1, 1, 2, 'Last Saturday of the month, starting February 28. 1:15-3:15PM. No meetups July/August.', '{"countryName":"Canada","geonameId":"6251999","alpha2":"CA"}', '{"toponymName":"York"}', '{"toponymName":"Ontario"}', '{}', '{"name":"Cachet","geonameId":"5913100"}', 'Angus Glen Library 3990 Major Mackenzie Drive East, Markham, ON L6C 1P8', '43.8945525,-79.33613780000002', '<ul><li>Registration is required for participants and parents/caregivers.</li><li>Bring a fully charged laptop. Borrow one from someone if you don&#39;t own one yet.</li><li><strong>A parent! (very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>Mentors needed!</p>', 'markham.ca@coderdojo.com', 'http://www.markhampubliclibrary.ca', 'MarkhamCoders', 'null', '15460944100', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'CA', 'CAN', NULL, NULL, 124, 'Canada', '08', 'Ontario', '', '', '', '', '', '', '5913100', 'Cachet');
