INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094430d1-e50f-11e4-8bc4-d4a2af868f3e', 1208, 'Sydney @ Balmain Library', '5038', '2015-01-20 12:44:49+02', '2015-01-28 10:01:41+02', '4124', 1, 1, 3, 'Every Saturday for 6 weeks from late February', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Leichhardt"}', '{"toponymName":"New South Wales"}', '{}', '{"name":"Balmain","geonameId":"2177052"}', '370 Darling Street, Balmain NSW 2041', '-33.8562829,151.17674069999998', '<p><strong>Book your place with the EventBrite</strong><br />We ask you to commit to the sessions you will attend so that everyone can get a chance to come along.&nbsp;</p><p><strong>You will need to bring:</strong></p><ul><li>your imagination and enthusiasm</li><li>your laptop (Borrow one from someone if need be)</li><li><strong>your parent or guardian&nbsp;(Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>As a tip, bring along a&nbsp;snack and something to drink - being creative will make you hungry</p><p>We need volunteers! We hope to offer future sessions, beyond this one, so if you&#39;re keen to volunteer, just ask us!</p>', 'balmain.au@coderdojo.com', 'https://coderdojosydney.org/leichhardt/', 'CoDo_Balmain', 'null', '15511024893', 'null', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '02', 'New South Wales', '', '', '', '', '', '', '2177052', 'Balmain');
