INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cb577-e50f-11e4-8bc4-d4a2af868f3e', 353, 'Caceres, Extremadura @ AROtec', '1643', '2013-05-07 18:53:13+03', '2014-09-24 13:09:42+03', '4124', 1, 1, 1, 'Mensual, Sábados, 11-13h', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Hospital Provincial Nuestra Señora de la Montaña","geonameId":"7266439"}', 'C/ Gil Cordero, 4', '39.46843789552457,-6.380259566409336', '<div><h1>A tener en&nbsp;cuenta en CoderDojo C&aacute;ceres</h1><p>Si quieres participar reserva tu ticket si puedes venir, si no le est&aacute;s quitando la plaza a otra persona. Te recordamos que si eres menor de 12 a&ntilde;os tienes que venir acompa&ntilde;ado de un adulto.</p><p>Recuerda que s&oacute;lo puedes participar si te ha llegado el email de confirmaci&oacute;n, descartaremos a la gente que no est&eacute; apuntada previamente.</p><p>Normas:</p><p>1.- TRAE TU PROPIO PORT&Aacute;TIL &ndash; Hay que traer ordenador propio.</p><p>2.- Si te quedas sin entrada una semana, int&eacute;ntalo a la siguiente.</p><p>3.- Los menores de 12 a&ntilde;os tienen que venir acompa&ntilde;ados de un adulto.</p><p>4.- La gente que no haya firmado la hoja de autorizaci&oacute;n o de &ldquo;no autorizaci&oacute;n&rdquo; de toma de im&aacute;genes tiene que firmarla</p><p>5.- Las entradas estar&aacute;n disponibles en d&iacute;as previos a la celebraci&oacute;n del evento.</p><p>6.- NUNCA dejes de pensar que existe m&aacute;s de una soluci&oacute;n para el mismo problema.</p></div>', 'coderdojocaceres@gmail.com', 'http://coderdojocaceres.wordpress.com', 'coderdojo_CC', 'https://groups.google.com/d/forum/coder-dojo-caceres', '13382831409', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'ES', 'ESP', NULL, NULL, 724, 'Spain, Kingdom of', '00', NULL, '', NULL, '', NULL, '', NULL, '7266439', 'Hospital Provincial Nuestra Señora de la Montaña');
