INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09444275-e50f-11e4-8bc4-d4a2af868f3e', 1242, 'Brindisi', '5128', '2015-02-04 12:12:57+02', '2015-02-05 09:55:31+02', '4124', 1, 1, 0, 'Every Monday, 3pm-5pm', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Brindisi"}', '{"toponymName":"Apulia"}', '{"toponymName":"Brindisi"}', '{"name":"Brindisi","geonameId":"3181528"}', 'Via Montebello 11, Brindisi', '40.625575,17.92262519999997', '<ul><li>Una merenda</li><li>Un portatile. Fattene prestare uno da qualcuno, se necessario.</li><li><strong>Un adulto accompagnatore! (Importante). Se hai meno di 12 anni, il tuo accompagnatore deve rimanere con te durante la sessione.</strong></li></ul><p>&nbsp;</p><ul><li><strong>Il gruppo si &egrave; appena costituito. Cerchiamo Mentors. Abbiamo fatto un primo CoderDojo il 3&nbsp; Dicembre grazie a Paolicelli e Maletesta del CoderDojo di Lecce.</strong></li></ul>', 'coderdojobrindisi@gmail.com', 'http://www.coderdojobrindisi.it', 'null', 'https://groups.google.com/forum/?hl=it#!forum/coderdojo-brindisi', '15631611571', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '13', 'Apulia', '', '', '', '', '', '', '3181528', 'Brindisi');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09444387-e50f-11e4-8bc4-d4a2af868f3e', 1244, 'Bonn', '5150', '2015-02-04 21:39:37+02', '2015-02-05 10:47:39+02', '4124', 1, 1, 1, 'alle zwei Wochen dienstags um 15:00 Uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"North Rhine-Westphalia"}', '{}', '{"name":"Beuel","geonameId":"2949619"}', 'AWO Beuel, Neustraße 86, 53225 Bonn', '50.73558999999999,7.127399999999966', '<ul><li>Unser erstes Treffen findet am 10. M&auml;rz um 15:00 Uhr statt</li><li>Bringt wenn m&ouml;glich ein Laptop mit!<ul><li>ein Ersatzlaptop haben wir noch da</li><li>vielleicht k&ouml;nnen sich auch mehrere Teilnehmer*innen dann ein Ger&auml;t teilen</li></ul></li><li>Wenn Ihr 12 Jahre oder j&uuml;nger seid, m&uuml;sst Ihr eine erziehungsberechtigte Person dabei haben, die w&auml;hrend der ganzen Veranstaltung dabei bleibt</li></ul><p><a href="https://www.facebook.com/coderDojoBN">Schreibt uns die Pinnwand bei Facebook voll!</a></p><p>&nbsp;</p>', 'coderDojoBN@loick.de', 'null', 'coderDojoBN', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '07', 'North Rhine-Westphalia', '', '', '', '', '', '', '2949619', 'Beuel');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cc3d9-e50f-11e4-8bc4-d4a2af868f3e', 383, 'Seattle', '1801', '2013-06-03 19:06:45+03', '2013-12-01 14:25:27+02', '3006', 1, 1, 2, 'Every Saturday, 10-noon', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Denny Regrade","geonameId":"7153941"}', '535 Terry Ave. N, Seattle WA', '47.624107,-122.33751999999998', '<ul><li>We meet at Amazon in Seattle most Saturdays plus do special events at other sponsor locations.&nbsp;</li><li>We normally have room for 90-100 children and use Eventbrite to ticket events just to make sure we&#39;re not overrun. All events are free, but you must get your free tickets via Eventbrite.</li><li>Bring a laptop. We have loaners available but supply is limited.</li><li><strong>A parent! (Very important). If you are 17 or under, your parent must remain onsite during the session.</strong></li></ul>', 'burgerguy@gmail.com', 'http://www.seattlecoderdojo.com', 'SEACoderDojo', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', NULL, '', NULL, '', NULL, '', NULL, '7153941', 'Denny Regrade');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cc509-e50f-11e4-8bc4-d4a2af868f3e', 385, 'Cologne', '2781', '2013-06-04 16:43:17+03', '2013-12-01 14:25:27+02', '3006', 1, 1, 1, '21. März', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Stadtgarten","geonameId":"6691075"}', 'ConceptBakery, Lindenstraße 82, 50674 Köln', '50.9325071,6.933415599999989', '<p><strong>Eine Aufsichtsperson! (Sehr wichtig). Wenn Du unter 13 bist, muss eine Aufsichtsperson waehrend der gesamten Sitzung anwesend sein.</strong></p><p>Unser n&auml;chster Termin findet am 21. M&auml;rz statt.&nbsp;Wie immer muss w&auml;hrend des gesamten Dojos eine Aufsichtsperson dabei sein.</p><p>Wenn du W&uuml;nsche hast, was du gerne lernen w&uuml;rdest &ndash; dann sag uns einfach Bescheid! Wir werden auf jeden Fall folgendes anbieten:</p><ul><li>Wir bauen eine Webseite mit HTML und CSS</li><li>Wir programmieren gemeinsam ein Spiel</li><li>Wir helfen euch bei den Grundlagen von Java</li><li>Wenn du sonstige Fragen oder Ideen hast, wir helfen dir gerne!</li></ul><p>Wenn du immer auf dem neuesten Stand bleiben m&ouml;chtest: Wir sind auf <a href="https://www.facebook.com/coderdojocgn">Facebook</a>, auf <a href="https://twitter.com/coderdojocgn">Twitter</a>&nbsp;oder du kannst unseren <a href="http://eepurl.com/MF6Ir">Email Newsletter</a> abonnieren.</p><p>Bei den letzten Events haben wir schon ein paar Webseiten gebaut &ndash; schau sie dir doch einfach mal an:</p><ul><li>Valentina und Felicitas erstellten eine <a href="https://musiclines_neu-c9-erdnusskeks.c9.io/pop.html">Seite zu Musik und Gedichten</a>.</li><li>Leo und Michel arbeiten an der <a href="https://mlstudios-c9-mlstudios.c9.io">Seite f&uuml;r ihr Kino</a>&nbsp;(gerade nicht verf&uuml;gbar)</li><li>Und Leo hat an seiner <a href="http://leoma.2ix.de">Homepage</a> gearbeitet</li><li>Anna hat eine <a href="http://www.annagreta.de/tierseite.html">Webseite mit Meerestieren</a> gebaut.</li><li>Svenja hat eine <a href="https://dinos-c9-erdnusskeks.c9.io">Webseite &uuml;ber Dinos</a> gebaut.</li><li>Irem erkl&auml;rt <a href="https://kochenfuerkinder-c9-erdnusskeks.c9.io">auf ihrer Webseite</a> wie man Nudeln macht.</li></ul>', 'lucas@dohmen.io', 'null', 'coderdojocgn', 'null', '16053716097', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '00', NULL, '', NULL, '', NULL, '', NULL, '6691075', 'Stadtgarten');
