INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09445bd5-e50f-11e4-8bc4-d4a2af868f3e', 1263, 'Northfield, MN @ Arcadia', '5189', '2015-02-10 17:55:21+02', NULL, 'null', 0, 0, 0, 'One Saturday a month, 1pm-3pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Rice County"}', '{"toponymName":"Minnesota"}', '{}', '{"name":"Dundas","geonameId":"5024756"}', 'Arcadia Charter School, 1719 Cannon Rd, Northfield MN 55057', '44.4396259,-93.18489699999998', '<p>Northfield CoderDojo is a free monthly event for kids ages 8-17 to learn about programming with tech-savvy mentors. If you are under 13, a parent or guardian must sign you up and remain onsite during the session.</p><p><span ><strong>What to bring:</strong></span></p><ul><li><span >A laptop, if you have access to one.&nbsp;</span></li><li><span >A snack or water, if you like (no peanuts, please!)</span></li><li><span >Enthusiasm and creativity!&nbsp;</span></li></ul><p><span >Registration will be through Eventbrite. Check back for links!</span></p><p>&nbsp;</p><p>&nbsp;</p>', 'nfldcoderdojo@gmail.com', 'http://facebook.com/nfldcoderdojo', 'nfldcoderdojo', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'MN', 'Minnesota', '', '', '', '', '', '', '5024756', 'Dundas');
