INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cc74e-e50f-11e4-8bc4-d4a2af868f3e', 389, 'Timisoara @Startup Hub', '1813', '2013-06-05 10:50:27+03', '2013-12-01 14:25:27+02', '3006', 1, 1, 1, 'Fiecare sambata/Every Saturday, 10.00 am - 1.00 pm.', '{"countryName":"Romania","geonameId":"798549","alpha2":"RO"}', '{}', '{"toponymName":"Timiş"}', '{}', '{"name":"Timişoara","geonameId":"665087"}', 'Timisoara Startup Hub, City Business Centre, Str. C. Brediceanu, nr. 10, Cladirea D, Parter, Timisoara', '45.75709,21.22104', '<p><strong>Copiii ar trebui sa vina cu:</strong></p><ul><li>un suc, fructe sau cateva prajiturele pe care le pot imparti cu ceilalalti participanti</li><li>un laptop, propriu sau imprumutat. Din pacate nu putem asigura inca laptopuri pentru cei care nu detin asa ceva.</li><li>un parinte, mai ales daca e vorba de copii mici, cu probleme de sanatate sau de alta natura.</li></ul><p>Puteti intelege care este atmosfera de la evenimentele noastre in <strong><a href="http://on.fb.me/116okPb">acest video</a></strong>,</p><p>Inregistrarea participarii trebuie facuta in fiecare saptamana, utilizand <strong><a href="http://www.123contactform.com/form-1114507/Inscriere-CoderDojo-Timisoara-NEW">formularul de aici</a>.</strong></p><p><strong>Parintii interesati ai caror copii sunt participanti actuali sau potentiali la activitatile CoderDojo <a href="http://eepurl.com/-Vrvj">pot subscrie aici</a> la mesajele trimise de organizatori.</strong></p><p><strong>Kids should bring along:</strong></p><ul><li>A juice, fruits or some cookies you want to share with others.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>​<strong><strong>Check out the atmosphere at our events in <a href="http://on.fb.me/116okPb">this video</a>.&nbsp;</strong></strong></p><p><strong>For registering your kid, please fill, each time he/she is planning to attend</strong><strong>&nbsp;<a href="http://www.123contactform.com/form-1114507/Inscriere-CoderDojo-Timisoara-NEW">this form</a>.</strong></p>', 'SHtimisoara@coderdojo.ro', 'null', 'coderdojotm', 'https://www.facebook.com/CoderDojo.Timisoara', 'null', 'http://ricap.ro/blog/wp-content/uploads/2013/10/Timisoara-Startup-Hub-e1401269028600-300x199.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'RO', 'ROU', NULL, NULL, 642, 'Romania', '00', NULL, '', NULL, '', NULL, '', NULL, '665087', 'Timişoara');
