INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093de429-e50f-11e4-8bc4-d4a2af868f3e', 452, 'Rose Lane Programming Club', '2292', '2013-09-27 20:23:11+03', NULL, 'null', 0, 0, 0, '', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Maricopa County"}', '{"toponymName":"Arizona"}', '{}', '{"name":"Claremont Place","geonameId":"5289983"}', 'Rose Lane Elementary School Library', '33.526361282070454, -112.05736577510834', '<h3>A Madison Rose Lane Elementary School Sponsored Club</h3> <H3>We created this club for the students first</H3> <P>Our club is a club for our children. Its not instruction, per se, but a chance for them to explore programming together. Were forming this club to ensure they have a time to explore programming together. Our club meetings are not class and we are not instructing our kids so much as we are helping them teach themselves.</P> <P>Were not teaching kids to code. We believe programming is a creative craft that you learn through exploration and curiosity. Like writing, or painting or learning a musical instrument.</P> <H3>Everyone is welcome!</H3> <P>We are an open club. While most of the curriculum we will lean on is geared around 8-9 year olds, we wont exclude older or younger kid from participating. As long as an adult believes they can get something out of participating in the club, and they are willing to come to our meetings, they are welcome.</P> <H3>We are a part of Rose Lane Elementary</H3> <P>Our club is part of Rose Lane Elementary School, so everything we do also follows the SOAR values of our school. SOAR stands for Safe, Organized, Accountable and Respectful. <H3>Programming is a creative craft</H3> <P>A long time ago, I think it was a 2011, there was an ongoing, rather tired debate that was still going on about whether or not programming was a craft or an engineering based discipline. Our club believes programming is a craft. In other words, for every problem we solve together well agree that there is more than one way to do it.</P> <H3>Programming is a team sport</H3> <P>Actually the best analogy is probably collaborative epic poetry, but as no-one actually does that, well call it a team sport. This means that programming is best done when its done with a team working together to solve a problem. While we all enjoy the modern myth of the single coder slaving away at an earth changing program by themselves, we also recognize that its not how programmers actually get things done, so its not how run our club either.</P>', 'Larry@larry.org', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', NULL, '', NULL, '', NULL, '', NULL, '5289983', 'Claremont Place');
