INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093df4d1-e50f-11e4-8bc4-d4a2af868f3e', 493, 'Cambridge, MA', '2449', '2013-10-15 23:06:15+03', '2013-12-01 14:25:25+02', '3006', 1, 1, 4, 'May 10, 2014, 12PM - 3PM ET', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Middlesex County"}', '{"toponymName":"Massachusetts"}', '{}', '{"name":"East Cambridge","geonameId":"4935352"}', '275 3rd St., Cambridge, MA', '42.36594600000001,-71.08257300000002', '<p><strong>​Attention Teens</strong></p><div><strong>And Parents:</strong><br /><br />*LEARN TO CODE *<br /><br /><strong>SATURDAY, MAY 10th, 2014</strong><br /><br /><strong>hack/reduce is...&nbsp;</strong><br />Boston&#39;s big data hacker space. The hack/reduce mission is to help Boston&nbsp;create the talent and the technologies that will shape our future in a big&nbsp;data- driven economy.</div><div>&nbsp;</div><p>Oracle is..&nbsp;</p><p>Oracle Academy provides a complete portfolio of software, curriculum,&nbsp;hosted technology, faculty training, support, and certification resources&nbsp;to secondary and higher education institutions for teaching use. Faculty&nbsp;can insert these resources into computer science and business programs,&nbsp;ensuring that students gain industry-relevant skills prior to entering the&nbsp;workforce. Oracle Academy supports over 2.5 million students in 102&nbsp;countries. To learn more, visit&nbsp;<a target="_blank" href="http://oracle.com/academy">http://oracle.com/academy</a></p><div><br />&nbsp;</div><div><strong>What:</strong> Introduction to Coding with Alice<br />&nbsp;</div><p><strong>Who:</strong> This Oracle Academy is recommended for ages12-18. Please register to attend&nbsp;<a target="_blank" href="http://learntocodeforteens.eventbrite.com/">learntocodeforteens.eventbrite.com</a></p><div>&nbsp;</div><p><strong>When: </strong>Saturday, May 10th, 2014,12:00pm - 3:00pm</p><div>&nbsp;</div><p><strong>Where:</strong> hack/reduce (at the historic Boiler and Tank&nbsp;Building in Kendall Square)</p><div>275 3rd St., Cambridge, MA, 02142<br />&nbsp;</div><p><strong>Other:</strong>&nbsp;</p><ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'info@hackreduce.org', 'http://www.hackreduce.org/', 'hackreduce', 'null', '11315961345', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', NULL, '', NULL, '', NULL, '', NULL, '4935352', 'East Cambridge');
