INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e3916-e50f-11e4-8bc4-d4a2af868f3e', 611, 'Rieti, @Officina Innovazione Rosatelli', '2962', '2014-01-14 15:04:18+02', '2014-02-06 17:22:07+02', '3006', 1, 0, 2, 'Ogni martedÏ dal 27 Maggio 2014 dalle 15:30 alle 17:30', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Rieti"}', '{"toponymName":"Latium"}', '{"toponymName":"Rieti"}', '{"name":"Montegambero","geonameId":"8956164"}', 'c/o I.I.S &quot;C. Rosatelli&quot; , Viale Fassini 1, Rieti', '42.4155193,12.855535299999929', '<ul><li>Vi invitiamo alla Palestra di programmazione di Rieti</li><li>Gli incontri sono per ragazzi tra gli 8 e i 14 anni.</li><li><strong>Imparerai a sviluppare capacita&#39; legate alla progettazione e al problem-solving, al pensiero creativo, al ragionamento sistematico e al lavoro collaborativo. </strong></li></ul>', 'coderdojorieti@gmail.com', 'null', 'CoderDojoRieti', 'http://coderdojo-rieti@googlegroups.com', '10438430627', 'https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash2/550166_470276759688999_1081806742_a.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '07', 'Latium', '', '', '', '', '', '', '8956164', 'Montegambero');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e3be0-e50f-11e4-8bc4-d4a2af868f3e', 617, 'Kennett Square, PA, @ Chatham', '2980', '2014-01-16 01:51:58+02', '2014-02-20 09:59:45+02', '3006', 1, 1, 0, 'Second Tuesday of Every Month, 6pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Chester County"}', '{"toponymName":"Pennsylvania"}', '{}', '{"name":"Kennett Square","geonameId":"4558942"}', '235 Whitehorse Ln, Kennett Square, PA 19348', '39.8494401,-75.69372479999998', '<p>We are launching a Coder Dojo right here in Kennett Square, PA! Our mission is to introduce people of all ages to programming. Basic computer knowledge and operation are recommended, but a desire to learn is a must!&nbsp;</p><p>Please consider the guidelines below:</p><ul><li>A laptop. Borrow one from someone if needs be. If you are unable to obtain access to a laptop, please contact the Dojo so we can arrange one for you to use in the classroom.</li><li>Beverages will be provided.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'ksqdojo@gmail.com', 'null', 'CoderDojoKSQ', 'null', 'null', 'https://extranet.chathamfinancial.com/img/CHF-global-logo-252x63.gif', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'PA', 'Pennsylvania', '', '', '', '', '', '', '4558942', 'Kennett Square');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e4ea7-e50f-11e4-8bc4-d4a2af868f3e', 624, 'Damansara Perdana, @xcodemonks', '3022', '2014-01-21 03:10:11+02', '2014-01-22 12:34:27+02', '3006', 1, 1, 1, 'Every second Saturday of the month, 3pm to 5pm', '{"countryName":"Malaysia","geonameId":"1733045","alpha2":"MY"}', '{}', '{}', '{}', '{"name":"Kampong Bukit Lanjan","geonameId":"1770201"}', 'Mohammad Chow Restaurant, 3-1, Jalan PJU 8/5H, Damansara Perdana Business Center, 47820 PJ, Selangor', '3.1660281419703815, 101.6073614358902', '<p>You will need the following:</p><ul><li>A Mac laptop running OS X 10.9.5 and Xcode 6.0. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li><strong>Important!</strong> Session on 4th October 2014 is cancelled. Next session will be on of 8 November 2014.</li></ul>', 'xcodemonks@icloud.com', 'http://xcodemonks.tumblr.com', 'xcodemonks', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'MY', 'MYS', NULL, NULL, 458, 'Malaysia', '00', '', '', '', '', '', '', '', '1770201', 'Kampong Bukit Lanjan');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e563c-e50f-11e4-8bc4-d4a2af868f3e', 637, 'Linköping', '3076', '2014-01-24 20:14:00+02', '2014-01-28 17:28:32+02', '3006', 1, 0, 2, 'Odd week wednesdays, 6pm - 8pm', '{"countryName":"Sweden","geonameId":"2661886","alpha2":"SE"}', '{"toponymName":"Linköpings Kommun"}', '{"toponymName":"Östergötland"}', '{"toponymName":"Slaka"}', '{"name":"Valla","geonameId":"2665577"}', 'Teknikringen 7, 58330 Linköping', '58.39422308981142,15.56263777448271', '<h4>Vilka f&aring;r vara med?</h4><p>Barn och ungdomar 7-17 &aring;r. Barn under 12 b&ouml;r ha s&auml;llskap av en vuxen.</p><p>&nbsp;</p><h4>Vilka h&aring;ller i tr&auml;ffarna?</h4><p>Det g&ouml;r intresserade mentorer med kunskap om programmering.</p><h4>&Auml;r det en kurs?</h4><p>Nej, det &auml;r inte en vanlig kurs d&auml;r du m&aring;ste delta varje g&aring;ng. Anm&auml;l dig s&aring; att vi vet hur mycket fika som kommer att g&aring; &aring;t.</p><h4>Vad h&auml;nder under de tv&aring; timmarna?</h4><p>Mentorerna ger n&aring;gra f&ouml;rslag p&aring; hur du kan komma ig&aring;ng med programmering. V&auml;lj n&aring;got du tycker &auml;r kul, s&auml;tt dig vid en dator och f&ouml;rs&ouml;k l&ouml;sa uppgiften. Man beh&ouml;ver inte utg&aring; fr&aring;n f&ouml;rslagen utan det g&aring;r utm&auml;rkt att g&ouml;ra n&aring;got utifr&aring;n egna id&eacute;er. Du beh&ouml;ver ta med dig en egen b&auml;rbar dator. Beh&ouml;ver du hj&auml;lp s&aring; finns mentorerna d&auml;r f&ouml;r din skull.</p><p><em>Coderdojo kommer att h&aring;llas udda veckor, p&aring; onsdagar mellan kl 18.00-20.00. N&aring;gra veckor kommer vi dock bli tvungna att byta till dag. Vi informerar d&aring; extra via social medier. Vi h&aring;ller till p&aring; creActive i Mj&auml;rdevi. Teknikringen 7. ( <a href="http://www.creactive-mjardevi.se">http://www.creactive-mjardevi.se/</a> )&nbsp;</em></p>', 'linkoping.se@coderdojo.com', 'null', 'CoderDojoLkpg', 'https://groups.google.com/forum/#!forum/coderdojo-lkpg', '10339502731', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'SE', 'SWE', NULL, NULL, 752, 'Sweden, Kingdom of', '16', 'Östergötland', '', '', '', '', '', '', '2665577', 'Valla');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e7959-e50f-11e4-8bc4-d4a2af868f3e', 709, 'La Paz, Bolivia @ Bolivia Tech Hub', '3301', '2014-03-04 19:19:29+02', '2014-03-06 09:38:06+02', '3006', 1, 1, 1, 'Todos los Viernes y Sabado, desde las 16:00 a partir del 13 de febrero', '{"countryName":"Bolivia","geonameId":"3923057","alpha2":"BO"}', '{}', '{"toponymName":"La Paz"}', '{}', '{"name":"San Jorge","geonameId":"3905595"}', 'Av. Sanchez Lima (final) esquina Pasaje Fabiani, No 2687, Sopocachi, La Paz', '-16.513461273544458,-68.12447649706723', '<p><strong>Club de entrenamiento para estudiantes de Colegio</strong> (cualquier edad), profesores y demas interesados que busquen iniciarse en el mundo de la Programacion Competitiva, que puedan participar en el futuro en competencias como la Olimpiada Boliviana de Informatica, el Abierto de Informatica, el Iberoamericano de Informatica o la final mundial de la Olimpiada Internacional de Informatica!</p><p>Todo este contexto de competencias les permitira en un futuro poder participar en los torneos de programacion mas importantes, como ser el ICPC, Google Code Jam, TopCoder Open, Facebook Hacker Cup y otros. Esto les permitira tener un nivel competitivo alto y podran aspirar a puestos de trabajo en las mejores empresas de Software de Bolivia o el mundo, ya en la actualidad muchos exICPC trabajan en las mejores empresas nacionales de software, en Facebook y otros tienen opciones de ir a Google.</p><p>Los interesados deberan enviar un mensaje a&nbsp;coderdojo@icpc-bolivia.edu.bo</p><p>Se tendran sesiones semanales y cada sesion tiene una duracion de 2 horas. Se tiene planificado un total de 8 sesiones.</p><p>Cada asistente debe llevar:</p><ul><li>Una Laptop</li></ul><p>Los talleres inician desde el viernes 20 de febrero, bajo el siguiente rol:</p><div>16:00 &nbsp;a 18:00*</div><div>&nbsp;</div><div>Y los sabados en el mismo turno:</div><div>&nbsp;</div><div><div>16:00 &nbsp;a 18:00*</div><div>&nbsp;</div><div>* los horarios de alguna sesion pueden variar, pero seran anunciados en la sesion previa para coordinar el cambio con todos los asistentes.</div><div>&nbsp;</div><div><div><strong>Indice de Contenidos por sesion:</strong></div><div><br /><strong>Sesion&nbsp;1:</strong> Introcducci&oacute;n a la programacion en C++.<br />Tutor: Oscar Carvajal.<br /><br /><strong>Sesion&nbsp;2:</strong> Estructuras de Datos.<br />Tutor: Diego Charca.<br /><br /><strong>Sesion&nbsp;3:</strong> Programaci&oacute;n Modular.<br />Tutor: Rodrigo Castillo.<br /><br /><strong>Sesion&nbsp;4:</strong> Matem&aacute;ticas.<br />Tutor: Rodrigo Castillo.<br /><br /><strong>Sesion&nbsp;5:</strong> Estructuras de Datos 2.<br />Tutor: Addis Rengel.<br /><br /><strong>Sesion&nbsp;6:</strong> Grafos 1.<br />Tutor: Gabriel Mazuelos.<br /><br /><strong>Sesion&nbsp;7:</strong> Grafos 2.<br />Tutor: Addis Rengel.<br /><br /><strong>Sesion&nbsp;8:</strong> Programaci&oacute;n Din&aacute;mica.<br />Tutor: Branimir Espinoza.</div></div></div>', 'coderdojo@icpc-bolivia.edu.bo', 'http://olimpiada.icpc-bolivia.edu.bo/', 'wpimentel', 'http://ask.icpc-bolivia.edu.bo/', '15639740886', 'http://2014.desarrollandoamerica.org/wp-content/uploads/2014/07/sim1.png', 0, 'null', NULL, 0, 'null', 'SA', 'BO', 'BOL', NULL, NULL, 68, 'Bolivia, Republic of', '04', 'La Paz', '', '', '', '', '', '', '3905595', 'San Jorge');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e60dc-e50f-11e4-8bc4-d4a2af868f3e', 658, 'Lubbeek', '3230', '2014-02-03 14:27:38+02', '2014-03-11 10:18:36+02', '3006', 1, 1, 2, 'Maandelijks, elke eerste zaterdag van 10u tot 13u.', '{"countryName":"Belgium","geonameId":"2802361","alpha2":"BE"}', '{"toponymName":"Flemish Brabant Province"}', '{"toponymName":"Flemish"}', '{}', '{"name":"Ledigheid","geonameId":"2793063"}', 'Dienstencentrum ''De Sleutel'', Staatsbaan 124, 3210 Lubbeek', '50.89538109999999,4.820146799999975', '<p>Meebrengen</p><ul><li>Een laptop + lader</li><li><strong>Een ouder! (belangrijk). Ben je jonger dan 12, dan blijft die ouder ook ter plaatse. Wees gerust, we houden die wel nuttig bezig...</strong></li></ul><div>&nbsp;</div><div>&nbsp;</div>', 'info@lavaconsult.eu', 'http://www.coderdojobelgium.be', 'coderdojoBE', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'BE', 'BEL', NULL, NULL, 56, 'Belgium, Kingdom of', 'VLG', 'Flemish', '', '', '', '', '', '', '2793063', 'Ledigheid');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e6639-e50f-11e4-8bc4-d4a2af868f3e', 670, 'Springvale CoderDojo', '3171', '2014-02-10 09:22:24+02', '2014-02-11 16:01:13+02', '3006', 1, 0, 2, '10:00am-12:00pm Every Saturday', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Belfast"}', '{"toponymName":"Northern Ireland"}', '{}', '{"name":"Springfield","geonameId":"2637195"}', 'Springvale, 200 Springfield Road, Belfast. BT12 7DR', '54.59962488493051,-5.960388177909863', '<h2>Come along and join in on the Fun!!</h2><p>Springvale CoderDojo are happy to announce that we have opened our doors to the public. You will need to book a spot to be able to join, so don&#39;t hesitate!!&nbsp;</p><p>During your time at Springvale&#39;s CoderDojo, you will do the following:</p><ul><li><strong>Weeks 1 to 5</strong> - Scratch</li><li><strong>Weeks 6 to 10</strong>&nbsp;- Gamemaker</li><li><strong>Weeks 11 to 15</strong>&nbsp;- Lego Mindstorms</li><li><strong>Week&#39;s 16 to 20&nbsp;</strong>- App Inventor</li></ul><p>Other aspects of coding that we hope to bring to you soon are:</p><ul><li><strong>Web Development</strong></li><li><strong>Minecraft</strong></li></ul><p>Some other usful information for you......</p><ul><li>PCs are provided for your convenience</li><li>Please bring a pack lunch (shops are close by)</li><li><strong>A parent must stay with their child during the session.</strong></li></ul><p><strong>​For further information, please contact us:</strong></p><p>coderdojoadmin@springvalelearning.com</p>', 'CoderDojoAdmin@springvalelearning.com', 'http://www.springvalelearning.com', 'SpringvaleLearn', 'null', '10644703595', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'NIR', 'Northern Ireland', '', '', '', '', '', '', '2637195', 'Springfield');
