INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093ec060-e50f-11e4-8bc4-d4a2af868f3e', 785, 'Saitama', '3654', '2014-04-17 09:06:14+03', '2014-05-26 09:23:32+03', '3006', 1, 0, 1, 'Third Saturday of each month, 2pm-4pm', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{}', '{"toponymName":"Saitama"}', '{}', '{"name":"Sakuragicho","geonameId":"1854130"}', '1-5, miyamachi, oomiya-ku, saitama-shi, SAITAMA', '35.907798,139.62482079999995', '<p>&nbsp;</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojosaitama@gmail.com', 'https://www.facebook.com/coderdojo.saitama', 'CoderDojoSaitam', 'https://groups.google.com/forum/#!forum/coderdojosaitama', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'JP', 'JPN', NULL, NULL, 392, 'Japan', '34', 'Saitama', '', '', '', '', '', '', '1854130', 'Sakuragicho');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e6fc7-e50f-11e4-8bc4-d4a2af868f3e', 689, 'Eastpoint, @FINEOS', '3229', '2014-02-19 10:48:05+02', '2014-05-16 13:17:42+03', '3006', 1, 0, 0, 'Saturday, Monthly, 2pm to 4pm (Please email for more information)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"North Strand","geonameId":"6691025"}', 'Eastpoint Business Park, Dublin 3', '53.35779245478704,-6.227738969867005', '<p>FINEOS Coderdojo is a fun and open learning environment for kids aged 6 to 17, teaching kids to code through fun projects in Scratch, HTML, PhP etc.</p><p>Please contact via eastpoint.ie@coderdojo.com for information.&nbsp;</p><p>Attendees must observe the following:</p><ul><li>A valid eventbrite ticket for the event is required (will be notified by email when tickets are available)</li><li>A pack lunch or snack. Some refreshments are provided.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). All attendees must have a parent or guardian present</strong></li></ul><p>FINEOS is a Global Technology Leader in the Group Life and Health insurance industry. Six of the top 20 Group Life and Health insurance carriers in the USA use FINEOS, as well as 3 of the top 15 insurance carriers in Canada and 3 of the top 5 Life and Health insurance carriers in Australia.<br />&nbsp;</p>', 'eastpoint.ie@coderdojo.com', 'null', 'CoderdojoFineos', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '', '', '', '', '', '', '', '', '6691025', 'North Strand');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e742f-e50f-11e4-8bc4-d4a2af868f3e', 698, 'Shailer Park, Logan, @Logan Hyperdome Library (Logan City Council)', '3222', '2014-02-26 04:46:11+02', '2014-05-27 11:39:09+03', '3006', 1, 1, 2, 'Saturday, 1pm - 3pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Logan"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Shailer Park","geonameId":"8347715"}', 'Logan Hyperdome Library, Mandew Street, Shailer Park, Qld', '-27.6557979,153.17141709999999', '<p>Like to code and want some help or want to know where to start?&nbsp; Do you like &#39;LEGO&#39; Robotics - &#39;WeDo&#39; or &#39;.EV3?&nbsp; If you do, then join volunteer tutors in eight weeks of coding support and fun.&nbsp; Get some help with your own project or learn about simple programming with kid-friendly software and &#39;LEGO&#39; robotics.</p><p>&nbsp;</p><p>Places are limited so bookings are essential. Please register at&nbsp;http://www.logan.qld.gov.au/about-logan/calendar (search for CoderDojo) for upcoming events.&nbsp;</p><p>Participants should bring -</p><p>- a laptop if you have one or use one of the libraries PCs</p><p>- a parent/carer if under 15</p><p>- a snack</p><p>If parents/carers or other interested people would like to volunteer to become a CoderDojo Logan mentor while attending with their child please let us know.&nbsp; (to enquire about registering to become a mentor please phone: 3412 4163)</p>', 'logan.au@coderdojo.com', 'http://www.logan.qld.gov.au/about-logan/calendar', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '8347715', 'Shailer Park');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e770b-e50f-11e4-8bc4-d4a2af868f3e', 704, 'Parma', '2378', '2014-03-01 11:19:26+02', '2014-03-11 10:06:51+02', '3006', 1, 1, 4, 'Sabato 15 Marzo, 15:00 - 18:00', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Parma"}', '{"toponymName":"Emilia-Romagna"}', '{"toponymName":"Sorbolo"}', '{"name":"Sorbolo","geonameId":"3166374"}', 'Via Gruppini 4, Sorbolo 43058 Italy', '44.8471391,10.44488720000004', '<h2><strong>Che cos&#39;&egrave; CoderDojo?</strong></h2><p>I CoderDojo sono laboratori / club di programmazione gratuiti e aperti a bambini e ragazzi, qui a Bologna partiremo dedicandoci alla fascia d&#39;et&agrave; 7-13.</p><p>Gli eventi si tengono con cadenza periodica, cominceremo con uno al mese. Indicativamente fisseremo gli incontri il sabato pomeriggio, ma potremmo decidere di spostarli la mattina in base alle esigenze dei ragazzi.</p><h2><strong>Cosa si fa durante un evento?</strong></h2><p>Impareremo a utilizzare&nbsp;<a href="http://scratch.mit.edu/">Scratch</a>&nbsp;per creare i nostri primi programmi e semplici videogiochi.</p><p>L&#39;evento dura circa 3 ore, nella prima parte uno dei mentor spiegher&agrave; a tutti il funzionamento di Scratch attraverso un esempio che i bambini riprodurranno sui propri computer, supportati dagli altri mentor. Nella seconda parte, dopo la merenda, i ragazzi saranno liberi di continuare a personalizzare il proprio gioco o crearne un altro sulla base di quello che hanno imparato.</p><h2><strong>Che cosa bisogna portare?</strong></h2><p>Un portatile per ogni bambino (windows, mac, ubuntu), possibilmente con&nbsp;<a href="http://scratch.mit.edu/download">Scratch</a>&nbsp;gi&agrave; installato</p><p>Una merenda</p><p>Un genitore/accompagnatore</p><h2><strong>Come ci si iscrive?</strong></h2><p>E&#39; possibile effettuare la registrazione tramite Eventbrite a questo indirizzo:&nbsp;<a href="http://www.eventbrite.it/e/registrazione-coderdojo-parma-sorbolo-15-marzo-10781280099">http://www.eventbrite.it/e/registrazione-coderdojo-parma-sorbolo-15-marzo-10781280099</a></p><p>News:&nbsp;<strong>Per l&#39;evento dell&#39;15 Marzo mancano pochi posti!</strong></p><p>Visto l&#39;entusiasmo, organizzeremo il 5 aprile a Sorbolo un altro evento!</p><h2><strong>Hai bisogno di altre informazioni?</strong></h2><p>Contattaci su coderdojoparma@gmail.com, cercheremo di risponderti al pi&ugrave; presto!</p><h3>Above all, be cool! ;)</h3>', 'info@coderdojoparma.it', 'http://www.coderdojoparma.it', 'CoderDojoParma', 'https://groups.google.com/forum/#!forum/coderdojo-parma', '10781280099', 'null', 1, '2378', '2014-03-27 22:04:06+02', 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '05', 'Emilia-Romagna', '', '', '', '', '', '', '3166374', 'Sorbolo');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e939b-e50f-11e4-8bc4-d4a2af868f3e', 731, 'Wicklow Town, @EGS', '3399', '2014-03-16 19:40:11+02', '2014-03-18 16:07:08+02', '3006', 1, 0, 2, 'Every Saturday 11:00 am (closed for Holiday, restarting on the 17th of January 2015)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Wicklow","geonameId":"2960936"}', 'EGS School, Wicklow Town', '52.98734444641354,-6.054448800338719', '<ul><li>Have eaten lunch or have snacks that are non-messy as the School does not appreciate mess!</li><li>A laptop. Borrow one from someone if needs be. &nbsp;If you contact Matthew before the meeting by email we might be able to arrange something.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session. &nbsp;The lower age limit is 10 years old for the moment.</strong></li></ul>', 'EGSCoderDojo@gmail.com', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', 'Leinster', '31', 'Wicklow', '', '', '', '', '2960936', 'Wicklow');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e989e-e50f-11e4-8bc4-d4a2af868f3e', 737, 'Gravesend', '3418', '2014-03-19 13:37:57+02', '2014-03-20 10:06:20+02', '3006', 1, 1, 4, '1st Saturday of each month', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Kent"}', '{"toponymName":"England"}', '{"toponymName":"Gravesham"}', '{"name":"Gravesend","geonameId":"2648187"}', '143 Wellington St, Gravesend DA12 1JF', '51.4404286,0.37445439999999053', '<p>We are currently in planning so dates and times are subject to change.</p><p>If you are coming to the Gravesend Dojo you will need</p><ul><li><strong>A laptop. We have a limited amount of PCs so bring your laptop if you have one.</strong></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay on the premises during the session. </strong></li></ul>', 'gravesend.uk@coderdojo.com', 'null', 'CoderDojoGravesend', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2648187', 'Gravesend');
