INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093ea77c-e50f-11e4-8bc4-d4a2af868f3e', 755, 'Douglas Community School Cork', '2687', '2014-03-27 17:17:32+02', '2014-03-27 18:39:14+02', '3006', 1, 0, 1, 'Every Thursday, 3.30pm - 4.30pm during term', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Tramore","geonameId":"3299417"}', 'Douglas Community School, Douglas, Cork', '51.87879074452427,-8.443027895245336', '<ul><li>This CoderDojo is only open to those attending Douglas Community School, Cork</li><li>We will be using the computers already setup in the school so if you would like to work on code both in and out of the CoderDojo, set up a Google Drive or Dropbox account or bring a USB.</li></ul>', 'dcscoderdojo@gmail.com', 'null', 'DCSCoderDojo', 'http://dcs-coderdojo@googlegroups.com', 'null', 'null', 0, 'null', NULL, 1, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'M', 'Munster', '04', 'County Cork', '', '', '', '', '3299417', 'Tramore');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eb91b-e50f-11e4-8bc4-d4a2af868f3e', 776, 'Charles River CoderDojo', '3620', '2014-04-10 00:49:26+03', '2014-04-10 12:52:42+03', '3006', 1, 1, 2, 'See Meetup Schedule', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Middlesex County"}', '{"toponymName":"Massachusetts"}', '{}', '{"name":"East Cambridge","geonameId":"4935352"}', 'Microsoft NERD Center, 1 Memorial Drive, Cambridge MA 02142', '42.3615388,-71.0813235', '<ul><li>A laptop. Borrow one from someone if you need to. If you don&#39;t have one please call ahead - we usually have 3 or 4 loaners available - they go on a first-come first-served basis.</li><li><strong>A parent! (Very important). &nbsp;Currently we require a parent / guardian must stay with you during the sessions</strong></li><li>For all upcoming event announcements please see our Meetup Group &nbsp;<a href="http://www.meetup.com/CharlesRiver-CoderDojo/">http://www.meetup.com/CharlesRiver-CoderDojo/</a></li></ul><p>&nbsp;</p><p>Thanks to</p><ul><li>Sprout &amp; Co. for providing our first space</li><li>Microsoft for proving the NERD center and funding for White &amp; Yellow Belts (USB Drives)</li><li>Amazon Web Services for providing credits to use</li><li>O&#39;Reilly for User Group books and discounts</li><li>Pragmatic Programmers for books&nbsp;</li></ul>', 'charlesriver.us@coderdojo.com', 'http://www.meetup.com/CharlesRiver-CoderDojo/', 'CoderDojoCRiver', 'null', 'null', 'http://a1.awsstatic.com/images/open-graph/opengraph.gif', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'MA', 'Massachusetts', '', '', '', '', '', '', '4935352', 'East Cambridge');
