INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eb0ca-e50f-11e4-8bc4-d4a2af868f3e', 766, 'Bradford', '3558', '2014-04-07 09:13:53+03', '2014-04-09 10:51:47+03', '3006', 1, 1, 2, 'Saturday 9:30 - 12:30 (usually the last Saturday of the month)', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Bradford"}', '{"toponymName":"England"}', '{}', '{"name":"Bradford","geonameId":"2654993"}', 'The Innovation Centre, Bradford Design Exchange, Little Germany, Bradford, BD15BD', '53.794860965851015,-1.745689759663378', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li>A parent! (Very important). Your parent must stay with you during the session.</li><li>The next session is planned for Saturday 6th December 9:30 &ndash; 12:30 at the Innovation Centre Bradford.</li><li><strong>Registration for the event will appear soon</strong></li></ul>', 'bradford.uk@coderdojo.com', 'http://www.ticbradford.com/coderdojo', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2654993', 'Bradford');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eb450-e50f-11e4-8bc4-d4a2af868f3e', 770, 'Mediglia MI', '3605', '2014-04-08 15:20:39+03', '2014-04-09 10:30:59+03', '3006', 1, 1, 2, 'Verifica i prossimi eventi su: http://coderdojomediglia@go2net.it', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Milan"}', '{"toponymName":"Lombardy"}', '{"toponymName":"Mediglia"}', '{"name":"Bettolino di Mediglia","geonameId":"6544529"}', 'Via Lattea 2, 20060 Bettolino di Mediglia (MI) - Italy', '45.434616764444215,9.338676523278764', '<p>Per &nbsp;partecipare all&#39;evento dovrai portare:</p><ul><li>Una merenda.</li><li>Un computer portatile. Se non ce l&#39;hai fattene prestare uno oppure, se ci avvisi per tempo, te lo prestiamo noi.</li><li>Un adulto! Il tuo accompagnatore deve essere presente durante tutta la durata dell&#39;evento.</li><li>Se non hai gi&agrave; partecipato ad altri eventi, la liberatoria <strong>firmata dai tuoi genitori</strong> che puoi scaricare qui: <a href="https://drive.google.com/file/d/0B33AW1G-2doZa2tmVVBZYjFhdG8/view?usp=sharing">LINK</a>. &Egrave; importante: senza non possiamo farti partecipare.&nbsp;</li><li><strong>Tanta voglia di divertirti!</strong></li></ul>', 'coderdojomediglia@go2net.it', 'http://coderdojomediglia.go2net.it', 'cdojomediglia', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '09', 'Lombardy', '', '', '', '', '', '', '6544529', 'Bettolino di Mediglia');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eb61e-e50f-11e4-8bc4-d4a2af868f3e', 772, 'Budapest, @LogMeIn', '3610', '2014-04-09 10:55:10+03', '2014-04-10 10:51:52+03', '3006', 1, 0, 2, '2014/15 tanév', '{"countryName":"Hungary","geonameId":"719819","alpha2":"HU"}', '{}', '{"toponymName":"Budapest"}', '{}', '{"name":"Budapest V. kerület","geonameId":"7117203"}', 'LogMeIn R&amp;D Center, Andrássy út 9, Budapest, Hungary', '47.50043027012623,19.056522165328943', '<p>Sziasztok! Itt a&nbsp;<strong>CoderDojo Budapest, @LogMeIn&nbsp;</strong>folytat&aacute;sa!</p><p>A 2014/15 tan&eacute;vben t&ouml;bb, h&aacute;romalkalmas Dojo-t rendez&uuml;nk.&nbsp;</p><ul><li><p>A Dojo-sorozatok ez&uacute;ttal h&aacute;rom, egym&aacute;sra &eacute;p&uuml;lő alkalomb&oacute;l &aacute;llnak, amelyeket h&aacute;rom, egym&aacute;st k&ouml;vető h&eacute;ten tartunk meg.</p></li><li><p>Ez&eacute;rt a jelentkez&eacute;sn&eacute;l k&eacute;rj&uuml;k, vegy&eacute;tek figyelembe, hogy mindh&aacute;rom alkalmon r&eacute;szt tudtok-e venni.</p></li><li><p>Az egyes Dojo-k anyaga ugyanaz, &iacute;gy csak egy sorozatra &eacute;rdemes jelentkeznetek.</p></li><li><p>Tal&aacute;lkozzunk minden cs&uuml;t&ouml;rt&ouml;k&ouml;n 18-20 &oacute;r&aacute;ig, h&aacute;rom h&eacute;ten kereszt&uuml;l a LogMeIn R&amp;D k&ouml;zpontj&aacute;ban (Andr&aacute;ssy u. 9, Budapest 1061).</p></li><li><p>Javasolt koroszt&aacute;ly: 9-13 &eacute;v</p></li><li><p>Ha van saj&aacute;t laptopod, nyugodtan elhozhatod &eacute;s azon is k&oacute;dolhatsz.</p></li><li><p>Csak a gyerekeknek sz&uuml;ks&eacute;ges a jelentkez&eacute;s az EventBrite oldal&aacute;n.</p></li><li><p>R&eacute;szleteket a Dojo-r&oacute;l &eacute;s a beiratkoz&aacute;sr&oacute;l itt tal&aacute;lhattok:&nbsp;<a href="https://coderdojolmi.uservoice.com/">https://coderdojolmi.uservoice.com/</a></p></li></ul>', 'tickets@coderdojolmi.uservoice.com', 'http://coderdojolmi.uservoice.com/', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'HU', 'HUN', NULL, NULL, 348, 'Hungary, Republic of', '05', 'Budapest', '', '', '', '', '', '', '7117203', 'Budapest V. kerület');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eb76b-e50f-11e4-8bc4-d4a2af868f3e', 774, 'St Paul, MN - KatieCoderdojo', '3598', '2014-04-09 12:39:23+03', '2014-04-09 13:22:25+03', '3006', 1, 0, 2, 'Monthly on Sunday afternoons (see website for dates)', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Ramsey County"}', '{"toponymName":"Minnesota"}', '{}', '{"name":"Mendota","geonameId":"5037278"}', 'St Catherine University, St Paul, MN', '44.92471700000001,-93.18229200000002', '<ul><li><p><strong>KatieCoderDojo welcomes <em>girls</em> ages 8 to 16 as participants, and adults (male or female) as mentors.&nbsp; Currently we have a games group, using Scratch and a mobile app group using AppInventor.</strong></p><p><strong>Adults must pass a background check. </strong></p><p>Please see website for more information and registration:&nbsp;http://www.codesavvy.org/p/katie-coderdojo.html</p><p>KatieCoderDojo is an initiative of Code Savvy, a non-profit organization dedicated to inspiring a diverse, new code-savvy generation&nbsp; AND The national Center for STEM Elementary Education, dedicated to improving teachers confidence in STEM. see: stem.stkate.edu</p></li></ul>', 'stem@stkate.edu', 'http://www.codesavvy.org/p/katie-coderdojo.html', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'MN', 'Minnesota', '', '', '', '', '', '', '5037278', 'Mendota');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09403b4a-e50f-11e4-8bc4-d4a2af868f3e', 807, 'Thessaloniki', '3731', '2014-05-06 18:45:24+03', '2014-10-07 09:25:20+03', '3006', 1, 0, 2, 'Saturday 14 March 2015, 10am - 13pm', '{"countryName":"Greece","geonameId":"390903","alpha2":"GR"}', '{"toponymName":"Thessaloniki"}', '{"toponymName":"Central Macedonia"}', '{"toponymName":"Thessaloniki"}', '{"name":"Thessaloniki","geonameId":"734077"}', 'CITY College, The University of Sheffield  International Faculty, Leontos Sofou 3, Thessaloniki', '40.63713348775084,22.936729113422416', '<p><strong>CoderDojo.Scratch.Arduino.RasberryPi</strong></p><p>&Sigma;&omicron;&upsilon; &alpha;&rho;έ&sigma;&omicron;&upsilon;&nu; &tau;&alpha; &pi;&alpha;&iota;&chi;&nu;ί&delta;&iota;&alpha;? &Sigma;&omicron;&upsilon; &alpha;&rho;έ&sigma;&epsilon;&iota; &nu;&alpha; &gamma;&rho;ά&phi;&epsilon;&iota;&sigmaf; &kappa;ώ&delta;&iota;&kappa;&alpha;? &Sigma;&omicron;&upsilon; &alpha;&rho;έ&sigma;&epsilon;&iota; &nu;&alpha; &kappa;&alpha;&tau;&alpha;&sigma;&kappa;&epsilon;&upsilon;ά&zeta;&epsilon;&iota;&sigmaf;?</p><p>&Sigma;&tau;&omicron; &epsilon;&pi;ό&mu;&epsilon;&nu;&omicron; <strong>CoderDojo Thessaloniki | Arduino</strong> <strong>Project</strong> &theta;&alpha; &tau;&alpha; έ&chi;&epsilon;&iota;&sigmaf; ό&lambda;&alpha; &mu;&alpha;&zeta;ί!</p><p>&nbsp;&Pi;&iota;&omicron; &alpha;&nu;&alpha;&lambda;&upsilon;&tau;&iota;&kappa;ά &tau;&omicron; &pi;&rho;ό&gamma;&rho;&alpha;&mu;&mu;&alpha; &mu;&alpha;&sigmaf; &pi;&epsilon;&rho;&iota;&lambda;&alpha;&mu;&beta;ά&nu;&epsilon;&iota;:</p><ul><li>&Epsilon;&iota;&sigma;&alpha;&gamma;&omega;&gamma;ή &sigma;&tau;&omicron; &pi;&rho;&omicron;&gamma;&rho;&alpha;&mu;&mu;&alpha;&tau;&iota;&sigma;&tau;&iota;&kappa;ό &gamma;&rho;&alpha;&phi;&iota;&kappa;ό &pi;&epsilon;&rho;&iota;&beta;ά&lambda;&lambda;&omicron;&nu; Scratch.</li><li>&Gamma;&nu;&omega;&rho;&iota;&mu;ί&alpha; &mu;&epsilon; &tau;&alpha; Arduino (<a target="_blank" href="http://www.arduino.cc">http://www.arduino.cc</a>) &kappa;&alpha;&iota;</li><li>Raspberry Pi (<a target="_blank" href="http://www.raspberrypi.org">http://www.raspberrypi.org</a>).</li></ul><p>&nbsp;&Mu;&epsilon;&tau;ά &tau;&alpha; &epsilon;&iota;&sigma;&alpha;&gamma;&omega;&gamma;&iota;&kappa;ά, &alpha;&kappa;&omicron;&lambda;&omicron;&upsilon;&theta;&omicron;ύ&nu; &omicron;&iota; &pi;&rho;ά&xi;&epsilon;&iota;&sigmaf;:</p><ul><li>&Pi;&omega;&sigmaf; &theta;&alpha; &phi;&tau;&iota;ά&xi;&epsilon;&iota;&sigmaf; &tau;&omicron; &delta;&iota;&kappa;ό &sigma;&omicron;&upsilon; &pi;&rho;&omicron;&gamma;&rho;&alpha;&mu;&mu;&alpha;&tau;ά&kappa;&iota;;</li><li>&Pi;&omega;&sigmaf; &pi;&rho;&omicron;&gamma;&rho;&alpha;&mu;&mu;&alpha;&tau;ί&zeta;&epsilon;&iota;&sigmaf; έ&nu;&alpha;&nu; &mu;&iota;&kappa;&rho;&omicron;&epsilon;&lambda;&epsilon;&gamma;&kappa;&tau;ή &mu;&epsilon; &tau;&omicron; Scratch;</li><li>&Pi;&omega;&sigmaf; &theta;&alpha; &alpha;&nu;ά&psi;&epsilon;&iota;&sigmaf; &tau;&alpha; &chi;&rho;&omega;&mu;&alpha;&tau;&iota;&sigma;&tau;ά LEDs;</li><li>&Pi;&omega;&sigmaf; &theta;&alpha; &sigma;&tau;&rho;&iota;&phi;&omicron;&gamma;&upsilon;&rho;ί&sigma;&epsilon;&iota;&sigmaf; &tau;&omicron; Servo;</li><li>&Pi;&omega;&sigmaf; &theta;&alpha; &phi;&tau;&iota;ά&xi;&epsilon;&iota;&sigmaf; &tau;&omicron; &delta;&iota;&kappa;ό &sigma;&omicron;&upsilon; &chi;&epsilon;&iota;&rho;&iota;&sigma;&tau;ή&rho;&iota;&omicron; &gamma;&iota;&alpha; &tau;&omicron; &delta;&iota;&kappa;ό &sigma;&omicron;&upsilon; &pi;&alpha;&iota;&chi;&nu;ί&delta;&iota;;</li></ul><p>&Tau;&omicron; 2&omicron; CoderDojo Thessaloniki | Arduino &delta;&iota;&omicron;&rho;&gamma;&alpha;&nu;ώ&nu;&epsilon;&tau;&alpha;&iota; &sigma;&epsilon; &sigma;&upsilon;&nu;&epsilon;&rho;&gamma;&alpha;&sigma;ί&alpha; &mu;&epsilon; &tau;&eta;&nu; <a target="_blank" href="http://epy-mathra.gr/"><strong>&Epsilon;&Pi;&Upsilon;</strong>-&Pi;&alpha;&rho;ά&rho;&tau;&eta;&mu;&alpha;&nbsp;&Mu;&alpha;&kappa;&epsilon;&delta;&omicron;&nu;ί&alpha;&sigmaf;&nbsp;</a><a target="_blank" href="http://epy-mathra.gr/">&Theta;&rho;ά&kappa;&eta;&sigmaf;</a>&nbsp;&kappa;&alpha;&iota; &mu;&epsilon; &upsilon;&pi;&omicron;&sigma;&tau;&eta;&rho;&iota;&kappa;&tau;ή&nbsp;&tau;&omicron;&nbsp;<a target="_blank" href="http://goo.gl/2F0B6G">City College, The University of Sheffield International Faculty</a></p><p><strong>&Sigma;&eta;&mu;&alpha;&nu;&tau;&iota;&kappa;ό &alpha;&nu; &epsilon;ί&sigma;&alpha;&iota; &kappa;ά&tau;&omega; &tau;&omega;&nu; 12 &epsilon;&tau;ώ&nu; &omicron; &kappa;&eta;&delta;&epsilon;&mu;ό&nu;&alpha;&sigmaf; &sigma;&omicron;&upsilon; &pi;&rho;έ&pi;&epsilon;&iota; &nu;&alpha; &nu;&alpha; &mu;&epsilon;ί&nu;&epsilon;&iota; &mu;&alpha;&zeta;ί &sigma;&omicron;&upsilon; &gamma;&iota;&alpha; ό&lambda;&eta; &tau;&eta; &delta;&iota;ά&rho;&kappa;&epsilon;&iota;&alpha;.</strong></p><p><strong>&Pi;&rho;&omicron;&alpha;&pi;&alpha;&iota;&tau;&omicron;ύ&mu;&epsilon;&nu;&alpha;</strong>: K&alpha;&lambda;ή &delta;&iota;ά&theta;&epsilon;&sigma;&eta;!</p><p><strong>&Tau;&iota; &pi;&rho;έ&pi;&epsilon;&iota; &nu;&alpha; έ&chi;&epsilon;&iota;&sigmaf; &mu;&alpha;&zeta;ί:</strong></p><ul><li><p>&Kappa;ά&pi;&omicron;&iota;&omicron; &sigma;ά&nu;&tau;&omicron;&upsilon;&iota;&tau;&sigmaf;</p></li><li><p>&Tau;&omicron; laptop &sigma;&omicron;&upsilon;</p></li></ul>', 'thessaloniki.gr@coderdojo.com', 'http://goo.gl/gu2pzV', 'null', 'http://goo.gl/gu2pzV', '15964259530', 'https://drive.google.com/file/d/0B-T1kfBC_T6hb0VsaFF0WlJpd1E/view?usp=sharing', 0, 'null', NULL, 0, 'null', 'EU', 'GR', 'GR