INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094049a0-e50f-11e4-8bc4-d4a2af868f3e', 811, 'Twin Falls, ID, @NeverLAN', '3739', '2014-05-07 17:31:47+03', '2014-05-09 10:35:01+03', '3006', 1, 0, 1, 'Every Tuesday, 3:30 - 5:00pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Twin Falls County"}', '{"toponymName":"Idaho"}', '{}', '{"name":"Twin Falls","geonameId":"5610810"}', 'Twin Falls High School, Room S3, 1615 Filer Ave. E, Twin Falls, ID  83301', '42.57253152713234,-114.45112468280331', '<p>We meet in the NeverLAN Hacker Space at Twin Falls High School. &nbsp;Go to room S3 to access the Hacker Space. &nbsp;Below is a list of things you to know about our CoderDojo</p><ul><li>We are open, during the school year, every Tuesday from 3:30pm - 5:00pm. Summer events will be annouced on the Google+ Community page.&nbsp;</li><li>Normal Tuesday events are on a walkin basis. &nbsp;If no one shows, we go home, anyone shows, we will create a super plan and work with you to become a full fledged coder!&nbsp;</li><li>The CoderDojo is open to all school-aged kids in the community. &nbsp;You absolutely do not have to be a Twin Falls High School student to join us.</li><li>We have computers you can use, but you can bring a&nbsp;laptop if you would like.</li><li>If you have food or drinks you will need to leave them on the center table. &nbsp;For the safety of the equipment do not eat or drink liquids at the computers.</li><li><strong>If you are 12 or under you MUST bring a parent, your parent must stay with you during the session.</strong></li></ul>', 'neverlan@tfhsbruins.com', 'http://neverlan.tfhsbruins.com', 'null', 'https://plus.google.com/communities/100187679719424039868', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'ID', 'Idaho', '', '', '', '', '', '', '5610810', 'Twin Falls');
