INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094058fe-e50f-11e4-8bc4-d4a2af868f3e', 840, 'Dumbravita', '1813', '2014-06-09 15:37:10+03', '2014-08-05 10:10:29+03', '3006', 1, 1, 2, 'in fiecare sambata, intre 11 si 13 // every Saturday, 10 AM - 1 PM', '{"countryName":"Romania","geonameId":"798549","alpha2":"RO"}', '{}', '{"toponymName":"Timiş"}', '{}', '{"name":"Dumbrăviţa","geonameId":"678688"}', 'Cantina Scolii Generale Dumbravita, Timis (in curtea Primariei)', '45.80118045845987,21.249188828468277', '<p>&nbsp;</p><ul><li>un sandwich sau un fruct</li><li>un laptop. la unul imprumut, la nevoie</li><li><strong>un parinte</strong></li><li><p>Inregistrati prezenta copiilor urmand acest link:&nbsp;<strong>​</strong>http://bit.ly/1ovyc3m</p></li><li>&nbsp;</li><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent!&nbsp;</strong></li><li>Please register following this link:<strong>&nbsp;</strong><strong>​</strong>http://bit.ly/1ovyc3m</li></ul>', 'dumbravita@coderdojo.ro', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'RO', 'ROU', NULL, NULL, 642, 'Romania', '36', 'Timiş', '', '', '', '', '', '', '678688', 'Dumbrăviţa');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09405acc-e50f-11e4-8bc4-d4a2af868f3e', 843, 'Leon', '3893', '2014-06-10 15:45:37+03', '2014-06-23 13:57:23+03', '3006', 1, 1, 2, 'Viernes 18-20h', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Leon"}', '{"toponymName":"Castille and León"}', '{"toponymName":"Santovenia de la Valdoncina"}', '{"name":"Ribaseca","geonameId":"3111814"}', 'Varios lugares, mira en nuestra web.', '42.54279495546807,-5.586188983917282', '<ul><li>Es un club de programadores, ni un taller, ni un curso...queremos crear una comunidad de ni&ntilde;os, y que entiendan por que es importante colaborar.</li><li>Los eventos de CoderDojo Leon seran itinerantes, tratando de implicar a varios lugares en la ciudad de Leon.</li><li>Trata de llevar tu propio portatil. Tener un entorno de trabajo controlado es la mejor manera de codificar. Si no puedes acceder a uno, comentanoslo y trataremos de solucionarlo.</li><li>Debes venir acompa&ntilde;ado de un adulto si eres menor de 12 a&ntilde;os. En ni&ntilde;os mayores ser&aacute; necesaria una autorizaci&oacute;n para permanecer durante lo que dure el evento.</li><li>Todos los eventos ser&aacute;n publicados a traves de nuestra pagina web.</li></ul>', 'coderdojoleon@gmail.com', 'http://coderdojoleon.wordpress.com', 'coderdojoleon', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'ES', 'ESP', NULL, NULL, 724, 'Spain, Kingdom of', '55', 'Castille and León', '', '', '', '', '', '', '3111814', 'Ribaseca');
