INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094064e7-e50f-11e4-8bc4-d4a2af868f3e', 861, 'Potsdam, Germany', '3927', '2014-06-25 13:40:50+03', '2014-07-24 09:33:29+03', '12', 1, 1, 2, 'Samstag, 14.März 14:00-17:00Uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Brandenburg"}', '{}', '{"name":"Steinstücken","geonameId":"2827649"}', 'Hasso-Plattner-Institut, 2-3 Prof.-Dr.-Helmert-Straße, 14482 Potsdam', '52.39410443352072,13.13326619681402', '<h2>Anmeldung</h2><ul><li><a href="http://www.eventbrite.de/e/coder-dojo-potsdam-14-marz-tickets-15667317368">14. M&auml;rz</a></li><li><a href="https://www.eventbrite.de/e/coder-dojo-potsdam-28-marz-tickets-15667562100">28. M&auml;rz</a></li></ul><p>Bitte sag uns vorher Bescheid, ob du kommst. Das Dojo findet ca. alle zwei Wochen statt, auch wenn die Termine noch nicht hier stehen.</p><h2>Deutsch</h2><p>CoderDojo ist ein Club f&uuml;r Kinder und Jugendliche im Alter von 5 bis 17 Jahren, die programmieren lernen und Spass haben wollen.&nbsp;Hier findest du mehr Informationen: <a href="http://coderdojo.com/about">http://coderdojo.com/about</a>.</p><p>Du kannst dich in den E-Mail-Verteiler f&uuml;r Neuigkeiten und Erinnerungen <a href="https://groups.google.com/forum/#!forum/coderdojopotsdam">eintragen</a> oder eine <a href="mailto:coderdojopotsdam@googlegroups.com?subject=Anmeldung&body=Hallo, 
