INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09407731-e50f-11e4-8bc4-d4a2af868f3e', 875, 'Pensacola, FL @ Brentwood', '4035', '2014-07-16 12:04:55+03', NULL, 'null', 0, 0, 0, 'Every Tuesday 2-4 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Wake County"}', '{"toponymName":"North Carolina"}', '{}', '{"name":"Brentwood","geonameId":"4457030"}', 'Brentwood Elementary School', '35.8298732,-78.596947', '<ul><li>A positive attitude</li><li>All parents are welcome to stay</li><li>This Dojo is for students that attend Brentwood Elementary School.&nbsp; Due to the days/hours of the Dojo, it isn&#39;t feasible for children not enrolled at Brentwood to attend.</li></ul>', 'BrentwoodCoders@gmail.com', 'http://bems-ecsd-fl.schoolloop.com/coderdojo', 'brentwood_elem', 'null', 'null', 'http://bems-ecsd-fl.schoolloop.com/uimg/image/1289140560563/1289140583901/1303568526538_wnp450.jpg', 0, 'null', NULL, 1, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'NC', 'North Carolina', '', '', '', '', '', '', '4457030', 'Brentwood');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094077c3-e50f-11e4-8bc4-d4a2af868f3e', 876, 'Köthen', '4038', '2014-07-17 11:38:50+03', NULL, 'null', 0, 1, 0, 'Freitag, 01.08.2014, 17 - 20 Uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Saxony-Anhalt"}', '{}', '{"name":"Großwülknitz","geonameId":"2914819"}', 'Sportlerheim Großwülknitz', '51.721975, 11.928057', '<p><strong>Das erste K&ouml;thener CoderDojo findet am 1. August 2014 von 14 bis 17 Uhr im Sportlerheim Gro&szlig;w&uuml;lknitz statt.</strong></p><ul><li><p>CoderDojo ist ein Club f&uuml;r Kinder und Jugendliche im Alter von 8 bis 17 Jahren, die sich f&uuml;r das Programmieren von Computern interessieren.</p></li><li><p>Sowohl Teilnehmer mit als auch ohne Vorkenntnisse sind willkommen. Hier findest du mehr Informationen: <a href="http://coderdojo.com/about">http://coderdojo.com/about</a></p></li><li><p>Die Teilnahme ist kostenlos, eine vorherige Anmeldung ist jedoch erforderlich. Wir k&ouml;nnen f&uuml;r eine begrenzte Zahl von Teilnehmern Rechner zur Verf&uuml;gung stellen, alle anderen arbeiten auf eigenen mitgebrachten Laptops - notwendige Software halten wir zur Installation bereit.</p></li><li><p>Schicke eine Email an <a href="mailto:coderdojo@wiesenfeld.org?subject=CoderDojo">coderdojo@wiesenfeld.org</a> und wir setzen dich auf den Verteiler f&uuml;r Erinnerungen und Neuigkeiten.</p></li></ul><p>&nbsp;</p><p><strong>Wenn du 12 Jahre alt oder j&uuml;nger bist, mu&szlig; eine Aufsichtsperson die ganze Zeit &uuml;ber dabei sein.</strong></p>', 'coderdojo@wiesenfeld.org', 'null', 'null', 'null', 'null', 'null', 1, '4038', '2014-08-29 18:27:24+03', 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '14', 'Saxony-Anhalt', '', '', '', '', '', '', '2914819', 'Großwülknitz');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09407a95-e50f-11e4-8bc4-d4a2af868f3e', 882, 'Nashville, TN', '3992', '2014-07-23 19:47:38+03', '2014-07-29 09:03:06+03', '3006', 1, 0, 2, 'Every Saturday 1pm-3pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Davidson County"}', '{"toponymName":"Tennessee"}', '{}', '{"name":"Nashville","geonameId":"4644585"}', 'Nashville Public Library, 615 Church Street, Nashville, TN 37219', '36.1622885,-86.7819452', '<p>&nbsp;</p><ul><li>We have computers to use, but you are encouraged to bring your own laptop.&nbsp;</li><li>Parents are encouraged to participate.</li></ul><p>Our upcoming schedule looks like:&nbsp;</p><p>9/6 - Nashville Park Locator App - Publish &amp; Share on GitHub</p><p>9/13 - <a href="http://nashvillemakerfaire.com/">MakerFair</a> - No Class - Field Trip&nbsp;</p><p>9/20 - No Class</p><p>9/27 - Nash Micro - <a href="http://ianlee74.github.io/LumineaterBot/assembly.html">Lumineater Bot</a>&nbsp;- It is very important that you register through EventBrite if you plan to attend this session. We will only have kits for members who have registered through EventBrite.</p><p>October... Soldering Projects, Word Guessing Game, ....</p>', 'lauren@plumflowersoftware.com', 'http://www.nashvillecoderdojo.com/', 'coderdojo615', 'null', '12871634405', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'TN', 'Tennessee', '', '', '', '', '', '', '4644585', 'Nashville');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09439079-e50f-11e4-8bc4-d4a2af868f3e', 959, 'Nagoya @ Hackerspace Nagoya', '4274', '2014-09-20 09:53:15+03', '2014-10-20 15:09:45+03', '4124', 1, 0, 1, 'Once in a month, Saturday or Sunday 2pm-3pm', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{}', '{"toponymName":"Aichi"}', '{}', '{"name":"Minami-sotoborichō","geonameId":"1857133"}', '愛知県名古屋市中区錦1丁目15-8 HackerSpace Nagoya / HackerSpace Nagoya 15-8, Nishiki 1, Naka-ku, Nagoya, Aichi', '35.1689254,136.89245219999998', '<p>ノートパソコン又はiPadを持参してください。（ノートPCを持ってくる場合はマウスもあると操作しやすいです）<br />小学生のお子さんは保護者の方と一緒に参加をお願いします。</p><p>今後の開催予定は <a href="http://coderdojo-nagoya.doorkeeper.jp/">http://coderdojo-nagoya.doorkeeper.jp/</a> をチェックしてください。人数の事前把握のため、参加するお子さんはできる限り申し込みをお願いします。</p><p>&nbsp;</p><p>Requirements:<br />* Laptop with Scratch1.4 or internet access(Scratch2.0). iPad with pyonkee is also fine.<br />* Children under 12 must be accompanied by their parent(s).</p><p>Dates will be announced at <a href="http://coderdojo-nagoya.doorkeeper.jp/">http://coderdojo-nagoya.doorkeeper.jp/</a> .If possible, please register in advance.</p><p>&nbsp;</p><p>&nbsp;</p>', 'coderdojo.nagoya@gmail.com', 'http://coderdojo-nagoya.github.io', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'JP', 'JPN', NULL, NULL, 392, 'Japan', '00', NULL, '', NULL, '', NULL, '', NULL, '1857133', 'Minami-sotoborichō');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940ab3e-e50f-11e4-8bc4-d4a2af868f3e', 895, 'hamburg @ lug-hh', '4074', '2014-08-05 06:42:28+03', '2014-08-05 11:03:41+03', '3006', 1, 1, 0, 'Jeden Montag, 20 - 22.30 uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Hamburg"}', '{}', '{"name":"Barmbek-Nord","geonameId":"7932342"}', 'LUG-Balista Hamburg e.V.  c/o Bürgerhaus in Barmbek Lorichsstr. 28a 22307 Hamburg', '53.6017999,10.044189200000005', '<p><strong>FINDET NICHT STATT</strong></p><p>Hallo, lieber Besucher!</p><p>Sch&ouml;n, dass du Interesse hast am CoderDojo teilzunehmen.</p><p>Was genau ist eigentlich CoderDojo?[0]</p><p>CoderDojo ist ein internationaler und lose organisierter Verein von ehrenamtlichen Helfer/innen, die Kindern von 5 bis 17 Jahren einen Raum bieten, um sich zu treffen und mit ganz viel Spa&szlig; Programmieren zu lernen. Was genau sie lernen und wie oft sie sich treffen, liegt dabei ganz im Ermessen der Ehrenamtlichen vor Ort.</p><p>Hier eine kurze Erkl&auml;rung, was dich erwartet.</p><p>Wenn du 12 Jahre alt oder j&uuml;nger bist, muss ein Erwachsener die ganze Zeit &uuml;ber dabei sein.</p><p>Der CoderDojo geht drei Stunden mit selbst&auml;ndigen Pausen.</p><p>Bitte bringe mit einen Laptop, mit dem du hier und zu Hause arbeiten kannst. Das Betriebssystem ist dir &uuml;berlassen. F&uuml;r die Scratch[1] Programmierung gibt es die Software, du kannst es auch erst im Browser[2] nutzen. Eine deutsche Wiki Seite[3] findest du hier.</p><p>Tutorials / &Uuml;bungen :[4]</p><p>HTML Tutorials</p><p>Scratch Tutorials</p><p>MINECRAFT Tutorials</p><p>Collective Resources</p><p>Web Servers Tutorials</p><p>[0] http://kleinerdrei.org/2013/11/coderdojo-berlin-ist-da-der-programmier-club-fur-kids-fand-erstmals-in-berlin-statt/</p><p>[1] http://scratch.mit.edu/</p><p>[2] http://scratch.mit.edu/projects/editor/?tip_bar=getStarted</p><p>[3] http://scratch-dach.info/wiki/Hauptseite</p><p>[4] http://kata.coderdojo.com/wiki/Tutorials</p>', 'hamburg.de@coderdojo.com', 'null', 'coderdojoathh', 'null', '12443630233', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '04', 'Hamburg', '', '', '', '', '', '', '7932342', 'Barmbek-Nord');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940af89-e50f-11e4-8bc4-d4a2af868f3e', 906, 'Stockport @ Startpoint', '4029', '2014-08-12 12:50:02+03', '2014-08-13 13:13:07+03', '4124', 1, 1, 2, 'Third Sunday of each month 11am - 3pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Stockport"}', '{"toponymName":"England"}', '{}', '{"name":"Woodley","geonameId":"2633632"}', 'Startpoint Coffee Shop, 4 Woodley Precinct, Woodley, Stockport, SK6 1RJ', '53.4261711,-2.1012106000000585', '<ul><li>Money if you would like to buy some lunch at the coffee shop.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'stockportcoderdojo@gmail.com', 'http://stockportdojo.org.uk', 'stockportdojo', 'null', '15774519011', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2633632', 'Woodley');
