'12', 'Kildare', '', '', '', '', '3315434', 'Easton');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940be5e-e50f-11e4-8bc4-d4a2af868f3e', 916, 'To be Deleted -# Brisbane Brisbane - Carindale Library', '4153', '2014-08-21 06:24:33+03', NULL, 'null', 0, 1, 3, 'Every Saturday from 18th October 2014 - 22nd November 2014, 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Carindale","geonameId":"7281839"}', 'Carindale Library, 1151 Creek Rd, Carindale QLD 4152', '-27.5033262,153.10151740000003', '<p><strong>CoderDojo Brisbane kicks off Term 4 at Carindale Library!</strong></p><p><strong>Registration for this event includes all sessions from Saturday 18th October until Saturday 22nd November (inclusive) from 12.30 - 2.30pm.&nbsp;</strong></p><p>Kids aged 7 - 17 will be exposed to programming tools such as Scratch and HTML, and can then create their own projects to work on with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop</li><li>snack or lunch</li><li><strong>Please Note: a parent is to supervise if a participant is aged under 15 years</strong></li></ul><p>​<strong><strong>For more information, visit the&nbsp;<a href="http://coderdojobrisbane.com.au/get-involved/participants/">CoderDojo Brisbane website.</a></strong></strong></p><p>&nbsp;</p>', 'info@coderdojobrisbane.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', 'null', '11578189677', 'null', 1, '4124', '2014-09-26 14:54:29+03', 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '7281839', 'Carindale');
