INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094384bf-e50f-11e4-8bc4-d4a2af868f3e', 938, 'Casarsa della Delizia, Pordenone', '4221', '2014-09-04 09:42:43+03', '2014-09-04 13:06:12+03', '4124', 1, 0, 0, 'Saturday, 2:30pm - 6pm - The timetable will be published here: coderdojofvg.it/i-dojo/coderdojo-casa', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Pordenone"}', '{"toponymName":"Friuli Venezia Giulia"}', '{"toponymName":"Casarsa della Delizia"}', '{"name":"Casarsa della Delizia","geonameId":"3180045"}', 'Casarsa della Delizia, 33072, Pordenone, via Stazione 2. Palazzo &quot;De Lorenzi - Brinis&quot;, sede del Progetto Giovani', '45.953555,12.839172', '<p>Per partecipare al Dojo &egrave; necessario:</p><p>- Un computer portatile (dove &egrave; consigliato avere gi&agrave; installato Scratch)</p><p>- La merenda</p><p>- Almeno uno dei genitori, che dovranno restare nel luogo dell&#39;evento per tutta la durata dell&#39;incontro.</p><p>La registrazione al Dojo avviene online tramite Eventbrite. Tutte le informazioni a riguardo verranno pubblicate di volta in volta nel nostro sito (www.coderdojofvg.it)</p><p>Puoi richiedere maggiori info a questo indirizzo: casarsa@coderdojofvg.it</p><p>Be Cool!</p>', 'casarsa@coderdojofvg.it', 'http://www.coderdojofvg.it', 'CDojoCasarsa', 'null', '114969128573', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '06', 'Friuli Venezia Giulia', '', '', '', '', '', '', '3180045', 'Casarsa della Delizia');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094385f3-e50f-11e4-8bc4-d4a2af868f3e', 940, 'Hobart Tasmania @HobHackerspace', '4255', '2014-09-07 10:24:41+03', '2014-09-10 08:22:21+03', '4124', 1, 0, 1, 'One Saturday a month 1.30pm-3.00pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Hobart"}', '{"toponymName":"Tasmania"}', '{}', '{"name":"Moonah","geonameId":"2157090"}', 'Hackerspace at 2 St Johns Avenue New Town 7008 Hobart', '-42.853241,147.29952400000002', '<ul><li>All parents are asked to register their children please, age 7-17 for the Hobart Coder Dojo event next Saturday as numbers are limited, thanks<br /><a target="_blank" href="https://www.eventbrite.com.au/e/coder-dojo-tickets-12947388989">https://www.eventbrite.com.au/e/coder-dojo-tickets-12947388989</a></li><li>A snack and drink bottle.&nbsp;</li><li>A laptop. Borrow one from someone if needs be. Download Scratch software.&nbsp;<a target="_blank" href="http://scratch.mit.edu/scratch2download/">http://scratch.mit.edu/scratch2download/</a>&nbsp;</li><li>Make sure you know your Scratch login details please.&nbsp;</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session. This is a peer to peer social learning model where children and adults learn alongside and from each other.&nbsp;</strong></li></ul>', 'coderdojo@hobarthackerspace.org.au', 'http://hobarthackerspace.com/node/27', 'HobHackerspace', 'null', '12947388989', 'http://hobarthackerspace.com/', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '06', 'Tasmania', '', '', '', '', '', '', '2157090', 'Moonah');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09438857-e50f-11e4-8bc4-d4a2af868f3e', 944, 'Donabate, Dublin', '4010', '2014-09-11 12:32:02+03', '2014-09-15 15:46:11+03', '4124', 1, 0, 2, 'Every second Saturday 2pm-4pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Ballisk","geonameId":"2966693"}', 'Donabate/Portrane Community Centre', '53.489662517243346,-6.142697499475162', '<ul><li>A snack and a drink, preferrably water and not fizzy sugarry drinks.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>This location is temporary and a more permanent location is under negotiations currently.</li><li>Events will take place every second Saturday. Each event subsequent to this first one&nbsp;will be listed on <a href="http://www.eventbrite.com">www.eventbrite.com</a> the Tuesday beforehand. This will be notified via our Twitter feed so get following.</li><li>A basic group will cover Scratch projects while advanced will work on Python.</li></ul>', 'team@donabatedojo.com', 'http://www.donabatedojo.com', 'donabatedojo', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', 'Leinster', '07', '', '', '', '', '', '2966693', 'Ballisk');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093be081-e50f-11e4-8bc4-d4a2af868f3e', 34, 'Athlone', '20', '2012-03-07 22:13:25+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 2, 'Saturdays 12 noon - 3pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Creggan","geonameId":"3313477"}', 'Athlone Institute of Technology, Engineering building', '53.41946909075532,-7.906959056854248', '<p> <b>What you need to bring:</b> <li>A pack lunch. <li>A fully charged laptop. <li>Laptop power supply. <li>A parent! (Very important if you are under 13). </p> <p> <b>How to Join:</b> Click <a href="https://docs.google.com/spreadsheet/viewform?formkey=dERaTUFVTy1iMVM3WEtKV3pOQWZnVnc6MA#gid=1" target="_blank">here</a> to register for Coderdojo Athlone. You will receive a confirmation email and a parent permission slip. Please print this, ask your parent to sign it and bring it with you to your first session. Once registered you will receive an invitation by email to the next available Coderdojo Athlone session. </p> <p><b> New and Updates will be posted via Twitter and Googlegroups</b></p>', 'coderdojoathlone@gmail.com', 'null', 'coderdojoathlon', 'http://groups.google.com/group/coderdojoathlone', '6279683703', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '3313477', 'Creggan');
