INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09456da1-e50f-11e4-8bc4-d4a2af868f3e', 1303, 'Vercelli', '5259', '2015-02-20 12:12:46+02', '2015-02-20 13:21:22+02', '21', 1, 0, 2, 'Saturday 28th March 2015, 15.00pm - 17.30pm (and then one time for month)', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Vercelli"}', '{"toponymName":"Piedmont"}', '{"toponymName":"Vercelli"}', '{"name":"Vercelli","geonameId":"3164565"}', 'Corso liberta, 72 13100 Vercelli', '45.3238698,8.420326899999964', '<ul><li>Portare la merenda per lo spuntino di met&agrave; pomeriggio</li><li>Portare un computer portatile</li><li><strong>Un genitore! Tutti i bambini devono essere accompagnati da un genitore che dovr&agrave; stare con loro per tutta la durata dell&#39;incontro.</strong></li></ul>', 'coderdojovercelli@gmail.com', 'http://coderdojovercelli.it/', 'coderdojovc', 'null', '16033637040', 'http://www.centroterritorialevolontariato.org/wp-content/uploads/2014/11/ctvdiamante_color.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '12', 'Piedmont', '', '', '', '', '', '', '3164565', 'Vercelli');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943b180-e50f-11e4-8bc4-d4a2af868f3e', 1010, 'Ballsbridge, Dublin @ Marian College', '4446', '2014-10-10 16:04:20+03', '2014-10-13 09:46:51+03', '4124', 1, 0, 2, 'Every Saturday 2.30pm - 4:30pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Ballsbridge","geonameId":"2966685"}', 'Marian College, Lansdowne Road, Ballsbridge, Dublin 4', '53.33308299999999,-6.226967', '<h2>CoderDojo Class in Marian College</h2><h3>Age Group 11-16</h3><h3>Required for all members</h3><p>All Parents must attend their first child&#39;s first class to sign the partental permission. Parents of under 12 must stay on the premises at all times. Please make sure to fill out the parental permission form available here. Print, sign and take it with you on your childs first visit. We will have some forms available on the day but it will save time and expense if you can print and bring them along.</p><p>Please be advised, places will be limited to ticket holders only: <strong>One Ticket Per Child</strong>. &nbsp;</p><p>Coderdojo is run completely by volunteers. If you can help in anyway please let us know.</p><p><em>*CoderDojo is FREE for kids, If a parent would like to become a mentor please get in touch, experience is not necessary! We&#39;d like to encourage the children to help &amp; work with each other. &nbsp;</em></p><p><strong>Marian College is located on Lansdowne Road, Ballsbridge, Dublin 4. Next to the Aviva Stadium.</strong></p><h3><br />What to Bring&nbsp;</h3><ul><li>All children must have their ticket and be accompanied by their parent/guardian who has a signed consent form.</li><li>If possible we are asking children to bring their own laptop so they may continue what they have learnt at home however we will have a number of PC&#39;s available.</li></ul>', 'mcc.dojo@gmail.com', 'https://sites.google.com/site/mccdojo/', 'mcc_Dojo', 'https://plus.google.com/118280598058435380042', '13526687687', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', NULL, '', NULL, '', NULL, '', NULL, '2966685', 'Ballsbridge');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943b45b-e50f-11e4-8bc4-d4a2af868f3e', 1015, 'Melvindale, Michigan', '4463', '2014-10-14 00:03:00+03', '2014-10-15 08:58:11+03', '4124', 1, 1, 1, 'On the second Wednesday of the month, 5-7pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Wayne County"}', '{"toponymName":"Michigan"}', '{}', '{"name":"Melvindale","geonameId":"5001634"}', 'Study &amp; Magazine Room at the Melvindale Public Library, 18650 Allen Road, Melvindale, MI 48122', '42.279412755502506,-83.189270780426', '<p>Participants should bring:</p><ul><li>A laptop. Borrow one from someone if need be.</li><li>A pair of headphones.</li><li>An email address.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>If you have issues with bringing any of the list, feel free to contact us about it.</p><p>There are a few laptops available for use, but they will go on a first-come, first-serve basis so bring one if you can!<br /><br />No registration is required. We will be using whatever space is available as regular visitors, so just show up and extend the one rule of &quot;Be cool!&quot; to other visitors of the library as well.</p>', 'melcoderdojo@gmx.com', 'http://melcoderdojo.com', 'MelCoderDojo', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', NULL, '', NULL, '', NULL, '', NULL, '5001634', 'Melvindale');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943b9f3-e50f-11e4-8bc4-d4a2af868f3e', 1025, 'Szentendre', '4497', '2014-10-20 11:53:45+03', '2014-10-21 08:59:19+03', '4124', 1, 0, 1, 'Saturdays, 10-12', '{"countryName":"Hungary","geonameId":"719819","alpha2":"HU"}', '{}', '{"toponymName":"Pest"}', '{}', '{"name":"Szentendre","geonameId":"3044681"}', 'Pest Megyei Könyvtár, 2000 Szentendre, Pátriárka u. 7.', '47.6694659,19.074827000000028', '<h3>Hogyan műk&ouml;dik?</h3><p>A szentendrei dojo hasonl&oacute;an műk&ouml;dik, mint egy szakk&ouml;r: Heti rendszeress&eacute;ggel tal&aacute;lkozunk. Minden alkalom egy vezetett foglalkoz&aacute;s, mely r&ouml;vid bevezetőből, &eacute;s sok gyakorlatb&oacute;l &aacute;ll. A gyakorlatok programoz&aacute;ssal &eacute;s weboldalak k&eacute;sz&iacute;t&eacute;s&eacute;vel kapcsolatosak. A foglalkoz&aacute;sok k&ouml;z&ouml;tti időben is tartjuk a kapcsolatot on-line f&oacute;rumok seg&iacute;ts&eacute;g&eacute;vel.</p><p>A foglalkoz&aacute;sokra regisztr&aacute;ci&oacute; nem sz&uuml;ks&eacute;ges!</p><h3>Mit kell hozni?</h3><p>J&oacute; lenne, ha mindenki tudna hozni saj&aacute;t laptopot &eacute;s Androidos telefont/tabletet, amin dolgozik majd. Korl&aacute;tozott sz&aacute;mban tudunk ugyan biztos&iacute;tani eszk&ouml;z&ouml;ket, de az nem lesz el&eacute;g mindenki sz&aacute;m&aacute;ra. R&aacute;ad&aacute;sul j&oacute; lenne, ha a foglalkoz&aacute;sok k&ouml;z&ouml;tti időben, otthon is tudn&aacute;tok dolgozni valamin, ehhez pedig mindenk&eacute;ppen saj&aacute;t eszk&ouml;zre lesz sz&uuml;ks&eacute;g.</p>', 'kapcsolat@coderdojo.hu', 'http://szentendre.coderdojo.hu', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'HU', 'HUN', NULL, NULL, 348, 'Hungary, Republic of', '00', NULL, '', NULL, '', NULL, '', NULL, '3044681', 'Szentendre');
