lian Republic', '00', NULL, '', NULL, '', NULL, '', NULL, '8984881', 'Area Industriale');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943cd25-e50f-11e4-8bc4-d4a2af868f3e', 1061, 'Villari''s Martial Arts Center - Newington', '4618', '2014-11-09 20:29:39+02', NULL, 'null', 0, 0, 0, 'Mon 2pm - 9pm, Tue 12pm - 9pm, Wed 2pm - 9pm, Thu 12pm - 9pm, Fri 3pm - 8pm, Sat 9am - 2 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Hartford County"}', '{"toponymName":"Connecticut"}', '{}', '{"name":"Newington","geonameId":"4839497"}', '2303 Berlin Turnpike, Newington, CT 06111', '41.6885973,-72.70712850000001', '<div>Our Mission - To help every individual we teach, reach their personal goals, realize their full potential, and achieve Black Belt excellence.</div><div><div><strong>Description</strong></div><div>At Villari&#39;s of Newington, our professional martial arts instructors help develop self-confidence, self-esteem, and respect for students of all ages and abilities.&nbsp;<br /><br />Whether we&rsquo;re helping your child develop coordination and self-discipline or helping you manage your health and relieve stress, Villari&rsquo;s opens our arms to students of all skill levels! We use our Shaolin Kempo Karate system to incorporate mind, body, and spirit as we strengthen students.&nbsp;<br /><br />Villari&rsquo;s believes that effective self-defense requires not only good physical technique, but confidence as well. That&rsquo;s why we use positive reinforcement techniques and goal setting to help our students develop a strong self-image.&nbsp;<br /><br />Our classes are grouped based on age and ability with varied focuses at all levels. Students as young as three years old are taught coordination and discipline by professional martial arts instructors while adult group classes concentrate on physical fitness in a positive and fun atmosphere!<br /><br />Whatever your age or skill level, Villari&rsquo;s of Newington can help you master good health and confidence!</div></div><div><div><strong>General Information</strong></div>Villari&#39;s of Newington is a full time, professional Martial Arts school with over 20 years of service to the Newington area. We specialize in separate classes for all age groups and ability levels with an emphasis on self defense and character development through self discipline, respect and self control.</div>', 'NewingtonCt@VillariStudios.com', 'http://www.villaristudios.com/newington-ct/', 'Villaris_NCT', 'https://plus.google.com/u/0/b/102348510377939594484/+VillarisMartialArtsCenterNewington/about', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', 'Connecticut', '', '', '', '', '', '', '4839497', 'Newington');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943d109-e50f-11e4-8bc4-d4a2af868f3e', 1068, 'Carrick On Shannon, Co. Leitrim', '4646', '2014-11-12 14:56:09+02', '2014-11-14 11:38:24+02', '4124', 1, 0, 2, 'Every Saturday 2:30 pm 4:30 pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Connaught"}', '{}', '{"name":"Carrick on Shannon","geonameId":"2965727"}', 'The Hive -- Leitrim County Enterprise Fund, Dublin Road, Carrick on Shannon, Co. Leitrim', '53.946122, -8.075020', '<ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session. </strong></li><li>Places are limited and you need to register prior to the session.</li><li>Tickets will be available 5 days before the sessions. You will need to book a place prior the event.</li><li>To book your ticket go to &nbsp;<a href="http://www.eventbrite.ie/o/carrick-on-shannon-coderdojo-7680093949">http://carrickonshannondojo.eventbrite.ie</a></li></ul>', 'carrickonshannondojo@gmail.com', 'http://www.carrickdojo.com/', 'CarrickDojo', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', 'Connaught', '', '', '', '', '', '', '2965727', 'Carrick on Shannon');
