INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943d1f9-e50f-11e4-8bc4-d4a2af868f3e', 1070, 'Santa Monica @ The Learning Path', '4657', '2014-11-13 19:12:16+02', NULL, 'null', 0, 0, 2, 'Every Wednesday 5:00PM-6:30 PM', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Los Angeles County"}', '{"toponymName":"California"}', '{}', '{"name":"Santa Monica","geonameId":"5393212"}', 'The Learning Path - 1212 5th St., Suite 100, Santa Monica, CA. 90401', '34.0193269,-118.497229', '<p>We need help with the following:</p><ul><li>Please bring a laptop if you can. It must be able to run Flash.</li><li>Students must register in advance by emailing us at info@thelearningpath.us . Currently this Dojo is limited to Learning Path students and their friends as space and resources are very limited. </li><li>You must be at least 8 years old. </li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'sm@thelearningpath.us', 'http://www.thelearningpath.us', 'null', 'http://www.thelearningpath.us/learn-code-coderdojo-santa-monica/', 'null', 'http://www.thelearningpath.us/wp-content/themes/LP/images/logo_the_learning_path.png', 0, 'null', NULL, 1, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', 'California', '', '', '', '', '', '', '5393212', 'Santa Monica');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943d60c-e50f-11e4-8bc4-d4a2af868f3e', 1079, 'Peebles, Scotland', '689', '2014-11-19 19:30:47+02', '2014-11-20 11:58:40+02', '4124', 1, 0, 2, 'Every Monday 6-8pm (from January 12th, 2015)', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Scottish Borders"}', '{"toponymName":"Scotland"}', '{}', '{"name":"Peebles","geonameId":"2640526"}', 'Peebles high school', '55.64529580000001,-3.1927584000000024', '<ul><li>Coming along? Please register <a href="http://www.eventbrite.com/o/coderdojo-peebles-7749552781">here</a>.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p><strong>NOTE: Peebles Hydro is closed for refurbishment until April 2015. CoderDojo will run at the usual time at Peebles High School in CDT1 on March 9, 16, 23 &amp; 30</strong></p>', 'coderdojo@claysnow.co.uk', 'null', 'PeeblesCoder', 'https://groups.google.com/group/coderdojo-peebles', '15370632977', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', '00', 'Scotland', '', '', '', '', '', '', '2640526', 'Peebles');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943d849-e50f-11e4-8bc4-d4a2af868f3e', 1083, 'Policoro', '4701', '2014-11-22 15:26:15+02', '2014-11-26 12:26:25+02', '4124', 1, 0, 2, 'Second Friday of the month 18pm-20pm', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Matera"}', '{"toponymName":"Basilicate"}', '{"toponymName":"Policoro"}', '{"name":"Policoro","geonameId":"3170384"}', 'Policoro, Piazza Eraclea 1, 75025', '40.21159471133429,16.677055417118822', '<div>Porta con te...</div><ul><li>notebook con scratch2 preinstallato...</li><li>una merenda...</li><li>la liberatoria per la privacy (importante) firmata dal tutore...</li></ul><div>Visita&nbsp;<a href="http://scratch.mit.edu/scratch2download">http://scratch.mit.edu/scratch2download</a>&nbsp;e scarica ed installa 1 e 2 (Adobe Air e Scratch Editor Offline)</div><div>&nbsp;</div><div>Per info Visita la pagina&nbsp;<a target="_blank" href="https://www.facebook.com/groups/377644482411015/?fref=ts">CoderDojo Policoro</a> o contattaci via <a href="mailto:coderdojopolicoro@gmail.com?subject=Info">Mail</a>&nbsp;</div><div>&nbsp;</div><p>&nbsp;</p>', 'coderdojopolicoro@gmail.com', 'null', 'CdrDjPoli', 'null', '14627133149', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '00', 'Basilicate', '', '', '', '', '', '', '3170384', 'Policoro');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943e78e-e50f-11e4-8bc4-d4a2af868f3e', 1091, 'Yverdon-les-Bains', '4730', '2014-11-28 14:29:09+02', '2014-12-09 14:26:39+02', '4124', 1, 0, 2, 'one Saturday per month from 10:00 am to 12:00 am (March to June).', '{"countryName":"Switzerland","geonameId":"2658434","alpha2":"CH"}', '{"toponymName":"Jura-Nord vaudois District"}', '{"toponymName":"Vaud"}', '{"toponymName":"Yverdon-les-Bains"}', '{"name":"Yverdon-les-Bains","geonameId":"2657941"}', 'HEIG-VD, Avenue des Sports 20, 1401 Yverdon-les-Bains', '46.78106820273549,6.647326286816451', '<p>Nous organisons de mars &agrave; juin 2015 des ateliers <strong>ludiques </strong>et <strong>gratuits</strong> pour les jeunes :</p><ul><li>Cr&eacute;ation de minis-jeux ou d&#39;histoires anim&eacute;es avec Scratch</li><li>R&eacute;alisation d&#39;un site internet basique en HTML et CSS</li><li>Programmation d&#39;un robot</li><li>Et bien plus encore !</li></ul><p>Le jour de l&#39;atelier n&#39;oublie pas de venir avec :</p><p>- Un ordinateur portable (laptop) (Nous en pr&eacute;tons si n&eacute;cessaire)</p><p>- Un snack et boisson pour la pause</p><p>- Un accompagnant si tu as moins de 10 ans</p><p><strong>Dates :&nbsp; 21 mars 2015, 25 avril 2015, 23 mai 2015</strong></p><p><strong>Informations et inscriptions sur : http://codeclub.heig-vd.ch/</strong></p>', 'yverdonlesbains.ch@coderdojo.com', 'http://codeclub.heig-vd.ch/', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'CH', 'CHE', NULL, NULL, 756, 'Switzerland, Swiss Confederation', '00', 'Vaud', '', '', '', '', '', '', '2657941', 'Yverdon-les-Bains');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943eeb4-e50f-11e4-8bc4-d4a2af868f3e', 1099, 'Antwerpen-Centrum', '4750', '2014-12-02 10:26:06+02', '2014-12-05 11:54:54+02', '4124', 1, 0, 0, 'Every second Saturday of the month, 10am - 1pm', '{"countryName":"Belgium","geonameId":"2802361","alpha2":"BE"}', '{"toponymName":"Antwerp Province"}', '{"toponymName":"Flanders"}', '{}', '{"name":"Antwerp","geonameId":"2803138"}', 'Lange Klarenstraat 19, Antwerpen', '51.2190249,4.408337899999992', '<p>We are a bunch of enthousiast exploring the following:</p><ul><li>Robomind</li><li>Scratch, lots of Scratch!</li><li>Arduino</li><li>Making our own web page</li><li>Unity 3D game engine (not for the faint of heart!)</li></ul><p>We have limited capacity, please be sure to subscribe if you want to join. If you&#39;re under 12, we ask that a parent brings you and collects you again. They can shop in Antwerp or they can stay if they want, but only if they&#39;re really really quiet :-)</p><p>&nbsp;</p>', 'antwerpen@coderdojobelgium.be', 'http://coderdojobelgium.be', 'null', 'http://antwerpen@coderdojobelgium.be', '11851914395', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'BE', 'BEL', NULL, NULL, 56, 'Belgium, Kingdom of', '00', 'Flanders', '', '', '', '', '', '', '2803138', 'Antwerp');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943f0a0-e50f-11e4-8bc4-d4a2af868f3e', 1104, 'Ballyvaughan, Clare @Burren College of Art', '4766', '2014-12-03 10:35:10+02', '2014-12-04 15:01:28+02', '4124', 1, 0, 1, 'Every second Saturdays, 5pm - 6.30pm, starting 6th of December 2014', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Ballyvaghan","geonameId":"2966396"}', 'Burren College of Art, Newtown Castle, Ballyvaughan', '53.10352520575581,-9.169690071316495', '<ul><li>Bring some fun.</li><li>Snacks would be good.</li><li>We have some computers, but if you have a laptop, please bring it along. It will enjoy the dojo too!</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'ballyvaughan.coderdojo@gmail.com', 'null', 'null', 'https://groups.google.com/forum/#!forum/ballyvaughan-coder-dojo', '13899221947', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', 'Munster', '', '', '', '', '', '', '2966396', 'Ballyvaghan');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943f466-e50f-11e4-8bc4-d4a2af868f3e', 1111, 'Dublin 18 @ Rosemont School (CoderDojoRosemont)', '4785', '2014-12-05 14:56:08+02', '2014-12-05 17:06:39+02', '4124', 1, 0, 3, 'Saturdays 11am - 1pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Stepaside","geonameId":"2961364"}', 'Rosemont School, Enniskerry Road, Sandyford, D18', '53.26094896457079,-6.226759941162072', '<p>At Dojos, young people learn a super power.&nbsp; They learn how to code, develop websites, apps, programs, games and more.</p><p><strong>At our first Dojo we are working with SCRATCH v1.4</strong></p><p>&nbsp;</p><p><strong>Registering: (sorry our current sessions are full)</strong></p><p>We need to issue tickets as currently we can only accommodate 20 young people. &nbsp;So please ensure each person who wants to participate is registered through the booking system at Eventbrite (see our Facebook page or the Eventbrite link below)</p><p>&nbsp;</p><p><strong>What to bring:</strong></p><p>Sessions run from 11am - 1pm, so young people should bring:</p><ul><li>A laptop for each participant with SCRATCH v1.4 running on it.</li><li>A small snack - we take a short break in the middle of the 2 hour session.</li></ul><p>For those 12 or under, you also need to bring:</p><ul><li>A parent or guardian! (Very important) who <em>must stay</em> with you during the session.</li></ul><p>&nbsp;</p><p><strong>CoderDojoRosemont is open to:</strong></p><p>We are open to the public, for young people between the ages of 10 and 17.</p><p>&nbsp;</p>', 'coderdojorosemont@gmail.com', 'http://CoderDojoRosemont.com', 'CoderD_Rosemont', 'null', '14802854737', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', 'Leinster', '', '', '', '', '', '', '2961364', 'Stepaside');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cbac7-e50f-11e4-8bc4-d4a2af868f3e', 364, 'UT Highland', '1701', '2013-05-15 03:50:49+03', '2013-12-01 14:25:27+02', '3006', 1, 1, 4, 'Every Tuesday 7-9pm - First mtg Jun 4', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Utah County"}', '{"toponymName":"Utah"}', '{}', '{"name":"Alpine","geonameId":"5770732"}', '5886 Timber Ridge Ln, Highland', '40.460856,-111.79957200000001', '<p>The Highland Utah dojo has been meeting since June of 2013. During the summer months we have upwards of 20 youth show up to code.</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'brent.groom@live.com', 'http://coderdojoutah.com', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', 'Utah', '', '', '', '', '', '', '5770732', 'Alpine');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cbb58-e50f-11e4-8bc4-d4a2af868f3e', 365, 'Torino', '1700', '2013-05-15 08:51:57+03', '2013-12-01 14:25:27+02', '3006', 1, 1, 4, 'Sabato 31 MArzo , 9am - 12pm', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Turin"}', '{"toponymName":"Piedmont"}', '{"toponymName":"Torino"}', '{"name":"Turin","geonameId":"3165524"}', 'Torino', '45.07098200000001,7.685676000000058', '<p>Cosa devono portarsi dietro i bambini:</p><ol><li><strong>Una merenda</strong>.</li><li><strong>Un computer portatile</strong>. Se non ce l&#39;hai fattene prestare uno oppure, se ci avvisi per tempo, te lo prestiamo noi.</li><li><strong>Un genitore</strong>. Un accompagnatore deve essere presente durante tutta la durata dell&#39;evento.</li></ol><p><br />Ti aspettiamo,Lo staff di Coderdojo Torino<br /><br /><strong>Siamo in Cerca di una sede!</strong></p>', 'coderdojoto@gmail.com', 'null', 'Coderdojotorino', 'https://groups.google.com/d/forum/coderdojo-torino', '7294836051', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '00', 'Piedmont', '', '', '', '', '', '', '3165524', 'Turin');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0945750c-e50f-11e4-8bc4-d4a2af868f3e', 1312, 'Rapid City CoderDojo', '5281', '2015-02-26 02:08:12+02', NULL, 'null', 0, 0, 0, 'Saturday 1:00pm - 3:00pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Pennington County"}', '{"toponymName":"South Dakota"}', '{}', '{"name":"Rapid City","geonameId":"5768233"}', 'Rapid City Library', '44.0783631,-103.2290499', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'null', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'SD', 'South Dakota', '', '', '', '', '', '', '5768233', 'Rapid City');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0944003a-e50f-11e4-8bc4-d4a2af868f3e', 1134, 'Rathmines, Dublin 6, @ St. Marys College', '4446', '2014-12-10 01:03:42+02', '2014-12-16 13:48:31+02', '4124', 1, 1, 2, 'Every Saturday, 2:30pm to 4:40pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Portobello","geonameId":"7870000"}', 'St. Marys College, Rathmines, Dublin 6.', '53.3275459,-6.266798999999992', '<p><em><strong>CoderDojo Club in St. Marys College</strong></em></p><p><em><strong>Age Group 11-16</strong></em></p><p><em><strong>Required for all members</strong></em></p><p>All Parents must attend their first child&#39;s first class to sign the parental permission. Parents of under 12 must stay on the premises at all times.&nbsp;Please make sure to fill out the parental permission form available&nbsp;<a href="https://docs.google.com/document/d/1ciBSadhRlVll82Bje7KE33y5VQuHs9ttw1iL0tN2_zI/edit?usp=sharing">here</a>.&nbsp;Print, sign and take it with you on your childs first visit. We will have some forms available on the day but it will save time and expense if you can print and bring them along.</p><p>Please be advised, places will be limited to ticket holders only:&nbsp;<strong>One Ticket Per Child.&nbsp;</strong></p><p><em><strong>Coderdojo is run completely by volunteers. If you can help in anyway please let us know.</strong></em></p><p>*CoderDojo is FREE for kids, If a parent would like to become a mentor please get in touch, experience is not necessary! Parents not mentoring are asked to entertain themselves while they wait, maybe bring a book. &nbsp;We&#39;d like to encourage the children to help &amp; work with each other.&nbsp;&nbsp;</p><p><em><strong>Directions</strong></em>&nbsp;St. Mary&#39;s College is located on Rathmines Road Lwr., Dublin 6.</p><p><em><strong>What to Bring</strong></em>&nbsp;<br />All children must have their ticket and be accompanied by their parent/gaurdian who has a signed consent form.<br />If possible we are asking children to bring their own laptop so they may continue what they have learnt at home however we will have a number of PC&#39;s available.</p>', 'info@smccdojo.com', 'http://www.smccdojo.com', 'null', 'null', '14832389075', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '00', '', '', '', '', '', '', '', '7870000', 'Portobello');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09440c78-e50f-11e4-8bc4-d4a2af868f3e', 1159, 'Rio Rancho, NM @Roboquerque Dojo', '4892', '2014-12-19 22:00:08+02', '2014-12-30 12:04:41+02', '3199', 1, 0, 1, '2nd &amp; 4th Thursdays; 5:30pm - 7:30pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Sandoval County"}', '{"toponymName":"New Mexico"}', '{}', '{"name":"Enchanted Hills","geonameId":"7839240"}', 'Mountain View Middle School, Rio Rancho, NM', '35.326442,-106.5870162', '<ul><li><h4><strong>OUR &quot;NEW&quot; &nbsp;FIRST OFFICIAL MEETING WILL BE THURSDAY FEB 12th (Hope for no more snow days LOL)</strong></h4></li><li>Imagination Required!</li><li>Open to all, RSVP appreciated at roboquerquedojo@gotoif.org</li><li>A small snack will be provided.</li><li>A laptop. email me if you need to RSVP to borrow a laptop (a limited number of laptops will be available to borrow).</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'roboquerquedojo@gotoif.org', 'http://www.roboquerque.org/coderdojo', 'null', 'null', '15456111646', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', 'New Mexico', '', '', '', '', '', '', '7839240', 'Enchanted Hills');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09440ed7-e50f-11e4-8bc4-d4a2af868f3e', 1163, 'Waltham @ Lumira', '4908', '2014-12-22 16:28:23+02', '2014-12-23 14:03:24+02', '3006', 1, 0, 2, 'February 10, 2015 3:30pm-5:30pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Middlesex County"}', '{"toponymName":"Massachusetts"}', '{}', '{"name":"Riverview","geonameId":"4948776"}', 'Old Watch Tower, 221 Crescent Street, Suite 502 Waltham, MA 02453', '42.3666583,-71.24347219999999', '<p>Did you ever want to learn how to make a video game? Build a website? Or create an app?</p><div>&nbsp;</div><div>Come join us for a Coderdojo, a fun interactive event where you learn to code in a relaxed environment with mentors...and it&rsquo;s just for kids! No previous coding experience is necessary. Suitable for kids ages 10-17.</div><div>&nbsp;</div><div>Parents are encouraged to attend or volunteer! Light snacks and refreshments will be provided</div><div>&nbsp;</div><div>When? February 10th 2015 3:30pm-5:30pm, <strong>This is a one time event</strong></div><div>Where: The Lumira Office located at the Waltham Watch Factory</div><div>221 Crescent Street, Suite 502</div><div>Waltham, MA 02453</div><div>*Parking is available in lot outside of building&nbsp;</div><div>&nbsp;</div><div>Contact:&nbsp;<a href="mailto:natalie.pietrzak@lumira.com">natalie.pietrzak@lumira.com</a>&nbsp;to sign up for the event or to learn about volunteering.</div><ul><li>A laptop is encouraged but not required, we are able to provide one if needed.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'nataliecoderdojo@gmail.com', 'https://www.eventbrite.com/e/coderdojo-for-kids-tickets-14945317848', 'null', 'null', '14945317848', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', 'Massachusetts', '', '', '', '', '', '', '4948776', 'Riverview');
