INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094439c1-e50f-11e4-8bc4-d4a2af868f3e', 1225, 'Southampton @ University of Southampton', '5095', '2015-01-27 13:42:16+02', '2015-02-18 14:11:52+02', '4124', 1, 1, 1, 'First Saturday of the month 3pm to 5pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Southampton"}', '{"toponymName":"England"}', '{}', '{"name":"Swaythling","geonameId":"2636406"}', 'University of Southampton, Southampton, SO17 1BJ', '50.935742,-1.3966381000000183', '<p>This CoderDojo is for under 11s and those who are just starting out with coding. We have a group for older students YRS that runs at the same time so there is something for every age group.&nbsp;</p><p>Please bring a laptop, some snacks and a lot of enthusiasm.&nbsp;</p><p>We love it when parents come along to help or to chaperone. The leader is CRB checked - but we would like to make sure that parents stay on site and leave a phone number so we can get in touch if needed.&nbsp;</p>', 'southamptoncoderdojo@gmail.com', 'http://blog.soton.ac.uk/rp2e12/coder-dojo-southampton/', '@sotoncoderdojo', 'https://groups.google.com/forum/#!forum/southampton-coder-dojo', '15795475693', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', '00', 'England', '', '', '', '', '', '', '2636406', 'Swaythling');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0944421f-e50f-11e4-8bc4-d4a2af868f3e', 1241, 'Milan South-West (CoderDojo MISO)', '5142', '2015-02-03 11:24:19+02', '2015-02-03 16:18:59+02', '4124', 1, 0, 0, 'one Saturday a month, 3pm - 6pm', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Milan"}', '{"toponymName":"Lombardy"}', '{"toponymName":"Buccinasco"}', '{"name":"Corsico","geonameId":"3178004"}', 'Via Fagnana, Buccinasco (Milano)', '45.4256154,9.123151000000007', '<p><font face="Helvetica"><strong><font size="3">Cascina Fagnana di Buccinasco</font></strong><font id="yiv9930014667yui_3_16_0_1_1423644299068_18669" size="3"> Via Fagnana ang. via Grancino</font></font></p><ul><li>Needs reservation</li><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li>Download Scratch software into your laptop</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>Follow Coderdojo MISO on Facebook.</p><p>&nbsp;</p><ul><li>Una merenda.</li><li>Un computer portatile &egrave; OBBLIGATORIO</li><li>Scarica il software Scratch nel tuo portatile</li><li><strong>Un genitore! Il tuo accompagnatore deve essere presente durante tutta la durata dell&#39;evento.</strong></li></ul><p>Segui&nbsp;Coderdojo MISO su Facebook.</p><p>&nbsp;</p>', 'CoderDojoMISO@GMAIL.COM', 'http://www.coderdojomiso.com', 'CoderDojoMISO', 'https://groups.google.com/d/forum/coderdojomiso', 'CoderDojo MiSO', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '00', 'Lombardy', '', '', '', '', '', '', '3178004', 'Corsico');
