INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094453d9-e50f-11e4-8bc4-d4a2af868f3e', 1253, 'Ocala, Florida @ Marion County Public Library', '5165', '2015-02-06 16:50:16+02', '2015-02-16 14:03:24+02', '4124', 1, 0, 0, 'Spring Session: Tuesdays March 10 - April 14. 3 p.m. - 4 p.m.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Marion County"}', '{"toponymName":"Florida"}', '{}', '{"name":"Twin Oaks Mobile Home Park","geonameId":"7192257"}', 'Marion County Public Library. 2720 E Silver Springs Blvd. Ocala FL 34470', '29.1873925,-82.09974160000001', '<p>CAUTION: Dear Parents - When you register, please only use your name for sign-up.&nbsp; We will know the seats you requested based on the number of tickets reserved by you.&nbsp; Please DO NOT&nbsp;write your&nbsp;child&#39;s name on this form.</p><p>The session will be hour-long, but not in a classroom format.&nbsp; Instead, the sessions will be more like jam-sessions.&nbsp;&nbsp;IT volunteers&nbsp;will use the &ldquo;Grandmother method&rdquo; instead of teaching a curriculum, by focusing on admiring the productive stuff the&nbsp;kids do and achieve. CoderDojo&#39;s philosophy is that admiration and acknowledgement are the key to inspiration and creation of a learning context that is positive.</p><div>IT volunteers will encourage kids to ask each other for assistance and to google for answers.</div><p>Here&#39;s a checklist for participation.&nbsp; All children must be accompanied by</p><ul><li>A print-out of the ticket</li><li>A username and password for MIT&#39;s Scratch Website (scratch.mit.edu).</li><li><strong>A parent! (Very important).&nbsp; Your parent must stay with you during the session.</strong></li></ul>', 'ocala.us@coderdojo.com', 'null', 'null', 'null', '15672516920', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '00', 'Florida', '', '', '', '', '', '', '7192257', 'Twin Oaks Mobile Home Park');
