INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094399ff-e50f-11e4-8bc4-d4a2af868f3e', 988, 'GippyDojoWarragul', '4364', '2014-09-24 11:45:53+03', NULL, 'null', 0, 1, 2, 'TBA', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Baw Baw"}', '{"toponymName":"Victoria"}', '{}', '{"name":"Warragul","geonameId":"2144604"}', 'Business Support Centre, 34 Mason Street, Warragul, Victoria', '-38.162336,145.93414699999994', '<ul><li>All parents are asked to register their children please, age 7-17 for the Gippy Coder Dojo events.</li><li>A snack and drink bottle.&nbsp;</li><li>A laptop. Borrow one from someone if need be. Download Scratch software.&nbsp;<a target="_blank" href="http://scratch.mit.edu/scratch2download/">http://scratch.mit.edu/scratch2download/</a>&nbsp;</li><li>Make sure you know your Scratch login details please.&nbsp;</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session. This is a peer to peer social learning model where children and adults learn alongside and from each other.</strong></li><li><strong>If you are aged 13 to 17 you will require your parent&#39;s written permission to attend. </strong></li></ul>', 'host@coworx.com.au', 'http://www.coworx.com.au', 'null', 'null', 'null', 'http://www.businesssupportcentre.com.au', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '07', NULL, '', NULL, '', NULL, '', NULL, '2144604', 'Warragul');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e376f-e50f-11e4-8bc4-d4a2af868f3e', 607, 'Faringdon', '2952', '2014-01-13 14:18:11+02', '2014-03-26 15:29:59+02', '3006', 1, 1, 2, 'Every Tuesday in term time, 6pm - 7pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Oxfordshire"}', '{"toponymName":"England"}', '{"toponymName":"Vale of White Horse District"}', '{"name":"Faringdon","geonameId":"2649686"}', '1st Floor, Pump House, Market Place, Faringdon SN7 7HL', '51.657891,-1.584738600000037', '<ul><li><strong>The CoderDojo is currently open to children in years 5 to 8 to start with</strong></li><li>We are starting with a maximum of 20 children. &nbsp;You will need to book a place by completing an application form. Contact faringdon.gb@coderdojo.com</li><li>If you have a laptop, please bring it but we have 5 Raspberry Pis and some laptops that you can use if you don&#39;t have a laptop.</li></ul><p>&nbsp;</p>', 'faringdon.gb@coderdojo.com', 'null', 'null', 'https://groups.google.com/forum/#!forum/faringdon-coderdojo', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', NULL, '', NULL, '', NULL, '', NULL, '2649686', 'Faringdon');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e2108-e50f-11e4-8bc4-d4a2af868f3e', 560, 'Brisbane - Sunnybank Hills', '2707', '2013-11-28 02:35:46+02', '2013-12-20 12:28:25+02', '3006', 1, 1, 0, 'Every Saturday from Saturday 7th February - Saturday 14th March, 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Sunnybank Hills","geonameId":"9957350"}', 'Sunnybank Hills Library, Sunnybank Hills Shoppingtown, Cnr Compton &amp; Calam Rds, Sunnybank Hills QLD 4109', '-27.61090053924059,153.0550950203766', '<p><strong>CoderDojo Brisbane kicks off Term&nbsp;1 2015&nbsp;at Sunnybank Hills Library!</strong></p><p><em><strong>Registration for this event includes all sessions from Saturday&nbsp;7th February till Saturday 14th March&nbsp;(inclusive) from 12.30 - 2.30pm.&nbsp;</strong></em></p><p>Kids aged 7 - 17 will be exposed to programming tools such as Scratch and HTML, and can then create their own projects to work on with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop</li><li>snack or lunch</li></ul><p><em><strong>Please Note: a parent is to supervise if a participant is aged under 15 years.</strong></em></p><div><strong>For more information, visit the&nbsp;<a href="http://coderdojobrisbane.com.au/get-involved/participants/">CoderDojo Brisbane website.</a></strong></div>', 'info@coderdo