INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09439d74-e50f-11e4-8bc4-d4a2af868f3e', 994, 'Blata l-Bajda, Malta@National Council of Women', '4382', '2014-09-29 09:49:19+03', '2014-10-16 13:50:23+03', '4124', 1, 0, 0, 'Every Monday , 4:00pm - 6:00pm', '{"countryName":"Malta","geonameId":"2562770","alpha2":"MT"}', '{}', '{"toponymName":"Il-Ħamrun"}', '{}', '{"name":"Gwardamanġa","geonameId":"2563018"}', 'National Council of Women, Pope Pius XII Flats, Mountbatten Street, Blata l-Bajda HMR 1579', '35.888508, 14.495865', '<p>Kids aged 7 - 17 will be exposed to programming tools such as basic Scratch and HTML, and can then create their own small projects &nbsp;with the assistance of volunteer mentors . The programme will last 12 sessions - one 2-hour session per week for 12 weeks. Available places are limited to 18. Participants may bring a snack if they they wish but no mess will be tolerated.&nbsp;</p><ul><li><strong>PCs are provided courtesy MCA , so no need for children to get their laptops</strong></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojomalta@mca.org.mt', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'MT', 'MLT', NULL, NULL, 470, 'Malta, Republic of', '41', NULL, '', NULL, '', NULL, '', NULL, '2563018', 'Gwardamanġa');
