png', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '07', NULL, '', NULL, '', NULL, '', NULL, '3179242', 'Cecchignola');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e4134-e50f-11e4-8bc4-d4a2af868f3e', 621, 'Wexford Town', '2997', '2014-01-19 10:16:35+02', '2014-01-20 10:53:57+02', '3006', 1, 1, 2, '2-4 Saturday', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{}', '{}', '{"name":"Wexford","geonameId":"2960964"}', 'CBS Primary School, Green St., Wexford', '52.3330552,-6.464658200000031', '<ul><li>BE COOL</li><li>You must have a ticket emailed to you before arrival! Join the mailing list and keep in the loop - copy and paste this link into your browser : <a href="http://bit.ly/KIfHJ5">http://bit.ly/KIfHJ5</a></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojowex@gmail.com', 'http://www.wexfordcoderdojo.com', 'coderdojowexfrd', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', NULL, '', NULL, '', NULL, '', NULL, '2960964', 'Wexford');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943bcb1-e50f-11e4-8bc4-d4a2af868f3e', 1031, 'Mosnita Noua', '4523', '2014-10-23 12:36:47+03', '2014-12-05 15:56:07+02', '4124', 1, 1, 1, 'Every Saturday, 10:00 AM -12:00 PM', '{"countryName":"Romania","geonameId":"798549","alpha2":"RO"}', '{}', '{"toponymName":"Timiş"}', '{}', '{"name":"Moşniţa Nouă","geonameId":"672809"}', 'Strada Școlii Moșnița Nouă 307285, Romania', '45.72056088, 21.32321566', '<p>Our local CoderDojo movement launched in 11 October 2014 with the help of &quot;Pro Mosnita&quot; - a local NGO association. We started-off with more than 50 kids and 10 mentors aiming for bringing computer science knowledge to local kids within our community.<br /><br />Coder Dojo Facebook Page: <a target="_blank" href="https://www.facebook.com/CoderDojoMosnita">https://www.facebook.com/CoderDojoMosnita</a><br /><br />&quot;Pro Mosnita&quot; NGO Association Facebook Page: <a target="_blank" href="https://www.facebook.com/promosnita">https://www.facebook.com/promosnita</a><br /><br />Website Coming Soon ! :)<br /><br />Coder Dojo Mosnita Noua Requirements</p><ul><li>Age 6 - 17 yrs old</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>&nbsp;</p><p><strong>Registration Form: </strong><a href="http://www.123contactform.com/form-1093715/Formular-De-Inscriere-Coder-Dojo-Mosnita-Noua">www.123contactform.com/form-1093715/Formular-De-Inscriere-Coder-Dojo-Mosnita-Noua</a></p>', 'contact@promosnita.ro', 'https://www.facebook.com/CoderDojoMosnita', 'null', 'null', 'null', 'http://www.promosnita.ro/images/cd_mosnita.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'RO', 'ROU', NULL, NULL, 642, 'Romania', '36', NULL, '', NULL, '', NULL, '', NULL, '672809', 'Moşniţa Nouă');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e54aa-e50f-11e4-8bc4-d4a2af868f3e', 634, 'Gliwice', '3060', '2014-01-23 22:47:10+02', '2014-01-24 13:42:33+02', '3006', 1, 0, 2, 'W każdą sobotę, 15.30 - 18.30', '{"countryName":"Poland","geonameId":"798544","alpha2":"PL"}', '{"toponymName":"Gliwice"}', '{"toponymName":"Silesian Voivodeship"}', '{"toponymName":"Gliwice"}', '{"name":"Gliwice","geonameId":"3099230"}', 'GCOP, ul. Norberta Barlickiego 3, Gliwice', '50.29698510000001,18.673553500000025', '<p>Jeśli potrzebujesz, przynieś ze sobą:</p><ul><li>kompa lub inny niezbędny sprzęt,</li><li>coś do jedzenia i picia</li></ul><p>Jeśli masz 12 lub mniej lat, przyjdź z rodzicem/opiekunem.</p><p>Obowiązuje pozytywne nastawienie i uśmiech na twarzy :)</p>', 'adam@coderdojo.org.pl', 'http://gliwice.coderdojo.org.pl/', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'PL', 'POL', NULL, NULL, 616, 'Poland, Republic of', '83', NULL, '', NULL, '', NULL, '', NULL, '3099230', 'Gliwice');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943c44a-e50f-11e4-8bc4-d4a2af868f3e', 1046, 'Grosseto @ WCH', '4554', '2014-10-29 20:48:30+02', '2014-10-31 11:37:19+02', '4124', 1, 0, 0, 'Saturday 2pm - 4pm (on biweekly basis)', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Grosseto"}', '{"toponymName":"Tuscany"}', '{"toponymName":"Grosseto"}', '{"name":"Grosseto","geonameId":"3175786"}', 'Grosseto, via Podgora 6', '42.7717676,11.112576399999966', '<p>The Grosseto Dojo works is organized thanks to the support of Working Class Hero (WCH), an Onlus which hosts several courses ranging in the fields of artistic disciplines, foreign languages and computer science.&nbsp;</p><p>We meet at the WCH co-working space in via Podgora 6, Grosseto. Classes are in Italian, but we have some good english speaker (as well as a Chinese one!) available among our mentors.</p><p>Our CoderDojo will organize a meeting the 1st and the 3rd saturday of every month, plus additional events every time we can.</p><p>Follow for our updates on the website (coming soon) and <a target="_blank" href="https://twitter.com/CoderDojo_GR">Twitter</a>.</p>', 'coderdojo@workingclasshero.it', 'http://workingclasshero.it/coderdojo', 'CoderDojo_GR', 'null', 'null', 'http://workingclasshero.it/wp-content/uploads/2014/09/logo-scritte-small.png', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '16', NULL, '', NULL, '', NULL, '', NULL, '3175786', 'Grosseto');
