INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c05b0-e50f-11e4-8bc4-d4a2af868f3e', 80, 'Fredericksburg Area, Virginia', '104', '2012-03-19 16:12:41+02', '2013-12-01 14:25:29+02', '3006', 1, 1, 2, 'November 9th, 2013', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Stafford County"}', '{"toponymName":"Virginia"}', '{}', '{"name":"Peach Lawn","geonameId":"7198419"}', 'UMW - Stafford Campus - Learner Space - 125 University Blvd. Fredericksburg, VA 22406-7239, Room B122', '38.37119259367978,-77.5308024406433', 'Prior to Coming, visit our website at: <a href="http://www.FredXCoders.com">www.FredXCoders.com</a><br> And Download Setup Files Here: <a href="http://www.fredxcoders.com/dojo/?p=46">Get Your Machines Code Ready</a><br><br> <ul></li>Bring With You:</ul><ol><li>A laptop. Borrow one from someone if need be.</li><li><strong>If under 18, a Parent must stay onsite during session.</strong></li><li>Self-Serve Snacks</li></ol><br> We are exploring any and all topics of interest among members, including programming for the web, game making, robotics, Minecraft Mod-making, arduino, etc. Bring your interests, share your skills.<br><br><br> Thank you to our Awesome Dojo Supporters!', 'cdva@noizivy.org', 'http://www.fredxcoders.com', 'CoderDojoVA', 'http://groups.google.com/group/coderdojoVA', '8913457391', 'http://www.fredxcoders.com/dojo/wp-content/uploads/2013/05/CDVA_DojoSupportedBy.jpg', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'VA', NULL, '', NULL, '', NULL, '', NULL, '7198419', 'Peach Lawn');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e5be6-e50f-11e4-8bc4-d4a2af868f3e', 648, 'McDonough, GA', '3224', '2014-01-30 23:11:08+02', '2014-02-18 15:11:39+02', '3006', 1, 1, 2, 'Second Sunday of the month, 1:30pm - 4pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Henry County"}', '{"toponymName":"Georgia"}', '{}', '{"name":"McDonough","geonameId":"4208442"}', 'McDonough Public Library, 1001 Florence Mcgarity Blvd, McDonough, GA 30253', '33.4427939,-84.12730340000002', '<p>If you are a parent interested in having your child participate in CoderDojo Henry County, please join our <strong><a href="http://www.meetup.com/CoderDojoMcDonough/">Meetup</a></strong> or follow us on <strong><a href="https://twitter.com/CoderDojoHenry">Twitter</a></strong> or <strong><a href="http://facebook.com/CoderDojoMcDonough">Facebook</a></strong> to be informed when tickets are released for coding sessions.<br />&nbsp;</p><p>CoderDojo McDonough is seeking developers of all skill levels who are interested in sharing their knowledge with local youth. &nbsp; The time commitment required is very low since the monthly sessions only last a couple hours and no preparation is necessary on your part because we will be using resources like codecademy.com. &nbsp;If you are interested in mentoring at CoderDojo McDonough please join our Meetup at <a href="http://www.meetup.com/CoderDojoMcDonough"><strong>http://www.meetup.com/CoderDojoMcDonough</strong></a>.</p>', 'william@coderdojohenry.com', 'http://coderdojohenry.com', 'CoderDojoHenry', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'GA', NULL, '', NULL, '', NULL, '', NULL, '4208442', 'McDonough');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e5e49-e50f-11e4-8bc4-d4a2af868f3e', 653, 'West Waterford', '3235', '2014-02-01 22:39:12+02', '2014-02-20 17:52:20+02', '3006', 1, 1, 2, '19.30 Wednesdays starting on 5th March 2014', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Lismore","geonameId":"2962898"}', 'SVP Hall, Chapel Place, Lismore, Co. Waterford', '52.135655,-7.930789', '<ul><li><p>Wednesdays, 1930 hrs -2100 hrs, beginning 5th March 2014.</p></li><li><h3>Registration by Eventbrite ticketing and Parental Permission form</h3></li><li><h3>Open to people aged 8 to 17 years old.</h3></li></ul><h3>Things to bring:</h3><ul><li><h3>A laptop. Borrow one from someone if needs be.</h3></li><li><h3>Limited number of PCs available</h3></li></ul><ul><li><h3><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></h3></li></ul>', 'coderdojo@cappoquin.net', 'http://www.cappoquin.net/catholic-church', 'null', 'null', '10469898749', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'M', NULL, '', NULL, '', NULL, '', NULL, '2962898', 'Lismore');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bec10-e50f-11e4-8bc4-d4a2af868f3e', 57, 'Tokyo', '64', '2012-03-12 00:11:05+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 1, 'Every Sunday, 13:30 - 14:30', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{"toponymName":"Setagaya-ku"}', '{"toponymName":"Tōkyō"}', '{}', '{"name":"Sasazuka","geonameId":"8573531"}', 'Shimokitazawa OSS Cafe', '35.66551195124144,139.66343879699707', '<p>CoderDojo Tokyo is now open. Please visit our web page at <a href="http://tokyo.coderdojo.jp/">http://tokyo.coderdojo.jp/</a>(Japanese).</p><p>If you are interested and want to attend, please reserve at <a href="https://www.facebook.com/coderdojo.tokyo/events">https://www.facebook.com/coderdojo.tokyo/events</a>.</p><p>English speakers are welcome!!</p><p>Below is the list of what we do:</p><ul><li>Create Games with Scratch</li><li>Create Home Pages with HTML/CSS/Javascript</li><li>Create Games with Javascript</li></ul>', 'tokyo@coderdojo.com', 'null', 'CoderDojoTokyo', 'http://groups.google.com/group/coderdojo-tokyo', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'JP', 'JPN', NULL, NULL, 392, 'Japan', '40', NULL, '', NULL, '', NULL, '', NULL, '8573531', 'Sasazuka');
