INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e6f35-e50f-11e4-8bc4-d4a2af868f3e', 688, 'St. Paul, Minnesota - KatieCoderDojo', '3227', '2014-02-18 23:55:34+02', NULL, 'null', 0, 1, 2, 'Monthly, on Sunday afternoons (See website)', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Ramsey County"}', '{"toponymName":"Minnesota"}', '{}', '{"name":"Mendota","geonameId":"5037278"}', 'University of St. Catherine, St. Paul, Minnesota, USA', '44.92471700000001,-93.18229200000002', '<p><strong>KatieCoderDojo welcomes <em>girls</em> ages 8 to 18 as participants, and adults (male or female) as mentors.&nbsp; Currently we have a games group, using Scratch and a mobile app group using AppInventor.</strong></p><p><strong>Adults must pass a background check. </strong></p><p>Please see website for more information:&nbsp;http://www.codesavvy.org/p/katie-coderdojo.html</p><p>KatieCoderDojo is an initiative of Code Savvy, a non-profit organization dedicated to inspiring a diverse, new code-savvy generation.</p><ul></ul>', 'rebecca@codesavvy.org', 'http://www.codesavvy.org/p/katie-coderdojo.html', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'MN', NULL, '', NULL, '', NULL, '', NULL, '5037278', 'Mendota');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094561f8-e50f-11e4-8bc4-d4a2af868f3e', 1288, 'Coderdojo Noale', '5221', '2015-02-14 15:54:24+02', NULL, 'null', 0, 0, 0, 'L''ultimo sabato del mese, dalle 15 alle 18', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Venice"}', '{"toponymName":"Veneto"}', '{"toponymName":"Noale"}', '{"name":"Ponte Casino","geonameId":"8980414"}', 'Noale', '45.55396843336671,12.077883437078867', '<ul><li>DOVE? A Noale, in via Ongari presso la Sala Civica Daminato, nel retro della nuova Casa di Riposo</li><li>CHI PUO&#39; ISCRIVERSI? Possono iscriversi fino a 30 ragazzi dalla seconda elementare alla terza media, &egrave; sufficiente un PC portatile (anche se cercheremo di fornirne alcuni per i ragazzi che non ne hanno uno a disposizione) una merenda e almeno un genitore che li accompagni e che rimanga con noi durante l&#39;incontro.</li><li>Vai al nostro sito www.talentree.it o nella nostra pagina Facebook www.facebook.it/talentree.it</li><li>Prima di ogni nuovo incontro sar&agrave; messa a disposizione una nuova scheda di iscrizione.</li></ul>', 'null', 'http://www.talentree.it', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '20', NULL, '', NULL, '', NULL, '', NULL, '8980414', 'Ponte Casino');
