INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09457167-e50f-11e4-8bc4-d4a2af868f3e', 1308, 'Manheim Township, PA', '5249', '2015-02-22 23:01:28+02', '2015-02-23 17:34:16+02', '3006', 1, 0, 2, '2nd Tuesday of every month at 6:30pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Lancaster County"}', '{"toponymName":"Pennsylvania"}', '{}', '{"name":"Penn Rose Park","geonameId":"5205396"}', 'Manheim Township Public Library, 595 Granite Run Dr, Lancaster, PA 17601', '40.0783342,-76.32092699999998', '<ul><li>Bring your laptop if you&#39;d like, but we&#39;ve got plenty of computers to use if you don&#39;t have a laptop.</li><li>The library policy states that children 8 and up may attend the library (and programs) on their own provided that they behave in accordance with the library&#39;s Code of Conduct. For CoderDojo programs, parents are encouraged to attend, but not required. &nbsp;Parents are required to accompany any child under 8.</li><li><a href="http://www.mtpl.info/library-events/lancaster-coder-dojo-mt-session">Sign up here</a></li></ul>', 'dan+coderdojo@codeop.com', 'http://codelancaster.org', 'codelancaster', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'PA', NULL, '', NULL, '', NULL, '', NULL, '5205396', 'Penn Rose Park');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e7679-e50f-11e4-8bc4-d4a2af868f3e', 703, 'Guernsey', '3284', '2014-02-28 22:17:05+02', NULL, 'null', 0, 0, 0, 'May 18th launch, 10-2pm and every Saturday after that 10:00-12:00', '{"countryName":"Guernsey","geonameId":"3042362","alpha2":"GG"}', '{}', '{}', '{}', '{"name":"Rozel","geonameId":"6420756"}', 'Guille-Alles Library, Market St, GY1 1HB, Guernsey', '49.45455991820114,-2.537305539147951', '<p>Join us for the launch event on May 18th to create a series of digital projects for the Guernsey Literary Festival. Learn basic code, digital publishing and more!</p><p>What to bring</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'sasha.kazantseva@gmail.com', 'null', 'dojogsy', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GG', 'GGY', NULL, NULL, 831, 'Guernsey, Bailiwick of', '00', NULL, '', NULL, '', NULL, '', NULL, '6420756', 'Rozel');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943c99e-e50f-11e4-8bc4-d4a2af868f3e', 1055, 'Valencia', '4593', '2014-11-06 18:12:09+02', '2014-11-10 11:13:31+02', '4124', 1, 1, 1, 'Mensual, Sábados de 11 a 13', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Valencia"}', '{"toponymName":"Valencia"}', '{"toponymName":"Valencia"}', '{"name":"Valencia","geonameId":"2509954"}', 'Pza de Manises, 2, Valencia', '39.476880808364555,-0.3769394278526761', '<ul><li>Para ser un &quot;coder&quot; s&oacute;lo necesitas asociarte al CodeDojo Valencia en el formulario de la web.</li><li>Es un club de programadores, ni un taller, ni un curso...queremos crear una comunidad de ni&ntilde;os, y que entiendan por que es importante colaborar.</li><li>Trata de llevar tu propio portatil. Tener un entorno de trabajo controlado es la mejor manera de programar. Si no puedes acceder a uno, avisanos con tiempo y trataremos de solucionarlo.</li><li>El equipo de mentores/as son personas voluntarias con diferentes habilidades, experiencia y formaci&oacute;n; ellos y ellas no son profesores al uso pero s&iacute; est&aacute;n para guiarte.</li><li>Es recomendable que un adulto acompa&ntilde;e durante la actividad a las personas menores de 12 a&ntilde;os.</li><li>Todos los eventos ser&aacute;n publicados a traves de nuestra pagina web y conviene que reserves plaza previamente por cuesti&oacute;n de aforo.</li></ul>', 'coderdojovalencia@gmail.com', 'http://www.bylinedu.es/formacion/coderdojovalencia', 'CoderDojoVLC', 'https://groups.google.com/d/forum/coderdojovalencia', '14230514853', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'ES', 'ESP', NULL, NULL, 724, 'Spain, Kingdom of', '60', NULL, '', NULL, '', NULL, '', NULL, '2509954', 'Valencia');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09457dd5-e50f-11e4-8bc4-d4a2af868f3e', 1323, 'CoderDojo Thessaloniki | Arduino &amp; Rasberry Pi Project', '3731', '2015-03-01 18:38:12+02', NULL, 'null', 0, 0, 0, 'Saturday 14 March 2015, 10am - 13pm', '{"countryName":"Greece","geonameId":"390903","alpha2":"GR"}', '{"toponymName":"Thessaloniki"}', '{"toponymName":"Central Macedonia"}', '{"toponymName":"Thessaloniki"}', '{"name":"Thessaloniki","geonameId":"734077"}', 'CITY College, The University of Sheffield International Faculty, Leontos Sofou 3, Thessaloniki', '40.6376749,22.937198500000022', '<p><strong>CoderDojo.Scratch.Arduino.Rasberrypi</strong></p><p>&Sigma;&omicron;&upsilon; &alpha;&rho;έ&sigma;&omicron;&upsilon;&nu; &tau;&alpha; &pi;&alpha;&iota;&chi;&nu;ί&delta;&iota;&alpha;? &Sigma;&omicron;&upsilon; &alpha;&rho;έ&sigma;&epsilon;&iota; &nu;&alpha; &gamma;&rho;ά&phi;&epsilon;&iota;&sigmaf; &kappa;ώ&delta;&iota;&kappa;&alpha;? &Sigma;&omicron;&upsilon; &alpha;&rho;έ&sigma;&epsilon;&iota; &nu;&alpha; &kappa;&alpha;&tau;&alpha;&sigma;&kappa;&epsilon;&upsilon;ά&zeta;&epsilon;&iota;&sigmaf;?</p><p>&Sigma;&tau;&omicron; &epsilon;&pi;ό&mu;&epsilon;&nu;&omicron; <strong>CoderDojo Thessaloniki | Arduino</strong> <strong>Project</strong> &theta;&alpha; &tau;&alpha; έ&chi;&epsilon;&iota;&sigmaf; ό&lambda;&alpha; &mu;&alpha;&zeta;ί!</p><p>&nbsp;&Pi;&iota;&omicron; &alpha;&nu;&alpha;&lambda;&upsilon;&tau;&iota;&kappa;ά &tau;&omicron; &pi;&rho;ό&gamma;&rho;&alpha;&mu;&mu;&alpha; &mu;&alpha;&sigmaf; &pi;&epsilon;&rho;&iota;&lambda;&alpha;&mu;&beta;ά&nu;&epsilon;&iota;:</p><ul><li>&Epsilon;&iota;&sigma;&alpha;&gamma;&omega;&gamma;ή &sigma;&tau;&omicron; &pi;&rho;&omicron;&gamma;&rho;&alpha;&mu;&mu;&alpha;&tau;&iota;&sigma;&tau;&iota;&kappa;ό &gamma;&rho;&alpha;&phi;&iota;&kappa;ό &pi;&epsilon;&rho;&iota;&beta;ά&lambda;&lambda;&omicron;&nu; Scratch.</li><li>&Gamma;&nu;&omega;&rho;&iota;&mu;ί&alpha; &mu;&epsilon; &tau;&alpha; Arduino (<a target="_blank" href="http://www.arduino.cc">http://www.arduino.cc</a>) &kappa;&alpha;&iota;</li><li>Raspberry Pi (<a target="_blank" href="http://www.raspberrypi.org">http://www.raspberrypi.org</a>).</li></ul><p>&nbsp;&Mu;&epsilon;&tau;ά &tau;&alpha; &epsilon;&iota;&sigma;&alpha;&gamma;&omega;&gamma;&iota;&kappa;ά, &alpha;&kappa;&omicron;&lambda;&omicron;&upsilon;&theta;&omicron;ύ&nu; &omicron;&iota; &pi;&rho;ά&xi;&epsilon;&iota;&sigmaf;:</p><ul><li>&Pi;&omega;&sigmaf; &theta;&alpha; &phi;&tau;&iota;ά&xi;&epsilon;&iota;&sigmaf; &tau;&omicron; &delta;&iota;&kappa;ό &sigma;&omicron;&upsilon; &pi;&rho;&omicron;&gamma;&rho;&alpha;&mu;&mu;&alpha;&tau;ά&kappa;&iota;;</li><li>&Pi;&omega;&sigmaf; &pi;&rho;&omicron;&gamma;&rho;&alpha;&mu;&mu;&alpha;&tau;ί&zeta;&epsilon;&iota;&sigmaf; έ&nu;&alpha;&nu; &mu;&iota;&kappa;&rho;&omicron;&epsilon;&lambda;&epsilon;&gamma;&kappa;&tau;ή &mu;&epsilon; &tau;&omicron; Scratch;</li><li>&Pi;&omega;&sigmaf; &theta;&alpha; &alpha;&nu;ά&psi;&epsilon;&iota;&sigmaf; &tau;&alpha; &chi;&rho;&omega;&mu;&alpha;&tau;&iota;&sigma;&tau;ά LEDs;</li><li>&Pi;&omega;&sigmaf; &theta;&alpha; &sigma;&tau;&rho;&iota;&phi;&omicron;&gamma;&upsilon;&rho;ί&sigma;&epsilon;&iota;&sigmaf; &tau;&omicron; Servo;</li><li>&Pi;&omega;&sigmaf; &theta;&alpha; &phi;&tau;&iota;ά&xi;&epsilon;&iota;&sigmaf; &tau;&omicron; &delta;&iota;&kappa;ό &sigma;&omicron;&upsilon; &chi;&epsilon;&iota;&rho;&iota;&sigma;&tau;ή&rho;&iota;&omicron; &gamma;&iota;&alpha; &tau;&omicron; &delta;&iota;&kappa;ό &sigma;&omicron;&upsilon; &pi;&alpha;&iota;&chi;&nu;ί&delta;&iota;;</li></ul><p>&Tau;&omicron; 2&omicron; CoderDojo Thessaloniki | Arduino &delta;&iota;&omicron;&rho;&gamma;&alpha;&nu;ώ&nu;&epsilon;&tau;&alpha;&iota; &sigma;&epsilon; &sigma;&upsilon;&nu;&epsilon;&rho;&gamma;&alpha;&sigma;ί&alpha; &mu;&epsilon; &tau;&eta;&nu; <a target="_blank" href="http://epy-mathra.gr/"><strong>&Epsilon;&Pi;&Upsilon;</strong>-&Pi;&alpha;&rho;ά&rho;&tau;&eta;&mu;&alpha;&nbsp;&Mu;&alpha;&kappa;&epsilon;&delta;&omicron;&nu;ί&alpha;&sigmaf;&nbsp;</a><a target="_blank" href="http://epy-mathra.gr/">&Theta;&rho;ά&kappa;&eta;&sigmaf;</a>&nbsp;&kappa;&alpha;&iota; &mu;&epsilon; &upsilon;&pi;&omicron;&sigma;&tau;&eta;&rho;&iota;&kappa;&tau;ή&nbsp;&tau;&omicron;&nbsp;<a target="_blank" href="http://goo.gl/2F0B6G">City College, The University of Sheffield International Faculty</a></p><p><strong>&Sigma;&eta;&mu;&alpha;&nu;&tau;&iota;&kappa;ό &alpha;&nu; &epsilon;ί&sigma;&alpha;&iota; &kappa;ά&tau;&omega; &tau;&omega;&nu; 12 &epsilon;&tau;ώ&nu; &omicron; &kappa;&eta;&delta;&epsilon;&mu;ό&nu;&alpha;&sigmaf; &sigma;&omicron;&upsilon; &pi;&rho;έ&pi;&epsilon;&iota; &nu;&alpha; &nu;&alpha; &mu;&epsilon;ί&nu;&epsilon;&iota; &mu;&alpha;&zeta;ί &sigma;&omicron;&upsilon; &gamma;&iota;&alpha; ό&lambda;&eta; &tau;&eta; &delta;&iota;ά&rho;&kappa;&epsilon;&iota;&alpha;.</strong></p><p><strong>&Pi;&rho;&omicron;&alpha;&pi;&alpha;&iota;&tau;&omicron;ύ&mu;&epsilon;&nu;&alpha;</strong>: K&alpha;&lambda;ή &delta;&iota;ά&theta;&epsilon;&sigma;&eta;!</p><p><strong>&Tau;&iota; &pi;&rho;έ&pi;&epsilon;&iota; &nu;&alpha; έ&chi;&epsilon;&iota;&sigmaf; &mu;&alpha;&zeta;ί:</strong></p><ul><li><p>&Kappa;ά&pi;&omicron;&iota;&omicron; &sigma;ά&nu;&tau;&omicron;&upsilon;&iota;&tau;&sigmaf;</p></li><li><p>&Tau;&omicron; laptop &sigma;&omicron;&upsilon;</p></li></ul>', 'thessaloniki.gr@coderdojo.com', 'http://goo.gl/gu2pzV', 'LiaTerzidou', 'http://goo.gl/gu2pzV', 'https://www.eventbrite.co', 'null', 1, '3731', '2015-03-02 17:46:46+02', 0, 'null', 'EU', 'GR', 'GRC', NULL, NULL, 300, 'Greece, Hellenic Republic', 'ESYE12', NULL, '', NULL, '', NULL, '', NULL, '734077', 'Thessaloniki');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e91de-e50f-11e4-8bc4-d4a2af868f3e', 729, 'Ronneby CoderDojo', '3387', '2014-03-14 13:00:23+02', '2014-03-20 12:15:58+02', '3006', 1, 1, 1, 'Onsdagar, kl 17:00-19:00 (hela hösten 2014)', '{"countryName":"Sweden","geonameId":"2661886","alpha2":"SE"}', '{"toponymName":"Ronneby Municipality"}', '{"toponymName":"Blekinge"}', '{"toponymName":"Ronneby"}', '{"name":"Ronneby","geonameId":"2681825"}', 'Blasius königsgatan 27, Ronneby', '56.202819,15.272748099999944', '<ul><li>Vi tillhandah&aring;ller datorer gratis, men vill du ta med egen dator g&aring;r det bra.</li><li>Det finns tillg&aring;ng till wi-fi.</li><li>Det bjuds p&aring; fika (&auml;ven f&ouml;r f&ouml;r&auml;ldrar)</li><li>Inga f&ouml;rkunskaper beh&ouml;vs.</li><li>Samling vid Knut Hahns entr&eacute; (p&aring; baksidan mot idrottshallen).</li><li>&Auml;r du under 10 &aring;r vill vi att du tar med en vuxen.</li></ul>', 'ronnebycoderdojo@gmail.com', 'http://ronneby.coderdojo.se', 'Coderdojorby', 'https://groups.google.com/forum/#!forum/ronnebycoderdojo', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'SE', 'SWE', NULL, NULL, 752, 'Sweden, Kingdom of', '02', NULL, '', NULL, '', NULL, '', NULL, '2681825', 'Ronneby');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bd11a-e50f-11e4-8bc4-d4a2af868f3e', 25, 'San Francisco', '9', NULL, '2013-12-01 14:25:30+02', '3006', 1, 1, 2, 'Saturdays, 10am - 1pm. Dates vary, please check http://coderdojosf.com for upcoming classes.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"San Francisco County"}', '{"toponymName":"California"}', '{}', '{"name":"South Beach","geonameId":"5326621"}', '88 Colin P Kelly Jr. Street, San Francisco, CA 94107', '37.78226710000001, -122.3912479', '<p>Classes last about 3 hours and are held on Saturdays at the&nbsp;<a href="https://github.com/">GitHub</a>&nbsp;San Francisco office. Class dates vary. Check our <a href="http://coderdojosf.com">official website</a> for upcoming classes and archived lesson plans.</p>', 'sanfran@coderdojo.com', 'http://coderdojosf.com', 'CoderDojoSF', 'http://groups.google.com/group/coderdojo-sanfran', 'null', 'http://cl.ly/image/2e1A0s3J0h1W/GitHub_Logo.png', 1, '9', '2014-06-02 17:35:07+03', 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'CA', NULL, '', NULL, '', NULL, '', NULL, '5326621', 'South Beach');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bd1f4-e50f-11e4-8bc4-d4a2af868f3e', 27, 'Dublin @ Science Gallery', '2517', NULL, '2013-12-01 14:25:30+02', '3006', 1, 1, 2, 'Saturdays, 1pm - 4pm (excl. Bank Holiday weekends)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Mountjoy","geonameId":"2962486"}', 'Science Gallery, Pearse Street, Dublin 2', '53.344199,-6.250057', '<p><a href="http://coderdojo-dublin.eventbrite.com/">Tickets (Available from 7pm every Monday)</a>. If there are no tickets available please do not contact and ask if they are.</p><p>If you have questions, please ask the <a href="coderdojo-dublin@googlegroups.com">email list</a>!</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 16 or under, your parent must stay in the building during the session.</strong></li></ul><p><em>If there is a specific issue that requires private correspondence please email <a href="mailto:dublin@coderdojo.com">dublin@coderdojo.com</a>. Please do not use this email for general communication such as questions regarding getting places etc, those are for the email list above.</em></p>', 'coderdojo-dublin@googlegroups.com', 'http://coderdojodublin.com', 'coderdojodublin', 'http://groups.google.com/group/coderdojo-dublin', 'null', 'http://d8p7bwma8u8p9.cloudfront.net/sites/all/themes/sgtheme/logo.png', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', NULL, '', NULL, '', NULL, '', NULL, '2962486', 'Mountjoy');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093be24b-e50f-11e4-8bc4-d4a2af868f3e', 38, 'Indianapolis', '30', '2012-03-08 13:39:00+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 2, 'Third Saturday of every month 11am-1pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Marion County"}', '{"toponymName":"Indiana"}', '{}', '{"name":"Woodruff Place","geonameId":"4267213"}', 'Chase Legacy Center Indianapolis, IN', '39.7786133,-86.131845', '<ul><li><strong>Update:</strong> we will have unstructured time before this meeting starting at 10:30!</li><li>Sign up below: 9yo-12th grade</li><li>The Legacy Center is located on the west end of Arsenal Tech&#39;s campus just south of the football field.</li><li>A laptop. Bring your own if available, but we&#39;ll have extras just in case.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Want to get a head start? check out the tutorials we&#39;ve been working through <a href="https://docs.google.com/folder/d/0Bxdm1pSYQcbMOHdSTnFGajdBT1U/edit?pli=1">here!: https://docs.google.com/folder/...</a></li><li>If you have a project you&#39;ve been working on, let us know! email info@coderdojoindy.org and we can get it on the site</li></ul><p><a href="https://www.eventbrite.com/e/coderdojo-indy-tickets-14292133155"><strong>Sign up: https://www.eventbrite.com/e/coderdojo-indy-tickets-14292133155</strong></a></p>', 'info@coderdojoindy.org', 'https://www.eventbrite.com/e/coderdojo-indy-tickets-14292133155', 'coderdojoindy', 'http://groups.google.com/group/coderdojo-indy', '14291846297', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'IN', NULL, '', NULL, '', NULL, '', NULL, '4267213', 'Woodruff Place');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093ea5cc-e50f-11e4-8bc4-d4a2af868f3e', 753, 'Coleraine', '3278', '2014-03-26 23:03:41+02', '2014-04-01 11:18:01+03', '3006', 1, 1, 2, 'Every second Tuesday 6.30pm - 8pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Coleraine"}', '{"toponymName":"Northern Ireland"}', '{}', '{"name":"Coleraine","geonameId":"2652586"}', 'Coder Lab@Causeway Enterprise Agency, Behind main entrance to Causeway Enterprise Agency, Loughanhill Industrial Estate, Coleraine, Co. Londonderry, BT52 2NR', '55.14576640000001,-6.648474999999962', '<p>You don&#39;t need any programming experience to come along.</p><ul><li>We will supply a PC if you are new to Dojo.</li><li>You must sign up on <strong><a href="http://coderdojocoleraine.eventbrite.co.uk">Eventbrite</a></strong>&nbsp;and bring your ticket when you come to Dojo.&nbsp;</li><li>You should be aged between 10 and 16.</li><li><strong>Please bring&nbsp;a parent! (Very important). Your parent must stay with you during the session. We have WiFi and space for them!</strong></li></ul>', 'coleraine.coderdojo@gmail.com', 'null', 'CoderDojoCole', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'NIR', NULL, '', NULL, '', NULL, '', NULL, '2652586', 'Coleraine');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093beeda-e50f-11e4-8bc4-d4a2af868f3e', 62, 'Des Moines', '2816', '2012-03-13 15:01:14+02', '2013-12-01 14:25:30+02', '3006', 1, 1, 4, 'First Sunday of each month, 1pm - 3pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Polk County"}', '{"toponymName":"Iowa"}', '{}', '{"name":"Des Moines","geonameId":"4853828"}', 'Science Center of Iowa,  401 W Martin Luther King Jr Pkwy, Des Moines, IA 50309', '41.5826573,-93.6207756', '<h4>Seeking Mentors</h4><p>CoderDojo Des Moines is currently preparing for a new 2014 program and we are in need of local mentors. &nbsp;<em><strong>If you are interested in helping out with leadership or organization, contact us!</strong></em></p><h4>Students</h4><p>If you are looking to attend once we&#39;re going, here&#39;s what you&#39;ll need:</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'CoderDojoDSM@gmail.com', 'null', 'CoderDojoDSM', 'http://groups.google.com/group/coderdojo-dsm', 'null', 'http://codeiowa.files.wordpress.com/2014/09/coderdojodsm-sponsors1.png', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'IA', NULL, '', NULL, '', NULL, '', NULL, '4853828', 'Des Moines');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093bfd49-e50f-11e4-8bc4-d4a2af868f3e', 74, 'Forward Technology, London NW1 0DU', '96', '2012-03-16 02:21:55+02', '2013-12-01 14:25:30+02', '3006', 1, 0, 2, '12 - 3pm every first Sat of every month restarting in Sept.', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Camden"}', '{"name":"Saint Pancras","geonameId":"2638707"}', 'Forward Technology, Floor 2, Centro 3, 19 Mandela Street, London NW1 0DU', '51.537757,-0.136774', '</li><li>Come along to our free coding club for kids at Forward Technology to learn everything you need to know to become a great coder!<em><br></em></li><li>To sign up: Please register in the Eventbrite section below or at http://coderdojo-london.eventbrite.co.uk. We will reply to confirm your place.<em><br></em></li><li>On the day you''ll need to bring along a laptop.<em><br></em></li><li>Parents must attend to supervise.<em><br></em></li><li>Further details about Coder Dojo at www.coderdojo.com.<em><br></em></li><li>Please email andy.kent@forward.co.uk with any questions about Coder Dojo at Forward, or if you would like to support the dojo in any way. <em><br></em></li><li> Please email vicky@coderdojo.com if you would like to assist with setting up more dojos in the UK. </li>', 'andy.kent@forward.co.uk', 'null', 'CoderDojoLondon', 'null', '3253303719', 'http://b.vimeocdn.com/ps/233/223/2332230_300.jpg', 1, '3006', '2014-03-13 14:22:38+02', 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', NULL, '', NULL, '', NULL, '', NULL, '2638707', 'Saint Pancras');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eae44-e50f-11e4-8bc4-d4a2af868f3e', 763, 'Newcastle, @Center For Life', '2982', '2014-04-03 10:16:04+03', '2014-04-07 11:27:00+03', '3006', 1, 1, 2, 'The third Saturday of every month. 11:00-13:00', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Newcastle upon Tyne"}', '{"toponymName":"England"}', '{}', '{"name":"Newcastle upon Tyne","geonameId":"2641673"}', 'International Centre For Life Times Square Newcastle upon Tyne, Tyne and Wear NE1 4EP', '54.9675588,-1.6211926999999378', '<ul><li>A pack lunch.</li><li>Bring a laptop. If you can borrow one from someone that would help, we only have a couple of spare. Please let us know before coming along so that we can help.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Entry ro CoderDojo is free although the main Venue isn&#39;t so unfortunately we cannot grant entry to the wider venue and its exhibits.</li><li>We are part of the CoderDojo North East network, please see our website for the location of other Dojos.</li></ul>', 'coderdojonewcastle@gmail.com', 'http://www.coderdojonortheast.org.uk', 'coderdojoNE', 'null', 'null', 'http://coderdojonortheast.org.uk/dojo-cms/wp-content/uploads/2014/03/DDCA-Logo.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', NULL, '', NULL, '', NULL, '', NULL, '2641673', 'Newcastle upon Tyne');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c06d7-e50f-11e4-8bc4-d4a2af868f3e', 83, 'Waterford', '113', '2012-03-20 16:08:04+02', '2013-12-01 14:25:29+02', '3006', 1, 1, 2, 'Most Saturday''s from 1pm - 3pm (see schedule on Facebook page)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Ballynaneashagh","geonameId":"3301643"}', 'ArcLabs Innovation Centre, WIT West Campus, Carraiganore, Waterford', '52.253854,-7.187805', '<h5>What You Need</h5> <ul><li>A laptop. Borrow one if necessary and charged where possible.<em><br></em></li><li><strong>A parent (very important if you are aged 12 years and under).</strong></li></ul> <h5>How to Join CoderDojo Waterford</h5> <p>If it''s your first time coming to our dojo, be sure to fill out the <a href="http://www.coderdojowaterford.com/wp-content/uploads/pdfs/CoderDojo_WATERFORD_Parental_Permission_Form.pdf">parental permission form available here</a>. Print, sign and take it with you on your first visit to the dojo.</p> <p>And don''t forget to book your ticket on our <a href="http://coderdojo-waterford.eventbrite.com/">EventBrite page</a></p> <li><strong>Facebook: </strong><a title="coder dojo waterford facebook page" href="http://www.facebook.com/coderdojowaterford" target="_blank">facebook.com/coderdojowaterford</a></li></ul>', 'coderdojowaterford@gmail.com', 'null', 'CoderDojoWford', 'http://groups.google.com/group/coderdojowaterford', 'http://coderdojo-waterfor', 'http://coderdojowaterford.com/wp-content/uploads/2012/coder_dojo_waterford_supporters_logo.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'M', NULL, '', NULL, '', NULL, '', NULL, '3301643', 'Ballynaneashagh');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c27a1-e50f-11e4-8bc4-d4a2af868f3e', 107, 'Charleston, SC @ Jack Russell Software', '222', '2012-04-12 19:00:46+03', '2013-12-01 14:25:29+02', '3006', 1, 0, 2, 'Second Wednesday of every month, 6 - 8 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Charleston County"}', '{"toponymName":"South Carolina"}', '{}', '{"name":"Snowden","geonameId":"4596191"}', '494 C Wando Park Blvd, Mount Pleasant, SC 29466', '32.841231,-79.867948', '<p>Join this google plus community <a href="https://plus.google.com/u/0/communities/101378504202902416735">For News and Updates</a></p><h3>Questions</h3><p>What to expect?</p><p>A Charleston coder dojo is a monthly meetup where kids from 6 - 17 can gather and learn to code together. There is plenty of resources available on the coder dojo website and there will be a few mentors available for questions and direction. This meetup will always be free.</p><p>What should I bring to the dojo?</p><ul><li>A laptop. Borrow one from someone if needs be!</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><h3>Things to do</h3><p>There will be several mentors around to help, also here are some fun projects/kits to work with:</p><ul><li>Codecadamy</li><li>Makey Makey</li><li>Arduino and Inventors Kit</li><li>RasberryPi</li><li>NodeCopter</li><li>VoxelJs</li></ul><p>Programming can be a lot of fun, and these tools/kits enable kids to experience programming in fun and different ways.</p>', 'charleston.us@coderdojo.com', 'https://coderdojochs.github.io', 'coderdojochs', 'https://plus.google.com/u/0/communities/101378504202902416735', '11693640995', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'SC', NULL, '', NULL, '', NULL, '', NULL, '4596191', 'Snowden');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eb2a4-e50f-11e4-8bc4-d4a2af868f3e', 768, 'Lakewood, WA @Pierce County Library', '3563', '2014-04-07 23:21:15+03', '2014-04-16 17:00:21+03', '3006', 1, 1, 1, 'Second and Fourth Mondays 4:30 - 6:30', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Pierce County"}', '{"toponymName":"Washington"}', '{}', '{"name":"Clover Park","geonameId":"5790364"}', '6300 Wildaire Rd SW Lakewood WA 98499', '47.16063949999999,-122.52060519999998', '<p>February - March 2015: BUILD A WEBSITE using HTML and CSS</p><p>April - May 2015: ANIMATE in Scratch and Javascript</p><ul><li>Registration not required at this time.&nbsp;</li><li>Snacks will be provided.</li><li>Bring a laptop, if you have access to one. The library will provide a limited number of laptops for program use.&nbsp;</li><li><strong>Parents and families welcome to play and learn together! If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojolakewood@gmail.com', 'https://www.piercecountylibrary.org/', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'WA', NULL, '', NULL, '', NULL, '', NULL, '5790364', 'Clover Park');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c3a30-e50f-11e4-8bc4-d4a2af868f3e', 144, 'Bandon', '421', '2012-05-29 10:15:22+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 2, 'Active', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Bandon","geonameId":"2966370"}', 'Bandon Grammar School, Bandon, Co. Cork', '51.7336025,-8.749398499999983', '<p>Email us @ bandoncoderdojo@gmail.com to register. You should bring (if you can):<br />&nbsp;</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If under 18, your parent must stay with you during the session otherwise you will not be able to attend.</strong></li></ul><p><br />To start out, we&#39;ll be working on the following:</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>HTML &amp; CSS to set up your own webpage, using <a href="http://notepad-plus-plus.org/" target="_blank">Notepad ++</a> for Windows or <a href="http://www.barebones.com/products/textwrangler/" target="_blank">Text Wrangler for Mac.</a></li><li><a href="http://scratch.mit.edu/" target="_blank">Scratch</a>, a programme designed for children to create their own games without knowing advanced coding, a great start to learning how coding a game works.</li></ul><p><br />The following websites are helpful to get some additional knowledge on these areas:</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li><a href="http://w3schools.com/" target="_blank">W3Schools</a>, easy online tutorials for HTML and CSS</li><li><a href="http://www.codecademy.com" target="_blank">Codecademy</a> an online, interactive, way to learn to code.</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'bandoncoderdojo@gmail.com', 'null', 'bandoncoderdojo', 'https://groups.google.com/forum/?fromgroups&hl=en#!forum/bandon-coderdojo', 'null', 'http://www.arkutech.ie/', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'M', NULL, '', NULL, '', NULL, '', NULL, '2966370', 'Bandon');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093eba7a-e50f-11e4-8bc4-d4a2af868f3e', 778, 'Blackpool Coderdojo', '3600', '2014-04-12 10:14:45+03', '2014-04-14 10:11:24+03', '3006', 1, 0, 2, 'Saturday 26th April 2014 11-3 then once a month', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Blackpool"}', '{"toponymName":"England"}', '{}', '{"name":"Marton","geonameId":"2642943"}', 'Community Room, Tesco Extra, Clifton Road,Blackpool FY4 4UJ', '53.7967495,-2.997340300000019', '<ul><li>Available for absolute beginners to more advanced coders - everyone welcome!</li><li>Please bring a packed&nbsp;lunch.</li><li>A laptop. (Fully charged although there are plug sockets)&nbsp;Borrow one from someone if needs be.</li><li><strong>A parent! (Very important).&nbsp;Your parent or&nbsp;guardian&nbsp;must stay with you during the session.</strong></li></ul>', 'blackpoolcoderdojo@gmail.com', 'null', 'bplcoderdojo', 'https://groups.google.com/forum/#!forum/blackpool-coderdojo', '11234158671', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', NULL, '', NULL, '', NULL, '', NULL, '2642943', 'Marton');
