INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093ec6df-e50f-11e4-8bc4-d4a2af868f3e', 794, 'Phoenix, @MACH1 - Coder Dojo Academy', '3686', '2014-04-28 21:21:51+03', '2014-04-30 10:00:35+03', '3006', 1, 0, 2, 'M-F 3:30-5:30pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Maricopa County"}', '{"toponymName":"Arizona"}', '{}', '{"name":"Phoenix","geonameId":"5308655"}', '1221 N Central Ave, Phoenix AZ  85004', '33.4629165,-112.07307630000003', '<p>Phoenix Public Library/Burton Barr is hosting FREE Coder Dojo our MACH1 Makerspace. Kids ages 8-14 can come any time, M-F. Seating is limited to 12 so rearrive on time. All supplies are provided. Parents are welcome to stay but not required. Feel free to visit our beautiful 5 floor library or browse downtown Phoenix while your child learns amazing new things each day.&nbsp;</p><ul><li><strong>For kids ages 8-14</strong></li><li><strong>3:30-5:30 each day.</strong></li><li><strong>Computers provided, all free!</strong></li><li><strong>No Registration Required!</strong></li></ul>', 'phoenix.us@coderdojo.com', 'http://phoenixpubliclibrary.org', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'AZ', NULL, '', NULL, '', NULL, '', NULL, '5308655', 'Phoenix');
