INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093ecb91-e50f-11e4-8bc4-d4a2af868f3e', 800, 'Pensacola', '3711', '2014-05-02 12:51:23+03', '2014-05-13 14:59:48+03', '3006', 1, 1, 2, '2nd &amp; 4th Thursday''s 6pm - 8pm unless otherwise announced.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Escambia County"}', '{"toponymName":"Florida"}', '{}', '{"name":"Pensacola","geonameId":"4168228"}', '321 N. Devilliers Room 318 Pensacola, FL 32501', '30.416207,-87.22317090000001', '<ul><li>A parent must stay with the child</li><li>Eat before arriving; we will have water</li><li>Bring a laptop, not an iPad</li><li>Above all: Be Cool!</li></ul>', 'pensacola.us@coderdojo.com', 'http://facebook.com/coderdojopensacola', 'null', 'http://coderdojo_pensacola@googlegroups.com', '11921741249', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'FL', NULL, '', NULL, '', NULL, '', NULL, '4168228', 'Pensacola');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c3faf-e50f-11e4-8bc4-d4a2af868f3e', 159, 'Silicon Valley - Mountain View', '433', '2012-06-27 19:20:31+03', '2013-12-01 14:25:29+02', '3006', 1, 1, 2, 'Weekedays, 6:30-8:30 p.m., monthly. Special events and multi-week mini series TBA.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Santa Clara County"}', '{"toponymName":"California"}', '{}', '{"name":"Rex Manor","geonameId":"8479299"}', 'La Avenida Street Mountain View, CA 94043', '37.4132953,-122.07362230000001', '<p><strong>Must Pre-register to attend</strong></p><p>For event announcements and information about how to request a seat make sure to <a href="http://coderdojosv.com/join">join our mailing list</a></p><p>To get involved as a mentor, instructor or event volunteer please <a href="http://coderdojosv.com/join">join our mailing list</a> so we may contact you about upcoming needs and opportunities.</p><p>You may also visit the <a href="http://coderdojosv.com">CoderDojo Silicon Valley Regional Website</a>&nbsp;for more information about our program and to see our <a href="http://coderdojosv.com/#calspan">event calendar</a>.</p><p>What to Bring&nbsp;</p><ul><li>A laptop and charger</li><li><strong>A parent! (Very important). All minors 17 and under, must have a parent/legal guardian stay for the duration of the workshop</strong></li></ul><p>NOTE: <strong>No outside food is allowed</strong> at this venue. Please eat before you come.&nbsp;Light refreshments will be served, compliments of Microsoft!</p>', 'office@coderdojosv.org', 'http://www.coderdojosv.com', 'coderdojosv', 'null', 'null', 'http://www.microsoft.com/global/en-us/news/publishingimages/logos/MSFT_logo_Web.jpg', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'CA', NULL, '', NULL, '', NULL, '', NULL, '8479299', 'Rex Manor');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09403bed-e50f-11e4-8bc4-d4a2af868f3e', 808, 'North Austin, TX', '3734', '2014-05-07 02:22:53+03', '2014-06-17 11:35:16+03', '3006', 1, 0, 4, '3rd saturday of the month 10am - 11:45am (starting June 21 2014)', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Williamson County"}', '{"toponymName":"Texas"}', '{}', '{"name":"Jollyville","geonameId":"4701458"}', 'Spicewood Springs Public Library, 8637 Spicewood Springs Rd., Austin, TX, 78759', '30.43370089999999,-97.77311610000004', '<ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>No registration required at present, just show up!<strong>&nbsp;</strong></li></ul>', 'austin.us@coderdojo.com', 'null', 'null', 'https://groups.google.com/forum/m/#!forum/coderdojo-austin', 'null', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'TX', NULL, '', NULL, '', NULL, '', NULL, '4701458', 'Jollyville');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c4425-e50f-11e4-8bc4-d4a2af868f3e', 167, 'Birr, Co. Offaly', '519', '2012-07-12 08:22:49+03', '2013-12-01 14:25:28+02', '3006', 1, 1, 2, 'Every Wednesdays 6pm-8.30pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Birr","geonameId":"2966154"}', 'Birr Technology Centre, Mill Island, Birr, Co. Offaly', '53.092696837366695,-7.911314964294434', '<p><br /><strong>How to join Coderdojo Birr:</strong></p><p>&nbsp;</p><p>&nbsp;</p><ul><li><strong>1.</strong> If it&#39;s your first time to coming along, please complete the registration form for Coderdojo Birr available <strong><a href="https://docs.google.com/spreadsheet/viewform?fromEmail=true&formkey=dHVNTHF4VmhDQUczZFRKZ1B5UVc5WlE6MA">here</a></strong>. Completing this form does not guarantee your child a place nor does it reserve a place. It&#39;s purpose is to provide essential information and parental contact details to the Birr Dojo organisers.<br /><br /><strong>2.</strong> If you&#39;re planning to join our next session, please note that details of tickets are circulated to all members of our <strong><a target="_blank" href="https://groups.google.com/d/forum/birr-coder-dojo">Google Group.</a></strong> Details of available tickets are issued on Friday lunchtimes. Tickets must be booked through our <a target="_blank" href="http://coderdojobirr.eventbrite.ie">EventBrite</a> Ticketing System. This is the only mentod to secure a place for your child. Please note, that this is a lottery based on first come, first served. Mentors recieve priority booking for their children.</li></ul><p>&nbsp;<p><br /><strong>What you need to bring:</strong></p></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>An evening snack, if desired.</li><li>A FULLY CHARGED laptop. Borrow one from someone if needs be. We have a very limited number of machines to loan each evening. Please email birrcoderdojo@gmail.com for information. Loan laptops are issued on a first come first served basis.</li><li>A parent! (Very important). If you are 13 or under, your parent <strong>must</strong> stay with you during the session. Mums &amp; Dad&#39;s loads of tea &amp; coffee while you get to know each other!</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'BirrCoderDojo@gmail.com', 'null', 'CoderDojoBirr', 'https://groups.google.com/d/forum/birr-coder-dojo', '2421988', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', NULL, '', NULL, '', NULL, '', NULL, '2966154', 'Birr');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cc0ca-e50f-11e4-8bc4-d4a2af868f3e', 377, 'Microsoft Dublin', '1771', '2013-05-27 17:43:28+03', '2013-12-01 14:25:27+02', '3006', 1, 0, 2, 'Wednesday 17:00 - 19:00', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Leopardstown","geonameId":"3315279"}', 'Microsoft European Development Centre (EDC), South County Business Park, Leopardstown, Dublin 18', '53.26676196688815,-6.198606083328286', 'We run every Wednesday evening and we cover HTML5 and Scratch. If you''re planning to attend, please book a ticket below.', 'msdublindojo@outlook.com', 'null', 'MSDublinDojo', 'null', '9460206733', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', NULL, '', NULL, '', NULL, '', NULL, '3315279', 'Leopardstown');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09405477-e50f-11e4-8bc4-d4a2af868f3e', 831, 'Eugene Region, OR @ CS/Dojo Hub', '3839', '2014-05-28 19:16:15+03', '2014-09-29 09:14:21+03', '4124', 1, 1, 2, 'Weekdays (Tues. Thurs.) 3:30pm - 5:30pm ; Weekends Saturday,12am - 4pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Lane County"}', '{"toponymName":"Oregon"}', '{}', '{"name":"Eugene","geonameId":"5725846"}', 'Lane Community College Downtown Campus, 101 West 10th Avenue, Eugene, OR 97301', '44.0488369,-123.09441830000003', '<div>&nbsp;</div><p>&nbsp;Eugene/RegionArea Dojo : &nbsp;</p><p>&nbsp; 2014 Successful Hour of Code , Scratch Sessions !</p><p>&nbsp;2015</p><ul><li>Upcoming events to be announced: Click on this link to join, to receive more information and dates:&nbsp; <a href="http://www.meetup.com/Eugene-Region-CoderDojo-Hub/">http://www.meetup.com/Eugene-Region-CoderDojo-Hub/</a></li><li>Bring your open mind. Refreshments will be provided.</li><li>We will supply computers and . &nbsp;Bring your laptop if you like.&nbsp;</li><li><strong>Parents! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'eugene.us@coderdojo.com', 'http://www.meetup.com/Eugene-Region-CoderDojo-Hub/', 'null', 'null', '11850333667', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'OR', NULL, '', NULL, '', NULL, '', NULL, '5725846', 'Eugene');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c60ba-e50f-11e4-8bc4-d4a2af868f3e', 195, 'London, Code Breaking, Hacking &amp; Spying October 2012', '165', '2012-09-08 13:43:55+03', NULL, 'null', 0, 0, 1, 'Saturday 6th October 12pm - 3pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Camden"}', '{"name":"Camden Town","geonameId":"3345437"}', 'Forward, Camden, London', '51.53800754877571,-0.13668537139892578', '<P>Have you ever wanted to learn how to decipher cryptic codes, send secret messages hidden in images, see when a website is tracking you or try your hand at disarming a bomb!</P> <P>We''ll be covering all these topics and more in a 3 hour race to crack the codes before the time runs out. We''ve even got some super cool prizes lined up for those that get there first.</P> <P><STRONG>We welcome all ages and abilities however all young people must be accompanied by a responsible adult.</STRONG></P> <P>The event is completely free but we do ask that you<STRONG>register here and get a ticket at least 24 hours before each meetup</STRONG>so that we can plan for the correct numbers.</P> <P>More information about this and future events can be found at <A HREF="http://coder-dojo-london.org.uk" TARGET="_blank">coder-dojo-london.org.uk</A></P>', 'andy@forward.co.uk', 'null', 'null', 'null', '3637158840', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', NULL, '', NULL, '', NULL, '', NULL, '3345437', 'Camden Town');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c7512-e50f-11e4-8bc4-d4a2af868f3e', 239, 'Minneapolis, MN (Twin Cities) @ the University of Minnesota', '973', '2013-02-06 21:48:53+02', '2013-12-01 14:25:28+02', '3006', 1, 1, 2, 'Alternating Saturdays, 1:30pm–3:30pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Hennepin County"}', '{"toponymName":"Minnesota"}', '{}', '{"name":"Minneapolis","geonameId":"5037649"}', 'Science Teaching &amp; Student Services at the University of Minnesota 222 Pleasant Street Southeast Minneapolis, MN 55455', '44.9740973,-93.2374324', '<p>CoderDojo Twin Cities is a free event for kids aged 8 to 17 interested in programming and related technology. If you are under 13, a parent or guardian must sign you up and remain at the event with you.</p><p>Please bring:</p><ul><li>A laptop (if you have it)</li><li>A snack (please, do not bring peanuts or other allergens)</li><li>Your ideas and enthusiasm!</li></ul>', 'hello@coderdojotc.org', 'http://www.coderdojotc.org/', 'CoderDojoTC', 'null', 'null', 'http://www.coderdojotc.org/_asset/6wf2e6/clockwork_logo.png', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'MN', NULL, '', NULL, '', NULL, '', NULL, '5037649', 'Minneapolis');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094061b6-e50f-11e4-8bc4-d4a2af868f3e', 856, 'Skerries', '3941', '2014-06-19 15:54:30+03', '2014-06-20 15:41:37+03', '3006', 1, 1, 2, 'Every 1st Sunday of the month, 4 p.m. to 6 p.m starting 7 Sept 2014', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Skerries","geonameId":"2961461"}', 'Joe May''s, Harbour Road, Skerries, Co. Dublin', '53.5832616,-6.10515799999996', '<p>Contact us at coderdojo@skerriesca.com&nbsp;</p><p>Sign up for our Dojos on EventBrite (see below).</p><p>For the monthly CoderDojos, you will need to bring:</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojo@skerriesca.com', 'http://www.skerriesca.com/coderdojo', 'null', 'https://groups.google.com/forum/#!forum/skerriescoderdojo', 'http://www.skerriesca.com', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', NULL, '', NULL, '', NULL, '', NULL, '2961461', 'Skerries');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09406362-e50f-11e4-8bc4-d4a2af868f3e', 859, 'Shinjuku', '81', '2014-06-21 08:46:46+03', NULL, 'null', 0, 0, 1, 'Once a month, Saturdays, 10am - 11am', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{"toponymName":"Shinjuku"}', '{"toponymName":"Tōkyō"}', '{}', '{"name":"Takadanobaba","geonameId":"8693237"}', 'CASE Shinjuku, Takadanobaba 1-28-10, Shinjuku-ku, Tokyo', '35.7121242,139.70476229999997', '<p>You can attend CoderDojo Shinjuku by checking out <a href="http://coderdojoshinjuku.doorkeeper.jp/">here</a>. When you subscribe us, we&#39;ll let you know more event details (e.g. date , contents).</p><p>And when you attend CoderDojo Shinjuku, please check out the following things:</p><ul><li>Please bring a laptop and&nbsp;mouse for a kid.<br />-&nbsp;We don&#39;t prepare them for kids.</li><li><strong>Kids need to be with their parent.<br />-&nbsp;Kids cannot attend this event alone.<br />- If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>* Checking out&nbsp;<a href="https://www.facebook.com/media/set/?set=a.251065831753233.1073741837.162184433974707&type=1">these photos</a>,&nbsp;which were taken at our past events, will be helpful for understanding our Dojo activities.<br />&nbsp;</p>', 'coderdojo.shinjuku@gmail.com', 'http://coderdojoshinjuku.doorkeeper.jp/', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'JP', 'JPN', NULL, NULL, 392, 'Japan', '40', NULL, '', NULL, '', NULL, '', NULL, '8693237', 'Takadanobaba');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c7fff-e50f-11e4-8bc4-d4a2af868f3e', 263, 'North Dakota', '1136', '2013-02-28 15:31:02+02', '2013-12-01 14:25:28+02', '3006', 1, 1, 4, 'Saturday January 25th 2:00pm-5:00pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Burleigh County"}', '{"toponymName":"North Dakota"}', '{}', '{"name":"Bismarck","geonameId":"5688025"}', 'Bismarck Public Library', '46.810103,-100.783778', '<p>Are you a kid in the Bismarck Mandan area between 7 and 17 years old? Want to learn how to code and build cool stuff? Create a game, website or app just for the fun of it. Join us for a fun day of learning to code.</p><p>&nbsp;</p><p><strong>About</strong></p><p>Coder Dojo ND is a free and open non-profit movement to teach youth (ages 7-17) to code. Our sessions are located in the Bismarck-Mandan area and are open to the community youth and parents/guardians. No one is turned away regardless of age. We accept anyone willing to play. Teaching in this case does not involve classes, rather a set of workshops and sessions of local youth interested in learning and collaborating with each other on their own projects.</p><p>&nbsp;</p><p><strong>Terms and Conditions</strong></p><p>By registering for this event you are agreeing to the terms and conditions of Coder Dojo ND. All participants 12 and under must be accompanied by a parent or guardian. You must bring a laptop for working on projects while at the session. If you do not have a laptop please contact us. We may be able to provide a laptop for use during the session. Coder Dojo ND programs and software should not harm or cause hardware/software problems. Coder Dojo ND is not responsible laptop/equipment repair or replacement or the fees that you may incur in the event of a laptop/equipment problem. Coder Dojo ND does not warranty against data loss. You are responsible for your own backups. Coder Dojo ND, the hosting facility, mentors, and sponsors are not liable for accidents, loss, theft, or any issue of liability.</p>', 'uriah@geekmyself.org', 'null', 'coderdojoND', 'https://groups.google.com/forum/#!forum/coder-dojo-nd', '9540216043', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'ND', NULL, '', NULL, '', NULL, '', NULL, '5688025', 'Bismarck');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093c88de-e50f-11e4-8bc4-d4a2af868f3e', 280, 'Soar Studio Deep Ellum Dallas', '473', '2013-03-12 14:09:02+02', NULL, 'null', 0, 1, 2, 'Every Other Thursday from 4:30 - 7:30', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Dallas County"}', '{"toponymName":"Texas"}', '{}', '{"name":"Dallas Downtown","geonameId":"10173845"}', 'Life in Deep Ellum, 2803 Taylor St., Dallas, TX 75226', '32.781836,-96.782298', '<p>Tentative Start Date of May 2, 2013</p> <hr> Sign up at <a href="http://soarstudio.eventbrite.com/">http://soarstudio.eventbrite.com/</a><br> Limit to 15 students, UNLESS, we get more mentors. For each mentor we have, I''ll add 15 students to the total. <hr> <p>Bring...<br> <ul> <li>A snack.</li> <li>A laptop. Borrow one from someone if you need to.<em><br></em></li> <li><strong>A parent! (Very important). If you are 13 or under, your parent, or teacher, must stay with you during the session.</strong> We are connected to a coffee bar, so your parents should be comfortable.</li> <li>A Learning attitude. I will not be teaching you, you will be teaching you. I''ll be there to mentor you, show you where to go to learn, guide you in a good direction to meet your own goals, and answer any relevant questions you may have. If I don''t know the answer, we''ll find it together!</li> </ul> </p><hr><p> <ul <li>Look for the building with the big Umbrella Man on the side</li> </ul> </p><hr><p> Things I can mentor... <ul> <li>html</li> <li>JavaScript</li> <li>CSS</li> <li>JQuery</li> <li>PHP</li> <li>ActionScript</li> <li>Flash</li> <li>SketchUp</li> <li>3D Studio Max</li> <li>Unity 3D</li> </ul> </p><hr>', 'jd@soarstudio.com', 'null', 'jdviz', 'https://groups.google.com/forum/?fromgroups#!forum/soarstudio', '6248173455', 'null', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'TX', NULL, '', NULL, '', NULL, '', NULL, '10173845', 'Dallas Downtown');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09407a00-e50f-11e4-8bc4-d4a2af868f3e', 881, 'Cercola', '4051', '2014-07-23 17:00:37+03', '2014-08-18 13:47:16+03', '3006', 1, 0, 4, '26 ottobre 2014   dalle 10.30  alle 13.00', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Naples"}', '{"toponymName":"Campania"}', '{"toponymName":"Cercola"}', '{"name":"Cercola","geonameId":"3179109"}', 'Viale dei Tigli, 8 Cercola 80040 (NA)', '40.86282024145329,14.353734155819666', '<p>Associazione Polisportiva Dilettantistica Millennio:</p><p>Creative Code Jym, Calcio a 5,&nbsp; WuShu KungFu, Badminton</p><p>Per info 3476336545 oppure 3398389314 oppure tutti i&nbsp;martedi e giovedi dalle 18.00 alle 20.00 al&nbsp; Palasirio Viale dei Fiori in Cercola (NA)</p><p>Incontro Coder-Dojo a il 26 ottobre 2014 dalle 10.30 alle 13.00</p><p>&nbsp;</p><p>&nbsp;</p>', 'cercolacode@gmail.com', 'http://www.millennioasd.com', 'cercola_code', 'null', '12466923905', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '04', NULL, '', NULL, '', NULL, '', NULL, '3179109', 'Cercola');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cad03-e50f-11e4-8bc4-d4a2af868f3e', 336, 'Coding Dojo SP @ iMasters', '1537', '2013-04-19 14:47:02+03', NULL, 'null', 0, 1, 1, 'Toda primeira terÁa feira, 19:30h', '{"countryName":"Brazil","geonameId":"3469034","alpha2":"BR"}', '{"toponymName":"São Paulo"}', '{"toponymName":"São Paulo"}', '{}', '{"name":"Consolação","geonameId":"7521912"}', 'iMasters Lab, Al. Santos, 2395 - 1o. Andar - S?o Paulo - SP', '-23.557726,-46.662933', '<p><b>O Coding Dojo tem algumas regras b·sicas:</p></b> <p><b>Desenvolvimento guiado por testes:</p></b> <p>Antes de fazer qualquer implementaÁ?o, deve ser escrito um teste, que ao passar indica que a implementaÁ?o est· correta.</p> <p><b>ìPassos de bebÍî:</b> Se um teste n?o est· passando, vocÍ deve escrever o cÛdigo mais simples possÌvel que faÁa o teste passar. Quando for escrever um novo teste para o mesmo mÈtodo, escreva um teste que teste sÛ um pouquinho a mais da funcionalidade desejada.</p> <p><b>Pair programming:</b> A programaÁ?o È feita em duplas. Cada dupla tem um piloto e um co-piloto. Ambos pensam em como passar no teste atual, mas sÛ o piloto digita. Cada par tem por volta de 5 a 10 minutos no seu turno. </p> <p>Quando esse tempo acaba:</p> <p>O piloto volta para a platÈia O co-piloto assume o lugar do piloto Um novo co-piloto vem da platÈia</p> <p><b>Todos devem entender:</b> O piloto e o co-piloto devem sempre explicar em voz alta o que est?o tentando fazer para solucionar o problema. Qualquer um na platÈia pode pedir explicaÁ?es se n?o entender algum raciocÌnio.</p> <p><b>TrÍs fases:</b> Um Coding Dojo sempre est· em alguma dessas 3 fases, dependendo do estado dos testes:</p> <p><b>Vermelha:</b> Pelo menos um teste n?o est· passando. A dupla da vez deve se concentrar em fazer o teste passar. A platÈia n?o deve falar nessa fase, para n?o atrapalhar piloto e co-piloto.</p> <p><b>Verde:</b> Os testes acabaram de ser rodados e todos est?o passando. Essa È a hora de quem est· na platÈia dar sugest?es para melhorar o cÛdigo.</p> <p><b>Cinza:</b> O cÛdigo foi modificado de acordo com as sugest?es, mas a bateria de testes ainda n?o foi rodada. Deve-se evitar fazer grandes modificaÁ?es no cÛdigo nessa fase.</p> <br /> <p><b>Fonte: http://pet.inf.ufsc.br/dojo/o-que-eh-dojo/</b></p>', 'ale.alvesborba@gmail.com', 'null', 'null', 'http://groups.google.com/group/dojo_sp?hl=pt-BR', 'null', 'http://static.imasters.com.br/imasters/img/portal/header-logo.png', 1, '1537', '2013-12-20 17:54:34+02', 0, 'null', 'SA', 'BR', 'BRA', NULL, NULL, 76, 'Brazil, Federative Republic of', '27', NULL, '', NULL, '', NULL, '', NULL, '7521912', 'Consolação');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cbeda-e50f-11e4-8bc4-d4a2af868f3e', 372, 'Tallaght', '1733', '2013-05-25 07:42:46+03', '2013-12-01 14:25:27+02', '3006', 1, 1, 2, 'Every second Saturday from 11am to 1pm. See Notes below.', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Tallaght","geonameId":"2961284"}', 'IT Tallaght, Tallaght , Dublin 24', '53.291425,-6.3636000000000195', '<p>CoderDojo Tallaght will not take place during Summer months. It will resume soon. CoderDojo will take place every second Saturday. New members always welcome. Participants are required to book for each session separately and do not need to have attended previously. Booking is via EventBrite : <a href="http://www.eventbrite.ie/o/terry-collins-7493577409">http://www.eventbrite.ie/o/terry-collins-7493577409</a></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>What you need to bring:</strong></p><ul><li>A packed lunch if you think you&#39;ll need it.</li><li>A laptop if you have one or can borrow one. Don&#39;t worry if you don&#39;t have one. We have plenty of PCs.</li><li>Suitable for 7 - 17 year old girls or boys</li><li><strong>A Parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojotallaght@gmail.com', 'null', 'null', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'L', NULL, '', NULL, '', NULL, '', NULL, '2961284', 'Tallaght');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cdae6-e50f-11e4-8bc4-d4a2af868f3e', 408, 'The Buckingham School', '1934', '2013-07-04 15:32:22+03', '2013-12-01 14:25:26+02', '3006', 1, 1, 1, 'Thursday - 3.15 - 4:30 (Starting 16th September 2013)', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Buckingham","geonameId":"2654410"}', 'The Buckingham School, London Road, Buckingham, Mk18 1AT', '51.994407,-0.984181', '<ul><li>Hi - Now is our chance to get some Linux, Python and Pygame going</li> <li>Please bring with you your Raspberry Pi if you have one </li><li>And your legoMindstorm </li><li>Parents with Coding Backgrounds let me know and we will get you involved</li></ul>', 'daveozborne@gmail.com', 'http://buckinghamschoolcoderdojo.edublogs.org/', 'Tbscomputingict', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', '', NULL, '', NULL, '', NULL, '', NULL, '2654410', 'Buckingham');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093cde1b-e50f-11e4-8bc4-d4a2af868f3e', 414, 'Pavia', '1989', '2013-07-26 07:38:36+03', '2013-12-01 14:25:26+02', '3006', 1, 1, 1, 'Sabato mattina, quindicinalmente http//coderdojo.compvter.it', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Bivio Cava Manara","geonameId":"9036155"}', 'presso comPVter (www.compvter.it), via gramsci 30, San Martino Siccomario (PV)', '45.143183,9.119725', '<p>Ti sono piaciuti i <a href="http://compvter.blogspot.it/search/label/kids">comPVter KIDS?</a><br />Bene, adesso andiamo oltre: hai voglia di imparare a programmare con i tuoi amici?<br />Conoscere cosa puoi fare con <strong>Scratch</strong>, come fare una <strong>App </strong>per il tuo telefono o come creare un sito?<br />Ti aspettiamo!!<br />Porta con te:</p><ul><li>un genitore (molto importante!)</li><li>un computer portatile</li><li>una merenda<br />Nel caso tu non avessi un computer faccelo sapere: se possibile te ne presteremo uno, oppure potrai lavorare assieme ad un altro coder!<br /><br />Happy coding! ;)<br /><br />Per maggiori informazioni visita il <a href="http://coderdojo.compvter.it">nostro sito</a>.</li></ul>', 'coderdojopv@compvter.it', 'http://coderdojo.compvter.it', 'CoderDojoPavia', 'null', '7638834961', 'https://dl.dropboxusercontent.com/u/383533/Sede risistemazione 2013/CoderDojo2.jpg', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '', NULL, '', NULL, '', NULL, '', NULL, '9036155', 'Bivio Cava Manara');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09458ef4-e50f-11e4-8bc4-d4a2af868f3e', 1333, 'Ballyjamesduff, Cavan,CAPS', '5332', '2015-03-04 21:51:19+02', NULL, 'null', 0, 0, 0, 'Every Friday 7.00pm - 8.00pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Ulster"}', '{}', '{"name":"Ballyjamesduff","geonameId":"2966550"}', 'ETB Building, Ballyjamesduff,Cavan', '53.866584569850886,-7.200818196650744', '<p>&nbsp;</p><ul><li>Registration is required through Cavan Autism Parents Support.-<em>086 3540899&nbsp;</em></li><li>A set of Headphones.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you in the coffee dock during the session.</strong></li></ul>', 'info@capscoder.com', 'http://www.capscoder.com', 'null', 'null', 'null', 'null', 0, 'null', NULL, 1, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', 'U', 'Ulster', '02', 'An Cabhán', '', '', '', '', '2966550', 'Ballyjamesduff');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093dbea1-e50f-11e4-8bc4-d4a2af868f3e', 421, 'Selr8r / NSC2', '2021', '2013-08-14 17:07:30+03', '2013-12-01 14:25:26+02', '3006', 1, 0, 1, 'Every Saturdays between 12 noon and 3pm', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Fort Cross Roads","geonameId":"3294179"}', 'Selr8r, Building 4100, Avenue 4000, Cork Airport Business Park', '51.8506222,-8.4794068', '<em>If you just want to talk to someone, show up toward the end of the session about 2pm as things are winding down. Other parents and mentors will be there with their kids and can talk to you about it. At the beginning of the session we will be very busy getting organised.</em></p> <p><strong>What you need to bring:</strong></p> <ul> <li>A pack lunch, there are no shops open nearby.</li> <li>YOU MUST BRING A LAPTOP.<em><br /> </em></li> <li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li> </ul> <p><strong>Who can attend:</strong></p> <ul> <li>We accept people all the time, so if you want to start just turn up on the day!</li> <li>We require a parent or guardian to accompany 12s and under partially to keep an eye on their equipment, partially to keep an eye on their charges and partially to learn along with them. Parents and students can eventually become mentors (heck, the kids have come up with far more elegant solutions for some problems).</li> <li>Very young kids may not get much out of it, but we regularly have 8 year olds. They would need to be able to handle medium strength English words and some mathematics to get much out of it. Its thought programming should be done in schools, or at least programmatic thinking, just after long division as its the first abstract algorithm most kids encounter. We do often have younger siblings of kids in the dojo who watch on or play on other computer devices, in preparation for future coding genius.</li> </ul> <p><strong>Cost: Free!</strong><br /> <em>The venue and utilities are provided to us at no charge and mentors donate their time so that we can provide this opportunity for kids at no charge.</em></p> <p><strong>Topics we cover at the moment include:</strong></p> <ul> <li>HTML/CSS/Javascript (Web Frontend).</li> <li>Other topics will be presented depending on what mentors are around on the day. If there is anything in particular that you or the kids would like to cover, let us know.</li> </ul> <br />', 'will@willknott.ie', 'null', 'CoderDojoCork', 'https://groups.google.com/forum/?fromgroups#!forum/coderdojonsc', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IE', 'IRL', NULL, NULL, 372, 'Ireland', '', NULL, '', NULL, '', NULL, '', NULL, '3294179', 'Fort Cross Roads');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093de3b2-e50f-11e4-8bc4-d4a2af868f3e', 451, 'Lincolnshire, IL (Chicago north suburbs)', '2242', '2013-09-24 21:41:03+03', '2013-12-01 14:25:26+02', '3006', 1, 1, 2, 'Saturdays', '{"geonameId":"undefined"}', '{}', '{}', '{}', '{"name":"Lincolnshire","geonameId":"4899983"}', 'Lincolnshire, IL', '42.1900249,-87.9084039', 'Looking for volunteers, mentors, and a space to host our first Dojo in the Chicago suburbs.<br /> <b>Update:</b> Our first session on Oct 19th was a success. Our second session on Nov 16th was terrific too, with even more participants and two new mentors. Thanks to the Vernon Area Public Library for letting us host two events. But <b>WE NEED A VENUE</b> to host a session in January, do you know of a place? Email us at <a href="mailto:coderdojols@gmail.com">coderdojols@gmail.com</a><br /><br /> We will have a session on Saturday February 1st 2014 1pm - 3pm sponsored by the Vernon Area Library. You must register through the library''s calendar page at <a href="http://www.vapld.info/events/events-calendar">http://www.vapld.info/events/events-calendar</a> What to stay in touch? <a href="http://eepurl.com/F4Q1P">Join our email list</a> to get our newsletter, we''ll let you know about upcoming events, and what we are up to.<br /><br /> If you want to help in any way, please drop us a line at <a href="mailto:coderdojols@gmail.com">coderdojols@gmail.com</a> <br/><br /> Right now on the menu we have: Scratch, html/css/javascript and python. We can add more depending on mentor availability and interest. <br /><br /> <ul><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojols@gmail.com', 'null', 'coderdojoLS', 'https://groups.google.com/forum/#!forum/coderdojo-lincolnshire', 'null', 'null', 1, '2242', '2014-11-08 03:39:36+02', 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', '', NULL, '', NULL, '', NULL, '', NULL, '4899983', 'Lincolnshire');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943e8ac-e50f-11e4-8bc4-d4a2af868f3e', 1093, 'Bangor, Co. Down @ Bangor Academy and Sixth Form College', '4711', '2014-11-28 20:43:50+02', '2014-12-15 09:36:23+02', '4124', 1, 1, 2, 'Thursday every fortnight from 6pm-8pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"North Down"}', '{"toponymName":"Northern Ireland"}', '{}', '{"name":"Bangor","geonameId":"2656396"}', 'Bangor Academy and Sixth Form College', '54.6574715,-5.665045400000054', '<p>This Coder Dojo mainly focuses on Raspberry Pis and its uses.</p><ul><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li><strong>A wiliness to have fun and learn some awesome stuff</strong></li><li><strong>A pen drive if you want to take your code home.</strong></li><li><strong>You are not required to being any equipment.</strong></li></ul><p>This session we will be looking a Scratch and making games with it.</p><p>Beginers are welcome to attende.</p>', 'bangoracademy.uk@coderdojo.com', 'https://vlee.me/dojo', 'null', 'null', '16087825118', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'NIR', 'Northern Ireland', '', '', '', '', '', '', '2656396', 'Bangor');
