INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e6d34-e50f-11e4-8bc4-d4a2af868f3e', 684, 'Rochester, IL, @ Rochester Intermediate School', '3221', '2014-02-18 01:02:11+02', '2014-02-20 11:42:48+02', '3006', 1, 1, 1, 'Every Monday 6:30-8 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Sangamon County"}', '{"toponymName":"Illinois"}', '{}', '{"name":"Rochester","geonameId":"4248284"}', 'Rochester Intermediate School, Rochester, IL', '39.74888929999999,-89.51894040000002', '<ul><li>Next dojo <strong>Monday February 23 at 6:30 pm</strong></li><li>Four tracks: &nbsp;Scratch, Minecraft PC Edition, Minecraft Pocket Edition, and Javascript</li><li>There is also a LEGO Robots track that will become a 4-H SPIN group in March</li><li>It&#39;s never too late to start. &nbsp;Make this meeting the first one you attend!</li><li>We meet every Monday that school is in session through May 11, 2015</li><li>Open to all grade levels K-12</li><li>Must be a student in RCUSD 3A</li><li>Parent must stay with RES students and students in Minecraft Pocket Edition track</li><li>Equipment to bring:<ul><li>For Scratch and Javascript, bring your chromebook or a PC</li><li>For Minecraft PC edition, bring your PC with a purchased and installed copy of Minecraft</li><li>For Minecraft pocket edition, bring your Android or iOS phone or tablet with the latest version of Minecraft pocket edition installed</li></ul></li><li><a href="https://docs.google.com/forms/d/1ELJg5RRSupFU8Jhd_QMRRcP6rSq8XDSLzDuA7Zu5e9w/viewform">Click here</a> to preregister</li><li><a href="https://www.facebook.com/groups/600278793422692/">Click here</a> for announcements and the full schedule on Facebook</li><li>This Dojo is run by Rochester Rocket Robotics, a community organization</li></ul>', 'rochrocketrobotics@gmail.com', 'https://www.facebook.com/groups/600278793422692/', 'CoderDojoRochIL', 'null', 'null', 'null', 0, 'null', NULL, 1, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'IL', 'Illinois', '', '', '', '', '', '', '4248284', 'Rochester');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e74c1-e50f-11e4-8bc4-d4a2af868f3e', 699, 'Söderköping', '3268', '2014-02-26 18:14:28+02', '2014-02-27 14:41:39+02', '3006', 1, 1, 4, 'Odd week wednesday, 5.00pm - 7.00pm', '{"countryName":"Sweden","geonameId":"2661886","alpha2":"SE"}', '{"toponymName":"Söderköpings Kommun"}', '{"toponymName":"Östergötland"}', '{"toponymName":"Söderköping"}', '{"name":"Söderköping","geonameId":"2676215"}', 'Ramunderskolan, Söderköping', '58.4759013,16.323430700000017', '<div><h4>Vilka f&aring;r vara med?</h4><p>Barn och ungdomar 7-17 &aring;r. Barn under 12 ska ha s&auml;llskap av en vuxen.</p><h4>Vilka h&aring;ller i tr&auml;ffarna?</h4><p>Det g&ouml;r intresserade mentorer med kunskap om programmering.</p><h4>&Auml;r det en kurs?</h4><p>Nej, det &auml;r inte en vanlig kurs d&auml;r du m&aring;ste delta varje g&aring;ng. Anm&auml;l dig s&aring; att vi vet hur mycket fika som kommer att g&aring; &aring;t.</p><h4>Vad h&auml;nder under de tv&aring; timmarna?</h4><p>Mentorerna ger n&aring;gra f&ouml;rslag p&aring; hur du kan komma ig&aring;ng med programmering. V&auml;lj n&aring;got du tycker &auml;r kul, s&auml;tt dig vid en dator och f&ouml;rs&ouml;k l&ouml;sa uppgiften. Man beh&ouml;ver inte utg&aring; fr&aring;n f&ouml;rslagen utan det g&aring;r utm&auml;rkt att g&ouml;ra n&aring;got utifr&aring;n egna id&eacute;er. Har du egen dator s&aring; kan du ta med den, annars finns det datorer att tillg&aring; i datorsalarna. Beh&ouml;ver du hj&auml;lp s&aring; finns mentorerna d&auml;r f&ouml;r din skull.</p><p>Coderdojo kommer att h&aring;llas udda veckor, p&aring; onsdagar mellan kl 17.00-19.00. Vi h&aring;ller till p&aring; Ramunderskolan, datasalen, ing&aring;ng via Fokus.</p></div>', 'soderkoping.se@coderdojo.com', 'null', 'CoderDojoSkp', 'https://groups.google.com/forum/#!forum/coderdojo-skp', '11366875631', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'SE', 'SWE', NULL, NULL, 752, 'Sweden, Kingdom of', '16', 'Östergötland', '', '', '', '', '', '', '2676215', 'Söderköping');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e8cb1-e50f-11e4-8bc4-d4a2af868f3e', 722, 'Heidelberg', '3362', '2014-03-11 18:32:31+02', '2014-03-12 10:43:20+02', '3006', 1, 1, 2, 'Samstag, 14. März 2015, 13 - 17 Uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{"toponymName":"Karlsruhe Region"}', '{"toponymName":"Baden-Württemberg"}', '{"toponymName":"Stadtkreis Heidelberg"}', '{"name":"Bergheim","geonameId":"8505030"}', 'Dezernat 16 (Alte Feuerwache), Emil-Maier-Straße 16,  69120 Heidelberg', '49.4066435,8.672584599999936', '<p>Eingeladen sind Kinder und Jugendliche ab 10 Jahren, die sich f&uuml;r das Programmieren von Computern interessieren. Sowohl Teilnehmer mit als auch ohne Vorkenntnisse sind willkommen.</p><p>Wir k&ouml;nnen f&uuml;r eine begrenzte Zahl von Teilnehmern Rechner zur Verf&uuml;gung stellen, alle anderen arbeiten auf eigenen mitgebrachten Laptops - notwendige Software halten wir zur Installation bereit.</p><p>Die Teilnahme ist kostenlos,&nbsp;<strong>eine vorherige Anmeldung ist jedoch erforderlich!</strong></p>', 'coderdojo@johanneslink.net', 'http://coderdojohd.github.io', 'CoderDojoHD', 'null', '15567058491', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '01', 'Baden-Württemberg', '', '', '', '', '', '', '8505030', 'Bergheim');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e9a52-e50f-11e4-8bc4-d4a2af868f3e', 739, 'Plantation DoJo @ TKAE', '3425', '2014-03-20 18:41:15+02', '2014-03-24 10:28:01+02', '3006', 1, 1, 2, 'First DoJo is April 27, 2014 - 12PM to 3PM', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Broward County"}', '{"toponymName":"Florida"}', '{}', '{"name":"Pine Island Ridge","geonameId":"4168506"}', 'Temple Kol Ami Emanu-El, 8200 Peters Road, Plantation, FL 33324', '26.104251,-80.25723900000003', '<ul><li>Open to children 5-17 yrs of age with parental consent and a signed waiver.&nbsp;</li><li>Please bring your own bagged lunch and snack.</li><li>Please bring your laptop.</li><li>TKAE Sunday school student that have registered will be escorted to the DoJo from their respective religious school class. &nbsp;</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'plantationdojo@tkae.org', 'https://www.facebook.com/PlantationDoJo', 'plantationdojo', 'null', '11212716537', 'http://tkae.org/wp-content/uploads/2014/03/we-banner.jpg', 0, 'null', NULL, 0, 'null', 'NA', 'US', 'USA', NULL, NULL, 840, 'United States of America', 'FL', 'Florida', '', '', '', '', '', '', '4168506', 'Pine Island Ridge');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('093e9fd1-e50f-11e4-8bc4-d4a2af868f3e', 746, 'Birmingham', '3463', '2014-03-24 13:45:35+02', '2014-04-01 12:39:01+03', '3006', 1, 1, 2, '17:30-18:30 every  Monday', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Birmingham"}', '{"toponymName":"England"}', '{}', '{"name":"Moseley","geonameId":"2642149"}', 'Loco Lounge, Kings heath, B14 7JT', '52.4371216,-1.8928685999999288', '<div>Are you between 6-17? Did you always want to make a game or an app but did not know where to start?</div><div>Join us at &nbsp;Birmingham CoderDojo. No prior experience necessary.&nbsp;</div><div>Every Monday 5-6:30 at the&nbsp;Loco Lounge , Kings heath, B14 7JT<br />All meetings are FREE!<br />What to bring?<ul><li>A laptop/tablet/smartphone. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Good attitude.</li></ul><p>Please register bellow as we are trying to keep the numbers small to start with. You only need a ticket per child, the adults are extra.</p></div>', 'birmingham.uk@coderdojo.com', 'https://sites.google.com/a/coderdojo.com/coderdojobirmingham/', 'CoderDojoBham', 'https://groups.google.com/forum/#!forum/coderdojobirmingham', '11822283769', 'http://allsaintsyouthproject.org.uk/wp-content/themes/allsaints/assets/images/logo.png', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2642149', 'Moseley');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09404ec5-e50f-11e4-8bc4-d4a2af868f3e', 820, 'Braunschweig', '3793', '2014-05-17 18:51:50+03', '2014-05-23 12:40:20+03', '3006', 1, 1, 1, '28.02.2015, 14:00 - 17:00', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Lower Saxony"}', '{}', '{"name":"Donnerburgsiedlung","geonameId":"2936224"}', 'Stratum0, Hamburger Str. 273 A, 38114 Braunschweig', '52.2782844,10.520959500000004', '<p>(English below)<br /><br />Schicke eine Email an coderdojobs@gmail.com und wir setzen dich auf den Verteiler f&uuml;r Erinnerungen und Neuigkeiten.<br /><br />Das n&auml;chste CoderDojo findet &nbsp;wieder in den R&auml;umen von <a href="https://stratum0.org/wiki/Hauptseite">Stratum0</a>, dem&nbsp;<a href="http://de.wikipedia.org/wiki/Hackerspace">Hackerspace</a>&nbsp;in Braunschweig, Hamburger Stra&szlig;e 273 A, statt.<br /><br />CoderDojo ist ein Club fuer Kinder und Jugendliche im Alter von 5 bis 17 Jahren, die programmieren lernen und Spass haben wollen.<br /><br />Hier findest du mehr Informationen: <a href="http://coderdojo.com/about">http://coderdojo.com/about</a></p><p>&nbsp;</p><p>Mitzubringen:<br /><br />Einen Laptop! Falls du keinen hast, leih dir einen oder frag uns.<br />Einen Elternteil! Wenn du 12 Jahre alt oder juenger bist, muss ein Erwachsener die ganze Zeit ueber dabei sein.</p><p>Bericht vom 1. CoderDojo in Braunscheig:</p><p><a href="https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/</a></p><p>Bericht vom 2. CoderDojo in Braunschweig:</p><p><a href="https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/</a></p><p><br /><br />English:<br /><br />Send an email to coderdojobs@gmail.com and we will add you to the mailing list for reminders and updates.<br />CoderDojo is a club for kids aged 5 to 17 to learn to code and have fun.<br /><br />Read more about it here: <a href="http://coderdojo.com/about">http://coderdojo.com/about </a><br /><br />Bring:<br /><br />A laptop. Borrow one from someone, or contact us if you need one.<br />A parent! If you are 12 or under, an adult must stay with you during the session.</p><p>&nbsp;</p><p>Reports: (only in german):</p><p><a href="https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/</a></p><p><a href="https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/</a></p>', 'coderdojobs@gmail.com', 'null', 'coderdojobs', 'null', '15688954084', 'https://stratum0.org/wiki/Logo#mediaviewer/Datei:Sanduhr-wiki-logo.svg', 0, 'null', NULL, 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '06', 'Lower Saxony', '', '', '', '', '', '', '2936224', 'Donnerburgsiedlung');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940504a-e50f-11e4-8bc4-d4a2af868f3e', 823, 'Kodaira', '3798', '2014-05-19 08:19:04+03', '2014-05-20 08:47:27+03', '3006', 1, 1, 2, 'bi-weekly(almost 1st, 3th) Wednesday, 3.30pm-5pm', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{}', '{"toponymName":"Tōkyō"}', '{}', '{"name":"Suzukichō","geonameId":"8572763"}', 'Kodaira, Tokyo', '35.7246285,139.499321', '<h3>For attending:</h3><ul><li>You MUST register ahead.<br />(&nbsp;<a href="https://www.facebook.com/coderdojo.kodaira">Facebook Page</a>,&nbsp;<a href="http://www.zusaar.com/">Zussar</a>,&nbsp;<a href="http://www.doorkeeper.jp/">Doorkeeper</a>&nbsp;and more)</li><li>Age 7-18yrs<br />recommends: mathimatics level&nbsp;&gt; Elementary Grade 3rd</li><li><strong>A parent! (Very important). If you are 9 or under, your parent must stay with you during the session.</strong></li><li>Bring your own laptop. (Win/Mac/Linux)</li><li>Please bring a drink if you wish.</li><li>Just for beginners, we teach how to use <a href="http://scratch.mit.edu/">Scratch</a>.</li></ul><h3>Dojo Information:</h3><ul></ul><ul><li>All events are free.</li><li>Check our site for information about the location of our next Dojo. (Almost we use public facilities. Although we sometime use some personal houses.)</li><li>Looking for mentors and speakers. (in Japanese)</li><li>Go to&nbsp;<a href="http://coderdojo-kodaira.github.io/">our site</a>&nbsp;or&nbsp;<a href="https://www.facebook.com/coderdojo.kodaira">Facebook Page</a>&nbsp;for more information.</li></ul><p>詳細については<a href="http://coderdojo-kodaira.github.io/">公式サイト</a>および<a href="https://www.facebook.com/coderdojo.kodaira">Facebook Page</a>を御確認ください（日本語のみ）。</p>', 'coderdojokodaira@gmail.com', 'http://coderdojo-kodaira.github.io/', 'CoderDojoKodaJp', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'AS', 'JP', 'JPN', NULL, NULL, 392, 'Japan', '40', 'Tōkyō', '', '', '', '', '', '', '8572763', 'Suzukichō');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09406118-e50f-11e4-8bc4-d4a2af868f3e', 855, 'Latsia, Nicosia, @ Open School Latsia', '3939', '2014-06-18 20:41:32+03', '2014-06-23 13:00:58+03', '3006', 1, 1, 1, 'Every Saturday  4:00 ως 6:00,  από 18 Οκτωβρίου', '{"countryName":"Cyprus","geonameId":"146669","alpha2":"CY"}', '{}', '{"toponymName":"Lefkosia"}', '{}', '{"name":"Laxia","geonameId":"146395"}', 'Latsia Gymnasium,  Nicosia, Cyprus', '35.111358282851135,33.37915536517335', '<p>&Omicron;&iota; &mu;ό&nu;&epsilon;&sigmaf; &upsilon;&pi;&omicron;&chi;&rho;&epsilon;ώ&sigma;&epsilon;&iota;&sigmaf; &sigma;&alpha;&sigmaf; &epsilon;ί&nu;&alpha;&iota; &omicron;&iota; &epsilon;&xi;ή&sigmaf;:</p><ul><li>&nu;&alpha; &delta;&eta;&lambda;ώ&sigma;&epsilon;&tau;&epsilon; &sigma;&upsilon;&mu;&mu;&epsilon;&tau;&omicron;&chi;ή &pi;&iota;&omicron; &kappa;ά&tau;&omega;</li><li>&nu;&alpha; &epsilon;&gamma;&gamma;&rho;&alpha;&phi;&epsilon;ί&tau;&epsilon; &sigma;&tau;&omicron; &delta;&iota;&alpha;&delta;ί&kappa;&tau;&upsilon;&omicron; &gamma;&iota;&alpha; &delta;&omega;&rho;&epsilon;ά&nu; &epsilon;&iota;&sigma;&iota;&tau;ή&rho;&iota;&omicron; (&alpha;&pi;&alpha;&rho;&alpha;ί&tau;&eta;&tau;&omicron; &gamma;&iota;&alpha; &nu;&alpha; &pi;&rho;&omicron;&epsilon;&tau;&omicron;&iota;&mu;&alpha;&sigma;&tau;&omicron;ύ&nu; &omicron;&iota; &kappa;&alpha;&tau;ά&lambda;&lambda;&eta;&lambda;&omicron;&iota; &chi;ώ&rho;&omicron;&iota;)</li><li>&nu;&alpha; &sigma;&upsilon;&nu;&omicron;&delta;&epsilon;ύ&sigma;&epsilon;&tau;&epsilon; &tau;&omicron; &pi;&alpha;&iota;&delta;ί &sigma;&alpha;&sigmaf; (&alpha;&nu; &epsilon;ί&nu;&alpha;&iota; &kappa;ά&tau;&omega; &tau;&omega;&nu; 13 &epsilon;&tau;ώ&nu;)</li><li>&nu;&alpha; έ&chi;&epsilon;&tau;&epsilon; &mu;&alpha;&zeta;ί &sigma;&alpha;&sigmaf; έ&nu;&alpha; &phi;&omicron;&rho;&eta;&tau;ό &upsilon;&pi;&omicron;&lambda;&omicron;&gamma;&iota;&sigma;&tau;ή (laptop), &alpha;&nu; &delta;&epsilon;&nu; έ&chi;&epsilon;&tau;&epsilon; &mu;&pi;&omicron;&rho;&epsilon;ί&tau;&epsilon; &nu;&alpha; &delta;&alpha;&nu;&epsilon;&iota;&sigma;&tau;&epsilon;ί&tau;&epsilon; &alpha;&pi;ό &kappa;ά&pi;&omicron;&iota;&omicron;&nu; ή &nu;&alpha; &phi;έ&rho;&epsilon;&tau;&epsilon; &chi;&alpha;&rho;&tau;ί &kappa;&alpha;&iota; &mu;&omicron;&lambda;ύ&beta;&iota;</li><li>&nu;&alpha; έ&chi;&epsilon;&tau;&epsilon; &mu;&alpha;&zeta;ί &sigma;&alpha;&sigmaf; &phi;&alpha;&gamma;&eta;&tau;ό &gamma;&iota;&alpha; &tau;&omicron; &delta;&iota;ά&lambda;&epsilon;&iota;&mu;&mu;&alpha; &kappa;&alpha;&iota; &pi;&omicron;&lambda;ύ &theta;&epsilon;&tau;&iota;&kappa;ή &epsilon;&nu;έ&rho;&gamma;&epsilon;&iota;&alpha;!</li></ul><p>&Epsilon;&mu;&epsilon;ί&sigmaf; &theta;&alpha; &sigma;&alpha;&sigmaf; &pi;&alpha;&rho;ά&sigma;&chi;&omicron;&upsilon;&mu;&epsilon; ό&lambda;&alpha; &tau;&alpha; &upsilon;&pi;ό&lambda;&omicron;&iota;&pi;&alpha;! &Tau;&omicron;&upsilon;&sigmaf; &kappa;&alpha;&theta;&omicron;&delta;&eta;&gamma;&eta;&tau;έ&sigmaf; &tau;&eta;&nu; &pi;&rho;ό&sigma;&beta;&alpha;&sigma;&eta; &sigma;&tau;&omicron; &delta;&iota;&alpha;&delta;ί&kappa;&tau;&upsilon;&omicron;, &theta;&epsilon;&tau;&iota;&kappa;ό &pi;&epsilon;&rho;&iota;&beta;ά&lambda;&lambda;&omicron;&nu; &gamma;&iota;&alpha; &mu;ά&theta;&eta;&sigma;&eta;,&sigma;&upsilon;&nu;&epsilon;&rho;&gamma;&alpha;&sigma;ί&alpha; &kappa;&alpha;&iota; &delta;&eta;&mu;&iota;&omicron;&upsilon;&rho;&gamma;ί&alpha;!</p><p>&Sigma;&tau;&omicron; CoderDojo&nbsp; &theta;&alpha; &mu;ά&theta;&omicron;&upsilon;&mu;&epsilon; &nu;&alpha; &chi;&rho;&eta;&sigma;&iota;&mu;&omicron;&pi;&omicron;&iota;&omicron;ύ&mu;&epsilon; &tau;&omicron;&upsilon;&sigmaf; &upsilon;&pi;&omicron;&lambda;&omicron;&gamma;&iota;&sigma;&tau;έ&sigmaf; &mu;&epsilon; έ&nu;&alpha; &delta;&eta;&mu;&iota;&omicron;&upsilon;&rho;&gamma;&iota;&kappa;ό &kappa;&alpha;&iota; &epsilon;&upsilon;&chi;ά&rho;&iota;&sigma;&tau;&omicron; &tau;&rho;ό&pi;&omicron;, &nu;&alpha; &gamma;&rho;ά&phi;&omicron;&upsilon;&mu;&epsilon; &kappa;ώ&delta;&iota;&kappa;&alpha;, &nu;&alpha; &delta;&eta;&mu;&iota;&omicron;&upsilon;&rho;&gamma;&omicron;ύ&mu;&epsilon; &pi;&alpha;&iota;&chi;&nu;ί&delta;&iota;&alpha;, &iota;&sigma;&tau;&omicron;&sigma;&epsilon;&lambda;ί&delta;&epsilon;&sigmaf;, &epsilon;&phi;&alpha;&rho;&mu;&omicron;&gamma;έ&sigmaf; &kappa;&alpha;&iota; ά&lambda;&lambda;&alpha; &pi;&omicron;&lambda;&lambda;ά &gamma;&iota;&alpha; &upsilon;&pi;&omicron;&lambda;&omicron;&gamma;&iota;&sigma;&tau;έ&sigmaf;, &kappa;&iota;&nu;&eta;&tau;ά &kappa;&alpha;&iota; tablets.</p><p>&nbsp;</p>', 'coderdojocy@gmail.com', 'null', 'null', 'null', '13408865277', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'CY', 'CYP', NULL, NULL, 196, 'Cyprus, Republic of', '04', 'Lefkosia', '', '', '', '', '', '', '146395', 'Laxia');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940674a-e50f-11e4-8bc4-d4a2af868f3e', 865, 'Palermo', '3940', '2014-06-26 17:18:38+03', '2014-06-27 10:28:42+03', '3006', 1, 0, 2, 'Di sabato pomeriggio, una volta alla settimana', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Palermo"}', '{"toponymName":"Sicily"}', '{"toponymName":"Palermo"}', '{"name":"Noce","geonameId":"2524002"}', 'Centro TAU - Via Cipressi, 9 - Palermo', '38.114392315496886,13.345256849598627', '<h3><strong>Che cos&#39;&egrave; CoderDojo?</strong></h3><p>I CoderDojo sono laboratori / club di programmazione gratuiti e aperti a bambini e ragazzi, qui a Palermo partiremo dedicandoci alla fascia d&#39;et&agrave; 7-13.</p><p>Gli eventi si tengono con cadenza periodica, cominceremo con uno alla settimana. Indicativamente fisseremo gli incontri il sabato mattina, ma potremmo decidere di spostarli nel pomeriggio in base alle esigenze dei ragazzi.</p><h3><strong>Cosa si fa durante un evento?</strong></h3><p>Impareremo a utilizzare&nbsp;<a href="http://scratch.mit.edu/">Scratch</a>&nbsp;per creare i nostri primi programmi e semplici videogiochi.</p><p>L&#39;evento dura circa 3 ore, nella prima parte uno dei mentor spiegher&agrave; a tutti il funzionamento di Scratch attraverso un esempio che i bambini riprodurranno sui propri computer, supportati dagli altri mentor. Nella seconda parte, dopo la merenda, i ragazzi saranno liberi di continuare a personalizzare il proprio gioco o crearne un altro sulla base di quello che hanno imparato.</p><h3><strong>Quando e dove cominciamo?</strong></h3><p>Inizieremo con l&#39;anno scolastico 2013/2014. Data la capienza dello spazio e trattandosi del primo esperimento, potremo ospitare al massimo 15 bambini.</p><h3><strong>Che cosa bisogna portare?</strong></h3><ul><li>Un portatile con batteria carica, per ogni bambino (windows, mac, ubuntu), possibilmente con&nbsp;<a href="http://scratch.mit.edu/download">Scratch</a>&nbsp;gi&agrave; installato</li><li>Una merenda</li><li>Un genitore</li></ul><h3><strong>Come ci si iscrive?</strong></h3><p>Scrivete a&nbsp;<a href="mailto:coderdojo.palermo@gmail.com?subject=CoderDojo Palermo">coderdojo.palermo@gmail.com</a>&nbsp;per essere inseriti nelle liste di attesa.</p><h3><strong>Hai bisogno di altre informazioni?</strong></h3><p>Contattaci su <a href="mailto:coderdojo.palermo@gmail.com?subject=CoderDojo Palermo">coderdojo.palermo@gmail.com</a>, cercheremo di risponderti al pi&ugrave; presto!</p><p>&nbsp;</p>', 'coderdojo.palermo@gmail.com', 'http://coderdojopalermo.wordpress.com/', 'coderdojopa', 'https://groups.google.com/forum/#!forum/coderdojo-palermo', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '15', 'Sicily', '', '', '', '', '', '', '2524002', 'Noce');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09407c01-e50f-11e4-8bc4-d4a2af868f3e', 886, 'hamburg @ attraktor', '4074', '2014-07-29 09:47:16+03', '2014-08-05 11:00:37+03', '3006', 1, 1, 0, 'Jeden Samstag, 8 - 12 uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Hamburg"}', '{}', '{"name":"Altona","geonameId":"2911296"}', 'Eschelsweg 4 22767 Hamburg (Altona)', '53.54987988473409,9.946378361813345', '<p>Hallo, lieber Besucher!</p><p>Sch&ouml;n, dass du Interesse hast am CoderDojo teilzunehmen.</p><p>Was genau ist eigentlich CoderDojo?[0]</p><p>CoderDojo ist ein internationaler und lose organisierter Verein von ehrenamtlichen Helfer/innen, die Kindern von 5 bis 17 Jahren einen Raum bieten, um sich zu treffen und mit ganz viel Spa&szlig; Programmieren zu lernen. Was genau sie lernen und wie oft sie sich treffen, liegt dabei ganz im Ermessen der Ehrenamtlichen vor Ort.</p><p>Hier eine kurze Erkl&auml;rung, was dich erwartet.</p><p>Wenn du 12 Jahre alt oder j&uuml;nger bist, muss ein Erwachsener die ganze Zeit &uuml;ber dabei sein.</p><p>Der CoderDojo geht vier Stunden mit selbst&auml;ndigen Pausen.</p><p>Bringe was zu essen und zu trinken mit.</p><p>Bitte bringe mit einen Laptop, mit dem du hier und zu Hause arbeiten kannst. Das Betriebssystem ist dir &uuml;berlassen. F&uuml;r die Scratch[1] Programmierung gibt es die Software, du kannst es auch erst im Browser[2] nutzen. Eine deutsche Wiki Seite[3] findest du hier.</p><p>Tutorials / &Uuml;bungen :[4]</p><p>HTML Tutorials</p><p>Scratch Tutorials</p><p>MINECRAFT Tutorials</p><p>Collective Resources</p><p>Web Servers Tutorials</p><p>[0] http://kleinerdrei.org/2013/11/coderdojo-berlin-ist-da-der-programmier-club-fur-kids-fand-erstmals-in-berlin-statt/</p><p>[1] http://scratch.mit.edu/</p><p>[2] http://scratch.mit.edu/projects/editor/?tip_bar=getStarted</p><p>[3] http://scratch-dach.info/wiki/Hauptseite</p><p>[4] http://kata.coderdojo.com/wiki/Tutorials</p><p><strong>links</strong></p><ul><li>https://wiki.attraktor.org/Arduino#Workshops</li><li>https://wiki.attraktor.org/Termin:Elektronik-Stammtisch30</li><li>https://wiki.attraktor.org/Basteldonnerstag</li></ul>', 'hamburg.de@coderdojo.com', 'null', 'coderdojoathh', 'null', '12443630233', 'null', 1, '4074', '2014-10-06 07:12:43+03', 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '04', 'Hamburg', '', '', '', '', '', '', '2911296', 'Altona');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940aa02-e50f-11e4-8bc4-d4a2af868f3e', 893, 'Durban, South Africa @ ITvarsity', '4087', '2014-08-02 09:30:29+03', '2014-08-20 09:48:34+03', '3006', 1, 0, 2, 'Some Saturdays From 10am to 12pm.', '{"countryName":"South Africa","geonameId":"953987","alpha2":"ZA"}', '{"toponymName":"eThekwini Metropolitan Municipality"}', '{"toponymName":"KwaZulu-Natal"}', '{"toponymName":"Ethekwini"}', '{"name":"Durban","geonameId":"1007311"}', '8th Floor, Sage Life House, 21 Joe Slovo Street, Durban', '-29.8607153,31.02225169999997', '<ul><li>Bring yourself. Snacks are provided.</li><li>We have computer lab.&nbsp; But if you&nbsp;have your own laptop, bring it along.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li><strong>Please see upcoming events on <a href="http://www.eventbrite.com/o/itvarsity-6918316575?s=27345737">our Eventbrite listing.</a></strong></li></ul>', 'coderdojodurban@gmail.com', 'http://www.itvarsity.co.za/coderdojo-durban/', 'null', 'null', '12496741089', 'null', 0, 'null', NULL, 0, 'null', 'AF', 'ZA', 'ZAF', NULL, NULL, 710, 'South Africa, Republic of', '02', 'KwaZulu-Natal', '', '', '', '', '', '', '1007311', 'Durban');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940c1f6-e50f-11e4-8bc4-d4a2af868f3e', 923, 'Bangor, NI, @SERC', '4174', '2014-08-26 03:40:35+03', '2014-09-10 08:18:00+03', '4124', 1, 0, 2, 'Every other Thursday 6:00 PM - 8:00 PM, term-time', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"North Down"}', '{"toponymName":"Northern Ireland"}', '{}', '{"name":"Bangor","geonameId":"2656396"}', 'SERC, Castle Park Road, Bangor, Co.Down, Northern Ireland, BT20 4TD', '54.6561275,-5.661032699999964', '<p>In this Coder Dojo we will start by working through developing&nbsp;computer games in Unity.&nbsp; The coder Dojo runs in the evening from 6:00 PM to 8:00 PM</p><div><p>In session 11 we will look at developing mobile apps using App Inventor 2. In this session you will see how to download the app onto a phone.</p><p>We will look at how the apps are developed and how they work, starting with some simple apps. You can then develop your own app.</p><p>As normal a number of lego Mindstorm kits are available.</p><p>There is also be a number of Lego Mindstorm kits for people to use.</p></div><p>Registration is required before the event (see link below), though you can call in on the day (if not registered you will need a computer with Unity installed).</p><ul><li>Aged between 11 and 18, though if you are over 18 you are welcome to attend.</li><li>We will be focusing on Games Development, but will also be spending time on mobile application development, web design and Raspberry Pi.</li><li>If you want to save your project bring along a USB pen to store the project.</li><li><strong>A parent! (Very important). If you are 14 or under, your parent must stay with you during the session.</strong></li><li><strong>If you have your own laptop, bring it and install Unity 3D </strong></li></ul><p>The location of the Coder Dojo is SERC, Bangor Campus, Room C12. If you have any further queries can you please e-mail Eamonn Brankin (ebrankin@serc.ac.uk).</p><p>&nbsp;</p>', 'sercbangor.gb@coderdojo.com', 'null', 'SERC_Coder_Dojo', 'null', '15972372797', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'NIR', 'Northern Ireland', '', '', '', '', '', '', '2656396', 'Bangor');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09438a1c-e50f-11e4-8bc4-d4a2af868f3e', 947, 'Oxford @ Barclays', '4129', '2014-09-13 14:59:22+03', '2014-09-15 09:00:00+03', '4124', 1, 1, 2, '15th October (next session)', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Oxfordshire"}', '{"toponymName":"England"}', '{"toponymName":"Oxford"}', '{"name":"Summertown","geonameId":"2636537"}', '211-213 Banbury Rd Oxford OX2 7HH', '51.77668250000001,-1.264848700000016', '<p>Are you an enthusiastic coder who wants to develop their ideas further? Or are you maybe someone just fascinated by what can be done in the world of code and want to get started?&nbsp;It makes no difference because either way we want YOU to join us at our CoderDojo in Oxford!</p><p>Attend our weekly sessions held in the amazing workspaces of Barclays for a free golden ticket inside the world of code. This event is open to ANY young person aged between 7-17, whether boy or girl, keen programmer or beginner. Just sign up, and bring yourself, &nbsp;a parent (if you&#39;re under 12) &nbsp;and a laptop (or any other hardware you like) along! We will provide you with comfort, Wifi, and most importantly fantastic mentors and other bright young people at your disposal.</p><p>Remember the only rule: be cool!</p><p>What are you waiting for? sign up now!!!</p><p>&nbsp;</p><p>TO REGISTER:</p><ul><li>email coderdojo@barclays.com with &#39;we want to attend the Summertown CoderDojo&#39; and then include their name and age.</li><li>if you would like more infromation, email coderdojo@barclays.com or joanauk@gmail.com</li></ul>', 'coderdojo@barclays.com', 'null', 'null', 'https://groups.google.com/forum/#!forum/coderdojo-barclaysoxford', 'null', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2636537', 'Summertown');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('094414df-e50f-11e4-8bc4-d4a2af868f3e', 1174, 'Técnico Lisboa', '4901', '2014-12-29 22:33:32+02', '2014-12-30 18:02:58+02', '3199', 1, 0, 1, '2 May 2015', '{"countryName":"Portugal","geonameId":"2264397","alpha2":"PT"}', '{"toponymName":"Lisbon"}', '{"toponymName":"Lisbon"}', '{"toponymName":"São João de Deus"}', '{"name":"Areeiro","geonameId":"2271547"}', 'Instituto Superior Técnico, 1049-001, Lisboa, Portugal', '38.738016, -9.137719', '<p>The first Saturday of every month.</p><p>At the &quot;Pavilh&atilde;o de Inform&aacute;tica I&quot; in the Instituto Superior&nbsp;T&eacute;cnico in Lisbon.</p><p>From 13 to 17 years old (a parent is needed for those 15 years or younger) - no laptop needed.</p><p>The tickets have&nbsp;sold out&nbsp;for the events&nbsp;on the 10/Jan,&nbsp;7/Feb, 7/Mar, and 4/Apr, but we are already offering tickets for the 2/May.</p><p>News about CoderDojo @ T&eacute;cnico:</p><ul><li><a target="_blank" href="http://exameinformatica.sapo.pt/noticias/mercados/2015-01-06-Tecnico-vai-captar-talentos-de-informatica-no-8-ano-de-escolaridade">T&eacute;cnico vai captar talentos de inform&aacute;tica no 8&ordm; ano de escolaridade (Exame Inform&aacute;tica)</a></li><li><a target="_blank" href="http://tecnico.ulisboa.pt/pt/noticias/2015/1/CoderDojo_no_Tecnico_para_mostrar_aos_jovens_a_Engenharia_Informatica">CoderDojo no T&eacute;cnico para mostrar aos jovens a Engenharia Inform&aacute;tica</a></li></ul>', 'coderdojo@tecnico.ulisboa.pt', 'http://www.coderdojo-tecnico.org/', 'null', 'null', '15658175023', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'PT', 'PRT', NULL, NULL, 620, 'Portugal, Portuguese Republic', '14', 'Lisbon', '', '', '', '', '', '', '2271547', 'Areeiro');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('09438d91-e50f-11e4-8bc4-d4a2af868f3e', 954, 'Covent Garden London @ Dragon Hall Tech Hub', '4315', '2014-09-17 09:42:50+03', '2014-09-26 13:21:10+03', '4124', 1, 0, 2, '14/03/2015 2-5pm every month', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Camden"}', '{"name":"Holborn","geonameId":"2646781"}', 'Dragon Hall Tech Hub 17, Stukeley Street, Covent Garden, London WC2B 5LT', '51.516893,-0.12259310000001733', '<p><strong>We&#39;re off again! March 14th&nbsp;</strong></p><p>Come along to learn Scratch, HTML/CSS and more. There are no rules. If you&#39;re under 17 and would like some help with learning to code please register to come along. It&#39;s free for all participants.</p><p>We will have some tasks for you to complete although if you have a project you have been working on and would like some help we are here for you.</p><p>We also have the Kano team with us this session and they &nbsp;will be showing you what you can do with a Kano</p><p>Don&rsquo;t worry if you&rsquo;ve never programmed before, come along and have some fun.</p><p><strong>Create an animation or build a game with Scratch&nbsp;<br />&nbsp;</strong><br />If you already can code then improve your skills.<br /><strong>Build cool stuff, from games to websites to animations to apps</strong>. Meet people like you who are interested in the same sort of things.</p><p>We hope to have a few Raspberry Pi&#39;s and other cool stuff to try</p><p><strong>You will need to bring a laptop</strong>,&nbsp;If you don&#39;t have a laptop or can&#39;t borrow one please email techhub@dragonhall.org.uk as we do have a few.</p><p><strong>If you are under 16 you will need to bring an adult!</strong><br />We welcome all ages and abilities (our main audience is 8 -18 years old, but everyone is invited), however all young people must be accompanied by a responsible adult.<br /><br />The event is completely free but numbers are limited and we do ask that you register&nbsp;and get a ticket at least 24 hours before each meetup so that we can plan for the correct numbers.&nbsp;<br /><br /><strong>What you need to bring:</strong><br /><br />A snack<br /><br />A laptop. Borrow one from someone if needs be.<br /><br />A responsible adult! (Very important). If you are under 16, they must stay with you during the session.</p><p>If you have a project you&#39;ve been working on bring it with you.</p><p>We are always looking for mentors so if you fancy sharing your skills please email techhub@dragonhall.org.uk</p>', 'bookings@dragonhall.org.uk', 'null', 'null', 'http://coder-dojo-london-email@googlegroups.com', '15993166993', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'GB', 'GBR', NULL, NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2646781', 'Holborn');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0940c3ae-e50f-11e4-8bc4-d4a2af868f3e', 926, 'Brisbane Square Library - Web Development', '4153', '2014-08-29 04:26:20+03', '2014-09-01 10:02:16+03', '4124', 1, 1, 0, 'Saturday''s 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Brisbane","geonameId":"2174003"}', 'Brisbane Square Library, 266 George Street, Brisbane City QLD 4000', '-27.4708417,153.0227213', '<p>Over the 6 week program,&nbsp;<strong>kids aged 10 - 17</strong>&nbsp;will learn what they need to know in HTML, CSS, and, if time permits, Javacript, to build their very own website. During the course, kids will learn:</p><ul><li>Basic HTML</li><li>Understanding CSS</li><li>Responsive Design</li><li>Navigation</li></ul><p>And this will all culminate with the kids building their very own 3 page website in the last session. This is all with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop with either Notepad ++ (<a href="http://notepad-plus-plus.org/download/v6.6.8.html">Windows</a>) or TextMate (<a href="http://macromates.com/download">MAC</a>) installed</li><li>snack or lunch</li></ul><p><em><strong>Please Note: a parent is to supervise if a participant is aged under 15 years.</strong></em></p>', 'info@coderdojobrisbane.com.au', 'http://coderdojobrisbane.com.au', 'CoderDojoBNE', 'null', 'null', 'null', 0, 'null', NULL, 0, 'null', 'OC', 'AU', 'AUS', NULL, NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '2174003', 'Brisbane');
INSERT INTO cd_dojos (id, mysql_dojo_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, "time", country, county, state, city, place, location, coordinates, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name) VALUES ('0943bafc-e50f-11e4-8bc4-d4a2af868f3e', 1027, 'Prato', '4393', '2014-10-21 08:54:29+03', '2014-12-12 10:39:16+02', '4124', 1, 1, 1, 'Coderdigers, i bambini conoscono il territorio di prato', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Prato"}', '{"toponymName":"Tuscany"}', '{"toponymName":"Prato"}', '{"name":"Prato","geonameId":"3169921"}', 'Via Dell''Accademia 42 59100 - Prato (PO)', '43.8801542,11.098897399999942', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>Follow us on our website: <a href="http://prato.coderdojo.it">http://prato.coderdojo.it</a></p><ul><li>Una merenda.</li><li>Un computer portatile. Se non ce l&#39;hai fattene prestare uno oppure, se ci avvisi per tempo, te lo prestiamo noi.</li><li><strong>Un genitore! Il tuo accompagnatore deve essere presente durante tutta la durata dell&#39;evento.</strong></li></ul><p>Per maggiori informazioni, seguite il nostro sito: <a href="http://prato.coderdojo.it">http://prato.coderdojo.it</a></p><p>Eventbrite account: <a href="http://www.eventbrite.it/o/coderdojo-prato-7518347595">http://www.eventbrite.it/o/coderdojo-prato-7518347595</a></p><p>Facebook: <a href="https://www.facebook.com/coderdojo.prato">https://www.facebook.com/coderdojo.prato</a></p>', 'prato@coderdojo.it', 'http://prato.coderdojo.it', 'CoderDojoPo', 'null', '15863981596', 'null', 0, 'null', NULL, 0, 'null', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', '16', 'Tuscany', '', '', '', '', '', '', '3169921', 'Prato');
