Bis dann!">per Mail abgegeben</a> werden und gilt f&uuml;r alle zuk&uuml;nftigen Treffen mit, muss also nur einmal unterschrieben werden.</p><p>Vielleicht wohnst du auch nahe Berlin und dann ist das <a href="https://zen.coderdojo.com/dojo/522">Berliner Coder Dojo</a> ein Ziel f&uuml;r dich.</p><h2>English</h2><p>CoderDojo is a club for kids aged 5 to 17 to learn to code and have fun. Read more about it here: <a href="http://coderdojo.com/about">http://coderdojo.com/about</a></p><p>You can <a href="https://groups.google.com/forum/#!forum/coderdojopotsdam">register for news and updates about the Coder Dojo Potsdam</a> or <a href="mailto:coderdojopotsdam@googlegroups.com?subject=Add me to the mailing list&body=Hello, 

please add me to your mailing list.

Thanks!">send an e-mail and we put you on the list</a>. You can also join the <a href="https://www.facebook.com/groups/CoderDojoPotsdam">Facebook group</a>.</p><p>You should bring:</p><ul><li>Something to eat.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li><strong><a href="https://github.com/CoderDojoPotsdam/organize/blob/master/Teilnahmebedingungen-CoderDojo-Potsdam.pdf?raw=true">A signed participation declaration</a></strong>, (once for all meetings).</li><li>Maybe smart-phone or tablet.</li></ul><p>If you have any questions, you can <a href="https://groups.google.com/forum/#!forum/coderdojopotsdam-discuss">contact the organizers</a> or read the <a href="https://github.com/CoderDojoPotsdam/organize/blob/master/FAQ.md#faq---häufig-gestellte-fragen">FAQ page</a>. <a href="https://github.com/CoderDojoPotsdam/organize/blob/master/Teilnahmebedingungen-CoderDojo-Potsdam.pdf?raw=true">The signed participation declaration</a> can also be <a href="mailto:niccokunzmann+teilnahme@gmail.com?subject=Singed version of the participation declaration&body=Hello Nicco,

in this email I send you a signed version of the participation declaration ( owncloud.hpi.de/public.php?service=files&t=8c2182f20736cf759936933aec5176a2&download ) 

See you!">sent as email</a> and needs to be singed once to participate in all meetings.</p><p>If you live near Berlin you may want to visit <a href="https://zen.coderdojo.com/dojo/522">Coder Dojo Berlin</a>, too.</p><h2>Material</h2><p>Mentoren lesen bitte den <a href="http://opentechschool.github.io/slides/presentations/coaching/">Guide der OpenTechSchool</a>. Es gibt sehr gute Tutorials, an die man aber nicht gebunden ist:</p><ul><li><a href="http://learn.opentechschool.org/">OpenTechSchool Material</a> (Python, Javascript, Webseiten f&uuml;r Anf&auml;nger)</li><li><a href="http://www.boles.de/hamster/index2.html">Hamster-Modell</a> (ausgereiftes Informatikmaterial)</li><li><a href="https://python.org/">Python</a> - <a href="http://learn.opentechschool.org/">Anf&auml;nger, Webserver</a>, <a href="http://www.chsterz.de/files/sockets.pdf">Netzwerk</a>, <a href="https://open.hpi.de/courses/pythonjunior2014">Kurs</a> (Allzweckprogrammiersprache)</li><li><a href="http://appinventor.mit.edu/">App Inventor</a> - <a href="http://www.universalsubtitles.org/en/videos/Uhxo9Ar9G9N3/info/talk-to-me-part-1-mit-app-inventor-tutorial-1/">Deutsche Untertitel</a>, <a href="http://schuelerlabor.informatik.rwth-aachen.de/materialien/modulhandbuch-erste-eigene-app">InfoSphere</a> (Apps programmieren)</li><li><a href="http://code.org/">Hour of Code</a> &amp; <a href="https://blockly-demo.appspot.com/static/apps/maze/index.html">Blockly</a> &amp; <a href="http://coderdojo.com/lightbot-coderdojo-edition">LightBot</a> (f&uuml;r J&uuml;ngere, Anf&auml;nger &amp; Spa&szlig;)</li><li><a href="http://scratch.mit.edu/">Scratch</a> - <a href="http://scratch-dach.info/wiki/Kategorie:Tutorials">Tutorials</a>, <a href="http://spielend-programmieren.at/de:tutorials:start">mehr Tutorials</a>, <a href="http://www.swisseduc.ch/informatik/programmiersprachen/scratch_werkstatt/index.html">noch mehr</a> (Online programmieren mit Maus)</li><li><a href="http://pymove3d-de.sudile.com/">Blender</a> (3d mit Python)</li><li><a href="http://digitalsteam.autodesk.com/wp-content/uploads/2014/08/TinkerCoding_Badge_Guide_v10_27_14_vFinal.pdf">Tinker CAD</a> (3d modellieren, English)</li><li><a href="http://www.arduino.cc/">Arduino</a> - <a href="http://starthardware.org/">Tutorial1</a> <a href="http://www.arduino-tutorial.de/inhaltsverzeichnis/">Tutorial2</a> <a href="https://github.com/CoderDojoPotsdam/material#roboter-leicht">Roboter</a> (Schaltungen &amp; Roboter)</li><li><a href="http://www.raspberrypi.org/">Raspberry Pi</a> - <a href="http://www.raspberrypi-spy.co.uk/2012/06/simple-guide-to-the-rpi-gpio-header-and-pins/">Pinbelegung</a>, <a href="http://www.doctormonk.com/2012/07/raspberry-pi-gpio-driving-servo.html">Servo</a> (Schaltungen und Roboter)</li><li><a href="http://codecombat.com/">CodeCombat</a> &amp; <a href="http://www.checkio.org">CheckIO</a> (Programmierspiele)</li><li><a href="http://niccokunzmann.github.io/spiele-mit-kindern/">Etoys</a> (Pong programmieren)</li></ul><p><a href="http://jugendprogrammiert.weebly.com/programmieren">Andere Programmiersprachen</a> ohne Tutorials verlangen mehr Hilfe von Mentoren oder schon Vorkenntnisse im Programmieren. <a href="http://jugendprogrammiert.weebly.com/organisationen/category/freie-materialien">Weitere Materialien</a> k&ouml;nnen durschst&ouml;bert werden, um mehr Tutorials zu finden.</p><h2>Weitere Links</h2><ul><li><a href="https://github.com/CoderDojoPotsdam/projects">Projekte der Coder</a></li><li><a href="https://github.com/CoderDojoPotsdam/organize/blob/master/FAQ.md#faq---häufig-gestellte-fragen">H&auml;ufig gestellte Fragen (FAQ)</a></li><li><a href="https://github.com/CoderDojoPotsdam/organize/tree/master/blog">Blogposts</a></li><li><a href="https://groups.google.com/forum/#!forum/coderdojopotsdam">Mailingliste</a></li><li><a href="https://github.com/CoderDojoPotsdam/organize#coder-dojo-potsdam">Organisationswebseite</a> &amp; <a href="https://groups.google.com/forum/#!forum/coderdojopotsdam-discuss">Organisationsmailingliste</a></li><li><a href="https://www.facebook.com/groups/CoderDojoPotsdam">Facebook</a></li><li><a href="https://twitter.com/DojoPotsdam">Twitter</a></li><li><a href="https://github.com/CoderDojoPotsdam/material">Material</a></li></ul>', 'coderdojopotsdam-discuss@googlegroups.com', 'https://github.com/CoderDojoPotsdam/organize#coder-dojo-potsdam', 'DojoPotsdam', 'https://groups.google.com/forum/#!forum/coderdojopotsdam', '15667317368', 'https://raw.githubusercontent.com/CoderDojoPotsdam/organize/master/supporters.png', 0, 'null', NULL, 0, 'null', 'EU', 'DE', 'DEU', NULL, NULL, 276, 'Germany, Federal Republic of', '16', 'Berlin', '', '', '', '', '', '', '2827649', 'Steinstücken');


